  array('id_ords' => 'anstiftung_1665','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Vorwerk','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2019-03-28','problem' => 'Ein Gast des RepairCafés in Tharandt, das am Vortag stattgefunden hatte, kam mit seinem dort reparierten Vorwerk „Kobold VK 135-1“ Bodenstaubsauger zu uns. Scheinbar hatte er beim Zusammenbau eine Feder im Rastmechanismus der Teleskopstange nicht richtig eingesetzt, denn sie ließ sich komplett herausziehen. Mit der lockeren Stange war natürlich kein Saugen möglich, also bauten wir den Federmechanismus wieder korrekt zusammen. Nun funktioniert die Einrastmechanik wie gewünscht.','googletrans' => 'A guest of the repair café in Tharandt, which had taken place the day before, came to us with his Vork "Kobold VK 135-1" vacuum cleaner there. Apparently, when assembling, he had not properly inserted a spring in the locking mechanism of the telescopic rod, because it was completely pulled out. Of course, no sucking was possible with the loose bar, so we built the spring mechanism again correctly. Now the snap mechanism works as desired.','language' => 'de','fault_type_id' => '0','en' => 'A guest of the RepairCafé in Tharandt, which had taken place the day before, came to us with his Vorwerk "Kobold VK 135-1" floor vacuum cleaner, which had been repaired there. Apparently, he had not properly inserted a spring in the latching mechanism of the telescopic rod during assembly, because it could be pulled out completely. Of course, no vacuuming was possible with the loose rod, so we reassembled the spring mechanism correctly. Now the latching mechanism works as it should.','de' => 'Ein Gast des RepairCafés in Tharandt, das am Vortag stattgefunden hatte, kam mit seinem dort reparierten Vorwerk „Kobold VK 135-1“ Bodenstaubsauger zu uns. Scheinbar hatte er beim Zusammenbau eine Feder im Rastmechanismus der Teleskopstange nicht richtig eingesetzt, denn sie ließ sich komplett herausziehen. Mit der lockeren Stange war natürlich kein Saugen möglich, also bauten wir den Federmechanismus wieder korrekt zusammen. Nun funktioniert die Einrastmechanik wie gewünscht.','nl' => 'Een gast van het RepairCafé in Tharandt, dat de dag ervoor had plaatsgevonden, kwam naar ons toe met zijn daar gerepareerde Vorwerk "Kobold VK 135-1" stofzuiger. Blijkbaar had hij bij de montage een veer niet correct in het vergrendelingsmechanisme van de telescoopstang geplaatst, want deze kon er volledig worden uitgetrokken. Met de losse stang kon natuurlijk niet worden gezogen, dus hebben we het veermechanisme weer correct gemonteerd. Nu werkt het vergrendelingsmechanisme zoals het hoort.','fr' => 'Un client du RepairCafé de Tharandt, qui avait eu lieu la veille, est venu nous voir avec son aspirateur Vorwerk "Kobold VK 135-1" réparé là-bas. Apparemment, lors du remontage, il n\'avait pas mis correctement en place un ressort dans le mécanisme d\'encliquetage du manche télescopique, car celui-ci pouvait être complètement retiré. Il était bien sûr impossible d\'aspirer avec la perche desserrée, nous avons donc remonté correctement le mécanisme à ressort. Maintenant, le mécanisme d\'enclenchement fonctionne comme prévu.','it' => 'Un ospite del RepairCafé di Tharandt, che aveva avuto luogo il giorno prima, è venuto da noi con il suo aspirapolvere Vorwerk "Kobold VK 135-1", che era stato riparato lì. Apparentemente, non aveva inserito correttamente una molla nel meccanismo di bloccaggio dell\'asta telescopica durante il montaggio, perché poteva essere estratta completamente. Naturalmente, non era possibile aspirare con l\'asta allentata, quindi abbiamo rimontato correttamente il meccanismo a molla. Ora il meccanismo di chiusura funziona come dovrebbe.','es' => 'Un invitado al RepairCafé de Tharandt, que había tenido lugar el día anterior, vino con su aspiradora Vorwerk "Kobold VK 135-1", que había sido reparada allí. Al parecer, no había introducido correctamente un muelle en el mecanismo de bloqueo de la barra telescópica durante el montaje, ya que se podía extraer por completo. Por supuesto, no era posible aspirar con la varilla suelta, así que volvimos a montar el mecanismo de resorte correctamente. Ahora el mecanismo de cierre funciona como debería.'),
