  array('id_ords' => 'anstiftung_1712','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Vorwerk','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2019-04-04','problem' => 'Nach einem Zusammenbau klemmte die Rastfunktion für den Saugaufsatz. Nach einer erneuten Zerlegung und dem korrekten Zusammenbau ist jetzt alles an seinem Platz und gängig wie zuvor.','googletrans' => 'After assembly, the locking function clamped for the suction attachment. After a renewed decomposition and correct assembly, everything is now in place and common as before.','language' => 'de','fault_type_id' => '0','en' => 'After one reassembly, the latching function for the suction attachment was stuck. After disassembling again and reassembling correctly, everything is now in place and common as before.','de' => 'Nach einem Zusammenbau klemmte die Rastfunktion für den Saugaufsatz. Nach einer erneuten Zerlegung und dem korrekten Zusammenbau ist jetzt alles an seinem Platz und gängig wie zuvor.','nl' => 'Na hermontage bleek de vergrendeling van de zuignap vast te zitten. Na hem opnieuw te hebben gedemonteerd en correct te hebben gemonteerd, zit alles nu op zijn plaats en werkt het weer als voorheen.','fr' => 'Après un remontage, la fonction d\'encliquetage de l\'embout d\'aspiration s\'est bloquée. Après un nouveau démontage et un remontage correct, tout est maintenant en place et fonctionne comme avant.','it' => 'Dopo il rimontaggio, la funzione di aggancio dell\'attacco di aspirazione era bloccata. Dopo averlo smontato di nuovo e rimontato correttamente, tutto è ora al suo posto e funziona come prima.','es' => 'Después de volver a montarlo, la función de enclavamiento del accesorio de aspiración estaba atascada. Tras desmontarlo de nuevo y volver a montarlo correctamente, todo está en su sitio y funciona como antes.'),
  array('id_ords' => 'anstiftung_1739','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Philips','year_of_manufacture' => '','product_age' => '','repair_status' => 'Unknown','event_date' => '2017-12-14','problem' => 'Angeblich keine Funktion.  Saugkrafteinstellung war auf "0". Nach dem Höherdrehen ging das Gerät. Kein Fehler auffindbar. Wahrschainlich Fehlbedienung.','googletrans' => 'Supposedly no function. Suction force adjustment was on "0". After the inverter, the device went. No error finds. Performing misconception.','language' => 'de','fault_type_id' => '0','en' => 'Allegedly no function.  Suction force setting was at "0". After turning up the speed, the device worked. No error found. Probably incorrect operation.','de' => 'Angeblich keine Funktion.  Saugkrafteinstellung war auf "0". Nach dem Höherdrehen ging das Gerät. Kein Fehler auffindbar. Wahrschainlich Fehlbedienung.','nl' => 'Zogenaamd geen functie.  De zuigkracht stond op "0". Toen ik het aanzette, werkte het apparaat. Er kan geen fout worden gevonden. Waarschijnlijk verkeerde bediening.','fr' => 'Soi-disant pas de fonction.  La puissance d\'aspiration était réglée sur "0". Après avoir augmenté le réglage, l\'appareil a fonctionné. Aucune erreur n\'a été détectée. Probablement une erreur de manipulation.','it' => 'Presumibilmente nessuna funzione.  L\'impostazione della forza di aspirazione era "0". Dopo averla alzata, l\'unità ha funzionato. Non si può trovare alcun difetto. Probabilmente il funzionamento non è corretto.','es' => 'Supuestamente no hay función.  El ajuste de la fuerza de succión se estableció en "0". Después de encenderlo, la unidad funcionó. No se puede encontrar ningún fallo. Probablemente un funcionamiento incorrecto.'),
  array('id_ords' => 'anstiftung_1772','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'BEEM','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2019-05-02','problem' => 'Die eingebauten Akkus wurden nicht mehr geladen.  Test der NiMH-Akkuzellen - ok. Ladeelektronik - ok.  Das Steckernetzteil lieferte im Leerlauf zwar ausreichend Spannung, brach aber mit angestecktem Staubsauger als Last schnell zusammen. Mit einem neuen Netzteil passender Ausgangsspannung und Ausgangsleistung will der Besitzer die Ladeschale nun entsprechend umbauen. Danach sollte er den Sauger wieder wie gewohnt aufladen und nutzen können.','googletrans' => 'The built-in batteries were no longer charged. Test of the NiMH battery cells - OK. Loading electronics - OK. Although the power adapter delivered enough tension at idle, but broke together quickly with an infected vacuum cleaner. With a new power supply suitable output voltage and output power, the owner now wants to rebuild the charging cradle accordingly. After that he should be able to recharge and use the sucker as usual.','language' => 'de','fault_type_id' => '0','en' => 'The installed rechargeable batteries were no longer charged.  Test of NiMH battery cells - ok. Charging electronics - ok.  The plug-in power supply delivered sufficient voltage in idle mode, but quickly collapsed with the vacuum cleaner plugged in as a load. With a new power supply of suitable output voltage and output power, the owner now wants to convert the charging cradle accordingly. After that, he should be able to charge and use the vacuum cleaner again as usual.','de' => 'Die eingebauten Akkus wurden nicht mehr geladen.  Test der NiMH-Akkuzellen - ok. Ladeelektronik - ok.  Das Steckernetzteil lieferte im Leerlauf zwar ausreichend Spannung, brach aber mit angestecktem Staubsauger als Last schnell zusammen. Mit einem neuen Netzteil passender Ausgangsspannung und Ausgangsleistung will der Besitzer die Ladeschale nun entsprechend umbauen. Danach sollte er den Sauger wieder wie gewohnt aufladen und nutzen können.','nl' => 'De ingebouwde oplaadbare batterijen waren niet meer opgeladen.  Test van de NiMH-batterijcellen - ok. Elektronica opladen - ok.  De stekkernetvoeding leverde voldoende spanning in onbelaste toestand, maar viel snel uit als de stofzuiger als belasting werd gebruikt. Met een nieuwe voedingseenheid met passende uitgangsspanning en uitgangsvermogen wil de eigenaar nu het laadstation dienovereenkomstig ombouwen. Daarna zou hij in staat moeten zijn om de stofzuiger op te laden en te gebruiken zoals gewoonlijk.','fr' => 'Les batteries intégrées n\'étaient plus chargées.  Test des éléments de batterie NiMH - ok. Electronique de charge - ok.  Le bloc d\'alimentation fournissait certes une tension suffisante à vide, mais il s\'est rapidement effondré lorsque l\'aspirateur a été branché. Avec un nouveau bloc d\'alimentation d\'une tension et d\'une puissance de sortie adaptées, le propriétaire veut maintenant modifier le chargeur en conséquence. Il devrait ensuite pouvoir recharger et utiliser l\'aspirateur comme à l\'accoutumée.','it' => 'Le batterie ricaricabili integrate non erano più cariche.  Test delle celle della batteria NiMH - ok. Ricarica dell\'elettronica - ok.  L\'alimentatore a spina forniva una tensione sufficiente nel funzionamento a vuoto, ma crollava rapidamente con l\'aspirapolvere inserito come carico. Con un nuovo alimentatore di tensione d\'uscita e potenza d\'uscita adeguate, il proprietario vuole ora convertire la base di ricarica di conseguenza. Dopo di che, dovrebbe essere in grado di caricare e usare l\'aspirapolvere come al solito.','es' => 'Las baterías recargables incorporadas ya no estaban cargadas.  Prueba de las celdas de la batería de NiMH - ok. Carga de aparatos electrónicos - ok.  La fuente de alimentación enchufable proporcionaba suficiente tensión en funcionamiento sin carga, pero se colapsaba rápidamente con la aspiradora enchufada como carga. Con una nueva fuente de alimentación de tensión de salida y potencia de salida adecuadas, el propietario quiere ahora convertir la base de carga de forma adecuada. Después de eso, debería poder cargar y utilizar el aspirador como de costumbre.'),
