  array('id_ords' => 'anstiftung_1821','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Siemens','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-11-22','problem' => 'Fusseln und Staub in der Filtertütenkammer. Eingesetzte No-Name-Filtertüten hielten nicht richtig dicht. Originale verwenden','googletrans' => 'Linn and dust in the filter bag. Inserted no-name filter bags did not held properly. Use originals','language' => 'de','fault_type_id' => '0','en' => 'Lint and dust in the filter bag chamber. No-name filter bags used did not seal properly. Use originals','de' => 'Fusseln und Staub in der Filtertütenkammer. Eingesetzte No-Name-Filtertüten hielten nicht richtig dicht. Originale verwenden','nl' => 'Pluizen en stof in de kamer van de filterzak. Gebruikte merkloze filterzakken sloten niet goed af. Gebruik originelen','fr' => 'Présence de peluches et de poussière dans le compartiment du sac filtrant. Les sacs filtrants de marque n\'étaient pas étanches. Utiliser des filtres originaux','it' => 'Pelucchi e polvere nella camera del sacchetto del filtro. I sacchetti filtranti senza nome utilizzati non hanno sigillato correttamente. Usare gli originali','es' => 'Pelusa y polvo en la cámara de la bolsa del filtro. Las bolsas de filtro utilizadas no sellaban bien. Utilizar los originales'),
  array('id_ords' => 'anstiftung_1829','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2017-09-14','problem' => 'Eine Besucherin hatte die Bodendüse ihres Staubsaugers schon einmal selbst zerlegt, allerdings nicht wieder korrekt zusammengebaut. Dadurch funktionierte die Umschaltung der Bürste nicht richtig. Wir zerlegten das Teil noch einmal und setzten es wieder ordentlich zusammen.','googletrans' => 'A visitor had already disassembled the floor nozzle of her vacuum cleaner, but not correctly assembled again. As a result, the switching of the brush did not work properly. We disappeared the part again and put it together well again.','language' => 'de','fault_type_id' => '0','en' => 'A visitor had already disassembled the floor nozzle of her vacuum cleaner herself once, but had not reassembled it correctly. As a result, the switching of the brush did not work properly. We disassembled the part again and put it back together properly.','de' => 'Eine Besucherin hatte die Bodendüse ihres Staubsaugers schon einmal selbst zerlegt, allerdings nicht wieder korrekt zusammengebaut. Dadurch funktionierte die Umschaltung der Bürste nicht richtig. Wir zerlegten das Teil noch einmal und setzten es wieder ordentlich zusammen.','nl' => 'Een bezoeker had de vloerzuigmond van haar stofzuiger zelf al gedemonteerd, maar niet correct weer in elkaar gezet. Als gevolg daarvan werkte het schakelen van de borstel niet goed. We haalden het onderdeel weer uit elkaar en zetten het weer goed in elkaar.','fr' => 'Une visiteuse avait déjà démonté elle-même le suceur de sol de son aspirateur, mais ne l\'avait pas remonté correctement. De ce fait, la commutation de la brosse ne fonctionnait pas correctement. Nous avons à nouveau démonté la pièce et l\'avons remontée correctement.','it' => 'Una visitatrice aveva già smontato da sola l\'ugello del suo aspirapolvere, ma non l\'aveva rimontato correttamente. Di conseguenza, la commutazione della spazzola non ha funzionato correttamente. Abbiamo smontato di nuovo il pezzo e l\'abbiamo rimontato correttamente.','es' => 'Una visitante había desmontado ella misma la boquilla del suelo de su aspiradora, pero no la había vuelto a montar correctamente. Como resultado, la conmutación del cepillo no funcionó correctamente. Volvimos a desmontar la pieza y la volvimos a montar correctamente.'),
  array('id_ords' => 'anstiftung_1836','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'End of life','event_date' => '2017-08-10','problem' => 'Machte „keinen Mucks“ mehr. Die Akkus hatten keine Spannung mehr, sodass wir vermuteten, sie seien kaputt. Ein manuelles Aufladen mit einem Netzteil (nur zu Testzwecken!) zeigte aber, dass die Zellen doch wieder Ladung aufnahmen. Bei weiteren Untersuchungen stellte sich heraus, dass die Ladeelektronik defekt war. Da war leider nichts zu machen.','googletrans' => 'Made "No Mucks" more. The batteries had no tension, so we suspected they are broken. A manual charging with a power supply (only for testing purposes!) But showed that the cells recording charging again. For further investigations, it turned out that the charging electronics was defective. Unfortunately, there was nothing to do.','language' => 'de','fault_type_id' => '0','en' => 'Made "no sound" anymore. The batteries no longer had any voltage, so we suspected they were broken. However, a manual recharge with a power supply (for test purposes only!) showed that the cells were charging again after all. Upon further investigation, it turned out that the charging electronics were defective. Unfortunately, nothing could be done.','de' => 'Machte „keinen Mucks“ mehr. Die Akkus hatten keine Spannung mehr, sodass wir vermuteten, sie seien kaputt. Ein manuelles Aufladen mit einem Netzteil (nur zu Testzwecken!) zeigte aber, dass die Zellen doch wieder Ladung aufnahmen. Bei weiteren Untersuchungen stellte sich heraus, dass die Ladeelektronik defekt war. Da war leider nichts zu machen.','nl' => 'Maakte geen geluid meer. De batterijen hadden geen spanning meer, dus we vermoedden dat ze stuk waren. Handmatig opladen met een netadapter (alleen voor testdoeleinden!) toonde echter aan dat de cellen toch weer aan het opladen waren. Nader onderzoek wees uit dat de oplaadelektronica defect was. Helaas kon er niets worden gedaan.','fr' => 'Il ne faisait "plus de bruit". Les batteries n\'avaient plus de tension, nous avons donc supposé qu\'elles étaient cassées. Une recharge manuelle à l\'aide d\'un bloc d\'alimentation (uniquement à des fins de test !) a toutefois montré que les cellules se chargeaient à nouveau. Un examen plus approfondi a révélé que l\'électronique de charge était défectueuse. Il n\'y avait malheureusement rien à faire.','it' => 'Non faceva più rumore. Le batterie non avevano più tensione, quindi abbiamo sospettato che fossero rotte. Tuttavia, la ricarica manuale con un adattatore di rete (solo a scopo di test!) ha mostrato che le celle si stavano caricando di nuovo dopo tutto. Ulteriori indagini hanno rivelato che l\'elettronica di ricarica era difettosa. Sfortunatamente, non si poteva fare nulla.','es' => 'Ya no hizo ningún ruido. Las baterías ya no tenían tensión, así que sospechamos que estaban rotas. Sin embargo, la carga manual con un adaptador de red (¡sólo a modo de prueba!) demostró que las células volvían a cargarse después de todo. Las investigaciones posteriores revelaron que el sistema electrónico de carga era defectuoso. Por desgracia, no se pudo hacer nada.'),
  array('id_ords' => 'anstiftung_1868','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2017-05-11','problem' => 'Er hatte den Antrieb schon einmal auseinandergenommen, aber es funktionierte nicht wieder. Wir suchten und fanden die Fehler und bauten das Teil richtig zusammen. Dann ging es auch wieder.','googletrans' => 'He had already taken the drive apart, but it did not work again. We sought and found the mistakes and built the part properly. Then it went again.','language' => 'de','fault_type_id' => '0','en' => 'He had taken the drive apart before, but it didn\'t work again. We looked for and found the faults and reassembled the part properly. Then it also worked again.','de' => 'Er hatte den Antrieb schon einmal auseinandergenommen, aber es funktionierte nicht wieder. Wir suchten und fanden die Fehler und bauten das Teil richtig zusammen. Dann ging es auch wieder.','nl' => 'Hij had de aandrijving al eens uit elkaar gehaald, maar het werkte niet meer. Wij zochten en vonden de fouten en monteerden het onderdeel weer correct. Toen werkte het weer.','fr' => 'Il avait déjà démonté le moteur une fois, mais il ne fonctionnait pas à nouveau. Nous avons cherché et trouvé les erreurs et avons remonté la pièce correctement. Ensuite, il a recommencé à fonctionner.','it' => 'Aveva già smontato il disco una volta, ma non funzionava più. Abbiamo cercato e trovato i difetti e riassemblato il pezzo correttamente. Poi ha funzionato di nuovo.','es' => 'Ya había desmontado la unidad una vez, pero no volvió a funcionar. Hemos buscado y encontrado los fallos y hemos vuelto a montar la pieza correctamente. Luego volvió a funcionar.'),
  array('id_ords' => 'anstiftung_1884','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Unknown','event_date' => '2017-04-13','problem' => 'Er wollte sein Kabel nicht mehr einziehen. Wir wollten das Gerät öffnen und untersuchen, aber der Besitzer entschied sich kurzfristig anders. Er hatte leider keine Zeit mehr und wird uns später noch einmal besuchen.','googletrans' => 'He did not want to move his cable anymore. We wanted to open and examine the device, but the owner decided differently in the short term. Unfortunately he had no time and will visit us later.','language' => 'de','fault_type_id' => '0','en' => 'He did not want to retract his cable. We wanted to open the device and examine it, but the owner decided otherwise at short notice. Unfortunately, he had no more time and will visit us again later.','de' => 'Er wollte sein Kabel nicht mehr einziehen. Wir wollten das Gerät öffnen und untersuchen, aber der Besitzer entschied sich kurzfristig anders. Er hatte leider keine Zeit mehr und wird uns später noch einmal besuchen.','nl' => 'Hij wilde zijn kabel niet intrekken. We wilden de eenheid openen en onderzoeken, maar de eigenaar besloot op korte termijn anders. Helaas had hij geen tijd meer en zal hij ons later nog eens bezoeken.','fr' => 'Il ne voulait plus rétracter son câble. Nous voulions ouvrir l\'appareil et l\'examiner, mais le propriétaire en a décidé autrement à la dernière minute. Il n\'a malheureusement pas eu le temps et reviendra nous voir plus tard.','it' => 'Non ha voluto ritrattare il suo cavo. Volevamo aprire l\'unità ed esaminarla, ma il proprietario ha deciso diversamente con poco preavviso. Purtroppo, non aveva più tempo e verrà a trovarci più tardi.','es' => 'No quiso retraer su cable. Queríamos abrir la unidad y examinarla, pero el propietario decidió lo contr