  array('id_ords' => 'anstiftung_1888','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2017-03-09','problem' => 'Einen bereits zerlegter Staubsauger, der zwar aufgrund eines ausgeschlagenen Motorlagers merkwürdige Geräusche von sich gab, seinen Dienst jedoch noch zufriedenstellend verrichtete, wurde mit unserer Hilfe wieder zusammengebaut.','googletrans' => 'However, an already disassembled vacuum cleaner, who gave strange noises due to a paused engine mount, however, to perform his service satisfactorily, was reassembled with our help.','language' => 'de','fault_type_id' => '0','en' => 'A vacuum cleaner that had already been dismantled and was making strange noises due to a worn motor bearing, but was still performing satisfactorily, was reassembled with our help.','de' => 'Einen bereits zerlegter Staubsauger, der zwar aufgrund eines ausgeschlagenen Motorlagers merkwürdige Geräusche von sich gab, seinen Dienst jedoch noch zufriedenstellend verrichtete, wurde mit unserer Hilfe wieder zusammengebaut.','nl' => 'Een stofzuiger die reeds gedemonteerd was en vreemde geluiden maakte ten gevolge van een versleten motorlager, maar nog steeds naar behoren werkte, werd met onze hulp opnieuw in elkaar gezet.','fr' => 'Un aspirateur déjà démonté, qui faisait des bruits étranges en raison d\'un palier de moteur usé, mais qui fonctionnait encore de manière satisfaisante, a été remonté avec notre aide.','it' => 'Un aspirapolvere che era già stato smontato e che faceva strani rumori a causa di un cuscinetto del motore usurato, ma che funzionava ancora in modo soddisfacente, è stato riassemblato con il nostro aiuto.','es' => 'Una aspiradora que ya había sido desmontada y que hacía ruidos extraños debido a un cojinete de motor desgastado, pero que seguía funcionando satisfactori