  array('id_ords' => 'anstiftung_192','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Miele','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-09-08','problem' => 'Kabelaufwicklung funktioniert nicht','googletrans' => 'Cable rewind does not work','language' => 'de','fault_type_id' => '0','en' => 'Cable winder does not work','de' => 'Kabelaufwicklung funktioniert nicht','nl' => 'Kabel oproller werkt niet','fr' => 'L\'enrouleur de câble ne fonctionne pas','it' => 'L\'avvolgitore di cavi non funziona','es' => 'El enrollador de cables no funciona'),
  array('id_ords' => 'anstiftung_1939','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2016-11-10','problem' => 'Der Motor drehte sich nicht. Wir zerlegten das Gerät und schon kam uns ein Entstörkondensator entgegengebröselt. Versuchsweise überbrückten wir das Bauteil und siehe da, der Motor drehte sich wieder. Wenn der Besucher das Ersatzteil besorgt und das nächste Mal wiederkommt, können wir das Gerät fertigstellen.','googletrans' => 'The engine did not turn. We dismissed the device and already came to us a suppression capacitor. Try we broke the component and behold, the engine turned back. If the visitor worried the spare part and next time comes back, we can finish the device.','language' => 'de','fault_type_id' => '0','en' => 'The motor did not turn. We disassembled the device and an interference suppression capacitor came crumbling towards us. Tentatively, we bypassed the component and lo and behold, the motor turned again. If the visitor gets the spare part and comes back next time, we can finish the unit.','de' => 'Der Motor drehte sich nicht. Wir zerlegten das Gerät und schon kam uns ein Entstörkondensator entgegengebröselt. Versuchsweise überbrückten wir das Bauteil und siehe da, der Motor drehte sich wieder. Wenn der Besucher das Ersatzteil besorgt und das nächste Mal wiederkommt, können wir das Gerät fertigstellen.','nl' => 'De motor draaide niet. We haalden het toestel uit elkaar en een ontstoringscondensator kwam op ons af. We probeerden de component te overbruggen en zie, de motor draaide weer. Als de bezoeker het reserveonderdeel krijgt en de volgende keer terugkomt, kunnen we de eenheid afmaken.','fr' => 'Le moteur ne tournait pas. Nous avons démonté l\'appareil et un condensateur d\'antiparasitage s\'est émietté. Nous avons essayé de ponter le composant et voilà que le moteur s\'est remis à tourner. Si le visiteur se procure la pièce de rechange et revient la prochaine fois, nous pourrons terminer l\'appareil.','it' => 'Il motore non ha girato. Abbiamo smontato l\'unità e un condensatore di soppressione delle interferenze si è sbriciolato verso di noi. Abbiamo provato a collegare il componente ed ecco che il motore ha ripreso a girare. Se il visitatore ottiene il pezzo di ricambio e torna la prossima volta, possiamo finire l\'unità.','es' => 'El motor no giraba. Desmontamos la unidad y un condensador de supresión de interferencias vino hacia nosotros. Probamos a puentear el componente y he aquí que el motor volvió a girar. Si el visitante consigue la pieza de repuesto y vuelve la próxima vez, podremos terminar la unidad.'),
  array('id_ords' => 'anstiftung_194','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Vorwerk','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-09-08','problem' => 'Bürste dreht sich nicht mehr','googletrans' => 'Brush does not turn anymore','language' => 'de','fault_type_id' => '0','en' => 'Brush no longer rotates','de' => 'Bürste dreht sich nicht mehr','nl' => 'Borstel draait niet meer','fr' => 'La brosse ne tourne plus','it' => 'La spazzola non gira più','es' => 'El cepillo ya no gira'),
  array('id_ords' => 'anstiftung_1945','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2016-09-08','problem' => 'Drehte sich kein Rad mehr - es waren die Kohlebürsten abgenutzt. Der Besitzer hatte Austauschkohlen mit, aber diese passten nicht ganz. Wir schliffen sie auf das richtige Maß zurecht und bauten sie ein. Der Staubsauger lief wieder, aber die neuen Kohlen müssen erst einmal einlaufen. Der Besucher wird das Gerät zu Hause langsam an die neuen teile gewöhnen.','googletrans' => 'No Rad turned anymore - the carbon brushes were worn. The owner had replacement coals, but these did not fit completely. We cut you up to the right level and built you. The vacuum cleaner ran again, but the new coals must first run. The visitor will slowly get used to the new parts at home.','language' => 'de','fault_type_id' => '0','en' => 'Turned no more wheel - it was the carbon brushes worn out. The owner had replacement brushes with him, but they didn\'t quite fit. We ground them down to the right size and installed them. The vacuum cleaner ran again, but the new carbons need to break in first. The visitor will slowly get the unit used to the new parts at home.','de' => 'Drehte sich kein Rad mehr - es waren die Kohlebürsten abgenutzt. Der Besitzer hatte Austauschkohlen mit, aber diese passten nicht ganz. Wir schliffen sie auf das richtige Maß zurecht und bauten sie ein. Der Staubsauger lief wieder, aber die neuen Kohlen müssen erst einmal einlaufen. Der Besucher wird das Gerät zu Hause langsam an die neuen teile gewöhnen.','nl' => 'Het wiel draaide niet meer - de koolborstels waren versleten. De eigenaar had vervangende borstels bij zich, maar die pasten niet helemaal. We slijpen ze op de juiste maat en installeren ze. De stofzuiger liep weer, maar de nieuwe borstels moeten er eerst in. De bezoeker zal thuis langzaam wennen aan de nieuwe onderdelen.','fr' => 'Plus aucune roue ne tournait - les charbons étaient usés. Le propriétaire avait apporté des charbons de rechange, mais ils n\'étaient pas tout à fait adaptés. Nous les avons rectifiés à la bonne dimension et les avons installés. L\'aspirateur a recommencé à fonctionner, mais les nouveaux charbons doivent d\'abord se roder. Le visiteur habituera lentement l\'appareil aux nouvelles pièces à la maison.','it' => 'La ruota non girava più - le spazzole di carbone erano consumate. Il proprietario aveva con sé delle spazzole di ricambio, ma non andavano bene. Li abbiamo macinati alla misura giusta e li abbiamo installati. L\'aspirapolvere ha ripreso a funzionare, ma le nuove spazzole devono essere rodate prima. Il visitatore si abituerà lentamente alle nuove parti a casa.','es' => 'La rueda ya no giraba: las escobillas de carbón estaban desgastadas. El dueño tenía cepillos de repuesto, pero no le servían. Los rectificamos a la medida correcta y los instalamos. La aspiradora volvió a funcionar, pero primero hay que poner los nuevos cepillos. El visitante se acostumbrará poco a poco a las nuevas piezas en casa.'),
