  array('id_ords' => 'anstiftung_2058','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2016-06-09','problem' => 'machte ungewöhnliche Geräusche und hatte nicht mehr die Leistung wie früher. Wir vermuteten abgenutzte Kohlebürsten, musste aber nach dem Zerlegen feststellen, das die noch gut waren. Das Schaufelrad des Gebläses hatte sich verzogen und schliff am Gehäuse. Leider war es aufgepresst und wir konnten es nicht von der Motorwelle lösen. Der Besitzer war froh über die Hilfe bei der Fehlersuche und will zu Hause weiter an dem Gerät arbeiten.','googletrans' => 'made unusual sounds and did not have the performance as soon as possible. We suspected worn carbon brushes, but had to detect after breaking, which were still good. The paddle wheel of the blower had twisted and grinding on the housing. Unfortunately, it was pressed and we could not solve it from the motor shaft. The owner was glad about the help in troubleshooting and wants to continue working on the device at home.','language' => 'de','fault_type_id' => '0','en' => 'made unusual noises and no longer had the power as before. We suspected worn carbon brushes, but after disassembly had to determine that they were still good. The blower impeller had warped and was grinding against the housing. Unfortunately, it was pressed on and we couldn\'t get it off the motor shaft. The owner was glad for the troubleshooting help and wants to continue working on the unit at home.','de' => 'machte ungewöhnliche Geräusche und hatte nicht mehr die Leistung wie früher. Wir vermuteten abgenutzte Kohlebürsten, musste aber nach dem Zerlegen feststellen, das die noch gut waren. Das Schaufelrad des Gebläses hatte sich verzogen und schliff am Gehäuse. Leider war es aufgepresst und wir konnten es nicht von der Motorwelle lösen. Der Besitzer war froh über die Hilfe bei der Fehlersuche und will zu Hause weiter an dem Gerät arbeiten.','nl' => 'maakte ongewone geluiden en had niet meer de kracht die het vroeger had. We dachten aan versleten koolborstels, maar na demontage bleken ze nog goed te zijn. Het schoepenwiel van de blower was kromgetrokken en schuurde tegen de behuizing. Helaas zat hij erop gedrukt en kregen we hem niet van de motoras af. De eigenaar was blij met de hulp bij het oplossen van problemen en wil thuis verder werken aan de eenheid.','fr' => 'faisait des bruits inhabituels et n\'était plus aussi performant qu\'avant. Nous avons pensé que les balais de charbon étaient usés, mais après les avoir démontés, nous avons constaté qu\'ils étaient encore en bon état. La roue à aubes du ventilateur s\'était déformée et frottait contre le boîtier. Malheureusement, elle était pressée et nous ne pouvions pas la détacher de l\'arbre du moteur. Le propriétaire était content de l\'aide apportée pour le dépannage et veut continuer à travailler sur l\'appareil chez lui.','it' => 'faceva rumori insoliti e non aveva più la potenza di prima. Sospettavamo che le spazzole di carbonio fossero consumate, ma dopo averle smontate abbiamo scoperto che erano ancora buone. La ruota della lama del soffiatore si era deformata e stava macinando contro l\'alloggiamento. Sfortunatamente è stato premuto e non siamo riusciti a toglierlo dall\'albero motore. Il proprietario è stato contento dell\'aiuto nella risoluzione dei problemi e vuole continuare a lavorare sull\'unità a casa.','es' => 'hacía ruidos extraños y ya no tenía la potencia de antes. Sospechamos que las escobillas de carbón estaban desgastadas, pero después de desmontarlas comprobamos que seguían siendo buenas. La rueda de las aspas del soplador se había deformado y rechinaba contra la carcasa. Desgraciadamente, estaba presionado y no pudimos sacarlo del eje del motor. El propietario se alegró de la ayuda en la resolución de problemas y quiere seguir trabajando en la unidad en casa.'),
  array('id_ords' => 'anstiftung_2071','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Einhell','year_of_manufacture' => '','product_age' => '','repair_status' => 'End of life','event_date' => '2018-11-27','problem' => 'Schaden am Schalter und am Motor - Ersatzteile zu teuer','googletrans' => 'Damage at the counter and the engine - spare parts too expensive','language' => 'de','fault_type_id' => '0','en' => 'Damage to the switch and the motor - spare parts too expensive','de' => 'Schaden am Schalter und am Motor - Ersatzteile zu teuer','nl' => 'Schade aan de schakelaar en de motor - reserveonderdelen te duur','fr' => 'Dommages sur l\'interrupteur et le moteur - Pièces de rechange trop chères','it' => 'Danni all\'interruttore e al motore - pezzi di ricambio troppo costosi','es' => 'Daños en el interruptor y en el motor - piezas de repuesto demasiado caras'),
  array('id_ords' => 'anstiftung_2118','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Philips','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-09-27','problem' => 'Beim Einrollen der Schnur eine Schlaufe eingezogen.  Wir haben das Gehäuse geöffnet und die Verwirrung gelöst.','googletrans' => 'When rolling the string retracted a loop. We opened the case and solved the confusion.','language' => 'de','fault_type_id' => '0','en' => 'When reeling in the cord pulled in a loop.  We opened the case and solved the tangle.','de' => 'Beim Einrollen der Schnur eine Schlaufe eingezogen.  Wir haben das Gehäuse geöffnet und die Verwirrung gelöst.','nl' => 'In een lus getrokken bij het binnenhalen van de lijn.  We openden de zaak en losten het kluwen op.','fr' => 'Une boucle s\'est formée lors de l\'enroulement du cordon.  Nous avons ouvert le boîtier et résolu l\'imbroglio.','it' => 'Tirato in un anello quando si riavvolge la lenza.  Abbiamo aperto il caso e risolto il groviglio.','es' => 'Se ha tirado de un bucle al enrollar el sedal.  Abrimos el maletín y resolvemos el enredo.'),
  array('id_ords' => 'anstiftung_2197','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Bosch','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2017-11-28','problem' => 'Der Kabelaufroller gab nur etwa die Hälfte des Netzkabels her. Wir öffneten das Gerät und stellten eine Verklemmung durch eine unglücklich liegende Kabelschlaufe fest. Die entstand wohl durch zu rasches Aufwickeln auf die Trommel. Das Problem konnte schnell gelöst und das Kabel danach wieder ordentlich aufgerollt werden. Der Sauger ist nun wieder mit dem gewohnten Aktionsradius nutzbar.','googletrans' => 'The cable reel made only about half of the power cord. We opened the device and set a jamming by an unfortunate cable loop. The resulting probably caused by too rapid winding on the drum. The problem could be released quickly and the cable can be rolled up properly again. The sucker is now usable again with the familiar action radius.','language' => 'de','fault_type_id' => '0','en' => 'The cable reel only yielded about half of the power cord. We opened the device and found a jam caused by an unfortunate cable loop. This was probably caused by winding the cable onto the drum too quickly. The problem was quickly solved and the cable was then neatly rewound. The vacuum cleaner can now be used again with its usual operating range.','de' => 'Der Kabelaufroller gab nur etwa die Hälfte des Netzkabels her. Wir öffneten das Gerät und stellten eine Verklemmung durch eine unglücklich liegende Kabelschlaufe fest. Die entstand wohl durch zu rasches Aufwickeln auf die Trommel. Das Problem konnte schnell gelöst und das Kabel danach wieder ordentlich aufgerollt werden. Der Sauger ist nun wieder mit dem gewohnten Aktionsradius nutzbar.','nl' => 'De kabelhaspel gaf maar ongeveer de helft van de netkabel. We openden het apparaat en vonden een storing veroorzaakt door een ongelukkige kabellus. Dit werd waarschijnlijk veroorzaakt doordat de kabel te snel op de trommel werd gewikkeld. Het probleem was snel opgelost en de kabel werd weer netjes opgerold. De stofzuiger kan nu weer worden gebruikt met zijn gebruikelijke actieradius.','fr' => 'L\'enrouleur de câble ne donnait qu\'environ la moitié du câble d\'alimentation. Nous avons ouvert l\'appareil et constaté un blocage dû à une boucle de câble mal placée. Elle était probablement due à un enroulement trop rapide sur le tambour. Le problème a été rapidement résolu et le câble a ensuite été correctement enroulé. L\'aspirateur est maintenant à nouveau utilisable avec son rayon d\'action habituel.','it' => 'L\'avvolgicavo dava solo circa la metà del cavo di rete. Abbiamo aperto l\'unità e abbiamo trovato un inceppamento causato da uno sfortunato cappio del cavo. Questo è stato probabilmente causato dall\'avvolgimento troppo rapido del cavo sul tamburo. Il problema è stato rapidamente risolto e il cavo è stato poi riavvolto ordinatamente. L\'aspirapolvere può ora essere usato di nuovo con il suo solito raggio d\'azione.','es' => 'El carrete de cable sólo dio la mitad del cable de red. Abrimos la unidad y encontramos un atasco causado por un desafortunado bucle de cable. Probablemente esto se debe a que el cable se enrolla en el tambor demasiado rápido. El problema se solucionó rápidamente y el cable se rebobinó limpiamente. El aspirador puede volver a utilizarse con su radio de acción habitual.'),
  array('id_ords' => 'anstiftung_2199','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Vorwerk','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2017-11-28','problem' => 'Lief offenbar nicht mehr ganz rund. Der Elektromotor drehte nur sehr unruhig und mit unregelmäßigen Aussetzern. Das deutete auf abgenutzte Bürstenkohlen oder gar einen Defekt an den Rotorwicklungen hin. Aufgrund des äußerst kompakten Designs gestalteten sich Zerlegung und Zusammenbau recht kompliziert und waren dementsprechend zeitraubend. Da sich der Motor selbst nicht auseinandernehmen ließ, mussten wir uns bei der Fehlersuche auf die Untersuchung der Schleifbürsten und Zuleitungskontakte sowie eine Sichtprüfung des Kommutators beschränken. Der abschließende Funktionstest war allerdings nicht erfolgreich. Nach unserer Einschätzung wird es wohl auf einen Tausch des gesamten Motors hinauslaufen. Der Besitzer erwägt nun, ob sich dies für ihn lohnt. Vielleicht kann er auf dem Wertstoffhof günstig einen passenden Ersatz beschaffen.','googletrans' => 'Apparently no longer completely round. The electric motor rotated only very restless and with irregular dropouts. This indicated on worn brush coals or even a defect on the rotor windings. Due to the extremely compact design, decomposition and assembly were quite complicated and were accordingly time consuming. Since the engine itself did not disassemble, we had to limit ourselves to the examination of the abrasive brushes and supply contacts as well as a visual inspection of the commutator. The final function test was not successful. After our assessment, it will probably go out for a swap of the entire engine. The owner is now considering whether this is worth it for him. Maybe he can deliver a suitable replacement on the recycling center.','language' => 'de','fault_type_id' => '0','en' => 'Apparently no longer ran completely smoothly. The electric motor only turned very unsteadily and with irregular dropouts. This indicated worn brushes or even a defect in the rotor windings. Due to the extremely compact design, disassembly and reassembly were quite complicated and time-consuming. Since the motor itself could not be disassembled, we had to limit our troubleshooting to an examination of the sliding brushes and lead contacts as well as a visual inspection of the commutator. However, the final function test was not successful. In our estimation, it will probably come down to a replacement of the entire motor. The owner is now considering whether this is worth his while. He may be able to procure a suitable replacement cheaply at the recycling center.','de' => 'Lief offenbar nicht mehr ganz rund. Der Elektromotor drehte nur sehr unruhig und mit unregelmäßigen Aussetzern. Das deutete auf abgenutzte Bürstenkohlen oder gar einen Defekt an den Rotorwicklungen hin. Aufgrund des äußerst kompakten Designs gestalteten sich Zerlegung und Zusammenbau recht kompliziert und waren dementsprechend zeitraubend. Da sich der Motor selbst nicht auseinandernehmen ließ, mussten wir uns bei der Fehlersuche auf die Untersuchung der Schleifbürsten und Zuleitungskontakte sowie eine Sichtprüfung des Kommutators beschränken. Der abschließende Funktionstest war allerdings nicht erfolgreich. Nach unserer Einschätzung wird es wohl auf einen Tausch des gesamten Motors hinauslaufen. Der Besitzer erwägt nun, ob sich dies für ihn lohnt. Vielleicht kann er auf dem Wertstoffhof günstig einen passenden Ersatz beschaffen.','nl' => 'Blijkbaar liep het niet meer zo goed. De elektromotor draaide slechts zeer onvast en met onregelmatige onderbrekingen. Dit wees op versleten borstels of zelfs een defect in de rotorwikkelingen. Door het uiterst compacte ontwerp waren demontage en hermontage vrij gecompliceerd en tijdrovend. Aangezien de motor zelf niet kon worden gedemonteerd, moesten wij onze probleemoplossing beperken tot een onderzoek van de glijdende borstels en de loodcontacten, alsmede een visuele inspectie van de commutator. De laatste functietest was echter niet succesvol. Naar onze inschatting, zal het waarschijnlijk neerkomen op het vervangen van de hele motor. De eigenaar overweegt nu of dit voor hem de moeite waard is. Misschien kan hij goedkoop een geschikte vervanging krijgen bij het recycling centrum.','fr' => 'Ne fonctionnait apparemment plus très bien. Le moteur électrique ne tournait que très irrégulièrement et avec des ratés. Cela indiquait que les charbons étaient usés, voire que les enroulements du rotor étaient défectueux. En raison de sa conception extrêmement compacte, le démontage et le remontage étaient assez compliqués et prenaient donc beaucoup de temps. Comme le moteur lui-même ne pouvait pas être démonté, nous avons dû nous limiter à l\'examen des balais et des contacts d\'alimentation ainsi qu\'à une inspection visuelle du collecteur. Le test de fonctionnement final n\'a toutefois pas été concluant. D\'après nos estimations, il faudra probablement remplacer tout le moteur. Le propriétaire se demande maintenant si cela vaut la peine pour lui. Peut-être pourra-t-il se procurer un moteur de remplacement adéquat à un prix avantageux dans un centre de recyclage.','it' => 'A quanto pare non funzionava più bene. Il motore elettrico girava solo in modo molto instabile e con interruzioni irregolari. Questo indicava spazzole usurate o anche un difetto negli avvolgimenti del rotore. A causa del design estremamente compatto, lo smontaggio e il rimontaggio erano piuttosto complicati e richiedevano molto tempo. Poiché il motore stesso non poteva essere smontato, abbiamo dovuto limitare la nostra risoluzione dei problemi a un esame delle spazzole scorrevoli e dei contatti di piombo, nonché a un\'ispezione visiva del commutatore. Tuttavia, il test di funzionamento finale non ha avuto successo. Secondo le nostre stime, si tratterà probabilmente di sostituire l\'intero motore. Il proprietario sta ora valutando se questo vale la pena per lui. Forse può ottenere un sostituto adatto a buon mercato al centro di riciclaggio.','es' => 'Al parecer, ya no funcionaba bien. El motor eléctrico sólo giraba de forma muy inestable y con interrupciones irregulares. Esto indicaba que las escobillas estaban desgastadas o incluso un defecto en el bobinado del rotor. Debido a su diseño extremadamente compacto, el desmontaje y el montaje eran bastante complicados y requerían mucho tiempo. Dado que el motor en sí no podía desmontarse, tuvimos que limitar nuestra resolución de problemas a un examen de las escobillas deslizantes y los contactos de los cables, así como a una inspección visual del conmutador. Sin embargo, la prueba de funcionamiento final no tuvo éxito. En nuestra opinión, probablemente habrá que sustituir todo el motor. El propietario está considerando ahora si le merece la pena. Tal vez pueda obtener un reemplazo adecuado a bajo precio en el centro de reciclaje.  Traducción realizada con la versión gratuita del traductor www.DeepL.com/Translator'),
  array('id_ords' => 'anstiftung_2213','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2017-11-02','problem' => 'Es war der Anschlussstutzen für das Saugrohr gebrochen. Mit Zweikomponentenkleber und ein wenig Geduld wurde die Bruchstelle an diesem Kunststoffteil geklebt, sodass es nach dem vollständigen Aushärten hoffentlich wieder seinen Dienst tun sollte.','googletrans' => 'It was broken the connecting piece for the suction tube. With two-component adhesives and a little patience, the breaking point was glued to this plastic part, so that it should hopefully do its service after complete curing.','language' => 'de','fault_type_id' => '0','en' => 'The connection piece for the intake manifold was broken. With two-component glue and a little patience, the broken part was glued to this plastic part, so that it should hopefully do its job again after complete curing.','de' => 'Es war der Anschlussstutzen für das Saugrohr gebrochen. Mit Zweikomponentenkleber und ein wenig Geduld wurde die Bruchstelle an diesem Kunststoffteil geklebt, sodass es nach dem vollständigen Aushärten hoffentlich wieder seinen Dienst tun sollte.','nl' => 'Het verbindingsstuk voor de aanzuigpijp was gebroken. Met twee-componentenlijm en een beetje geduld werd de breuk op dit plastic deel gelijmd, zodat het hopelijk zijn werk weer zou doen zodra het volledig was uitgehard.','fr' => 'La tubulure de raccordement du tuyau d\'aspiration était cassée. Avec de la colle à deux composants et un peu de patience, le point de rupture a été collé sur cette pièce en plastique, de sorte qu\'elle devrait, nous l\'espérons, à nouveau rendre service une fois qu\'elle aura complètement durci.','it' => 'Il pezzo di collegamento per il tubo di aspirazione era rotto. Con la colla bicomponente e un po\' di pazienza, la frattura è stata incollata a questa parte di plastica in modo che si spera che faccia di nuovo il suo lavoro una volta che si sia indurita completamente.','es' => 'La pieza de conexión del tubo de aspiración estaba rota. Con pegamento de dos componentes y un poco de paciencia, se pegó la fractura a esta pieza de plástico para que, con suerte, vuelva a hacer su trabajo una vez que se haya endurecido por completo.'),
  array('id_ords' => 'anstiftung_223','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Severin','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-09-22','problem' => 'läuft aber saugt nicht mehr','googletrans' => 'but does not suck anymore','language' => 'de','fault_type_id' => '0','en' => 'runs but no longer sucks','de' => 'läuft aber saugt nicht mehr','nl' => 'loopt maar niet meer zuigt','fr' => 'fonctionne mais n\'aspire plus','it' => 'corre ma non fa più schifo','es' => 'corre pero ya no apesta'),
  array('id_ords' => 'anstiftung_2258','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Dirt Devil','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-09-06','problem' => 'Am Elektromotor des „Dirt Devil“ Staubsaugers konnten wir nach dem Eintreffen der Ersatzteile nun endlich die Schleifkontakte erneuern. Beim ersten Test lief der Motor allerdings noch etwas unruhig, da sich die Kohlen am Kommutator erst noch etwas einschleifen müssen, bis ein sauberer Kontakt mit niedrigem Übergangswiderstand vorliegt. Der Besitzer wird den Staubsauger zu Hause weiter betreiben und beobachten.','googletrans' => 'At the electric motor of the "DIRT Devil" vacuum cleaner we could finally renew the grinding contacts after the arrival of the spare parts. At the first test, however, the engine ran a bit restless, as the coal on commutator has to grind until a clean contact with low-transitional resistance. The owner will continue to operate and observe the vacuum cleaner at home.','language' => 'de','fault_type_id' => '0','en' => 'After the arrival of the spare parts, we were finally able to replace the sliding contacts on the electric motor of the "Dirt Devil" vacuum cleaner. During the first test, however, the motor still ran a bit unsteadily, as the carbons on the commutator still have to grind in a bit until there is a clean contact with low contact resistance. The owner will continue to operate and observe the vacuum cleaner at home.','de' => 'Am Elektromotor des „Dirt Devil“ Staubsaugers konnten wir nach dem Eintreffen der Ersatzteile nun endlich die Schleifkontakte erneuern. Beim ersten Test lief der Motor allerdings noch etwas unruhig, da sich die Kohlen am Kommutator erst noch etwas einschleifen müssen, bis ein sauberer Kontakt mit niedrigem Übergangswiderstand vorliegt. Der Besitzer wird den Staubsauger zu Hause weiter betreiben und beobachten.','nl' => 'Na de aankomst van de reserveonderdelen konden we eindelijk de schuifcontacten op de elektrische motor van de "Dirt Devil" stofzuiger vervangen. Tijdens de eerste test liep de motor echter nog een beetje onvast, omdat de kooltjes op de commutator nog een beetje moeten inslijpen tot er een schoon contact is met een lage contactweerstand. De eigenaar zal de stofzuiger thuis blijven bedienen en observeren.','fr' => 'Après l\'arrivée des pièces de rechange, nous avons enfin pu remplacer les contacts glissants du moteur électrique de l\'aspirateur "Dirt Devil". Lors du premier test, le moteur a toutefois fonctionné de manière un peu irrégulière, car les charbons du collecteur doivent encore se polir un peu avant d\'obtenir un contact propre avec une faible résistance de contact. Le propriétaire continuera à faire fonctionner l\'aspirateur chez lui et à l\'observer.','it' => 'Dopo l\'arrivo dei pezzi di ricambio, siamo stati finalmente in grado di sostituire i contatti scorrevoli sul motore elettrico dell\'aspirapolvere "Dirt Devil". Durante il primo test, tuttavia, il motore ha funzionato ancora un po\' instabile, poiché i carboni sul commutatore devono ancora macinare un po\' finché non c\'è un contatto pulito con una bassa resistenza di contatto. Il proprietario continuerà a far funzionare l\'aspirapolvere a casa e ad osservarlo.','es' => 'Tras la llegada de las piezas de recambio, finalmente pudimos sustituir los contactos deslizantes del motor eléctrico de la aspiradora "Dirt Devil". Sin embargo, durante la primera prueba, el motor seguía funcionando de forma un poco inestable, ya que los carbones del conmutador todavía tienen que moler un poco hasta que haya un contacto limpio con baja resistencia de contacto. El propietario seguirá manejando la aspiradora en casa y observándola.'),
  array('id_ords' => 'anstiftung_2259','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'dyson','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2018-09-06','problem' => 'Bodendüse mit rotierender Teppichbürste machte im Betrieb Klopfgeräusche - verbogene Antriebswelle','googletrans' => 'Floor nozzle with rotating carpet brush made knocking noise - bent drive shaft','language' => 'de','fault_type_id' => '0','en' => 'Floor nozzle with rotating carpet brush made knocking noises during operation - bent drive shaft','de' => 'Bodendüse mit rotierender Teppichbürste machte im Betrieb Klopfgeräusche - verbogene Antriebswelle','nl' => 'Vloerzuigmond met roterende tapijtborstel maakt tijdens het gebruik kloppende geluiden - verbogen aandrijfas','fr' => 'Le suceur de sol avec brosse rotative pour tapis faisait des bruits de cognement pendant le fonctionnement - Arbre d\'entraînement tordu','it' => 'La bocchetta per pavimenti con la spazzola rotante per tappeti fa rumore durante il funzionamento - albero motore piegato','es' => 'La boquilla para suelos con cepillo giratorio para alfombras hacía ruidos de golpeteo durante su funcionamiento - eje de transmisión doblado'),
