  array('id_ords' => 'anstiftung_2343','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2017-05-04','problem' => 'Fortsetzung vom 13.10.2016 (RepairCafé Freital): Es konnte nun der defekte Entstörkondensator gewechselt werden. Jetzt läuft er wieder wie gewohnt.','googletrans' => 'Continued from 13. 10. 2016 (Repaircafé Freital): Now the defective suppression capacitor could be changed. Now he runs again as usual.','language' => 'de','fault_type_id' => '0','en' => 'Continuation from 13.10.2016 (RepairCafé Freital): The defective suppressor capacitor could now be replaced. Now it runs again as usual.','de' => 'Fortsetzung vom 13.10.2016 (RepairCafé Freital): Es konnte nun der defekte Entstörkondensator gewechselt werden. Jetzt läuft er wieder wie gewohnt.','nl' => 'Vervolg van 13.10.2016 (RepairCafé Freital): De defecte ontstoringscondensator is inmiddels vervangen. Nu loopt het weer als vanouds.','fr' => 'Suite du 13.10.2016 (RepairCafé Freital) : Le condensateur d\'antiparasitage défectueux a pu être remplacé. Maintenant, il fonctionne à nouveau comme d\'habitude.','it' => 'Continuazione dal 13.10.2016 (RepairCafé Freital): Il condensatore di soppressione difettoso è stato sostituito. Ora funziona di nuovo come al solito.','es' => 'Continuación del 13.10.2016 (RepairCafé Freital): El condensador supresor defectuoso ya ha sido sustituido. Ahora vuelve a funcionar como siempre.'),
  array('id_ords' => 'anstiftung_2350','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2017-04-20','problem' => 'Den hatte der Besucher schon selbst demontiert und brachte nur die elektrischen Teile mit. Wir haben das Anschlusskabel auf Durchgang geprüft, eine Ader hatte keinen. Da die Isolation des Kabels an einer Stelle an der Kabeltrommel beschädigt war, haben wir das Kabel dort gekürzt und neu angeschlossen. Die Unterbrechung danach immer noch da, sodass wir dann noch den Stecker gewechselt haben.','googletrans' => 'The visitor had already dismantled himself and brought only the electrical parts. We tested the connection cable on passage, a vein had no. Since the insulation of the cable was damaged at a location on the cable drum, we have shortened the cable there and re-connected. The interruption then still there, so we still changed the plug.','language' => 'de','fault_type_id' => '0','en' => 'The visitor had already dismantled it himself and brought only the electrical parts. We checked the connection cable for continuity, one wire had none. Since the insulation of the cable was damaged at one point on the cable drum, we shortened the cable there and reconnected it. The interruption was still there afterwards, so we then changed the plug.','de' => 'Den hatte der Besucher schon selbst demontiert und brachte nur die elektrischen Teile mit. Wir haben das Anschlusskabel auf Durchgang geprüft, eine Ader hatte keinen. Da die Isolation des Kabels an einer Stelle an der Kabeltrommel beschädigt war, haben wir das Kabel dort gekürzt und neu angeschlossen. Die Unterbrechung danach immer noch da, sodass wir dann noch den Stecker gewechselt haben.','nl' => 'De bezoeker had hem zelf al uit elkaar gehaald en alleen de elektrische onderdelen meegenomen. We controleerden de verbindingskabel op continuïteit, één draad had geen continuïteit. Aangezien de isolatie van de kabel op één punt van de kabeltrommel beschadigd was, hebben wij de kabel daar ingekort en opnieuw aangesloten. De onderbreking was er daarna nog steeds, dus hebben we de stekker vervangen.','fr' => 'Le visiteur l\'avait déjà démonté lui-même et n\'avait apporté que les pièces électriques. Nous avons vérifié la continuité du câble de raccordement, un conducteur n\'en avait pas. Comme l\'isolation du câble était endommagée à un endroit du tambour de câble, nous avons raccourci le câble à cet endroit et l\'avons rebranché. La coupure étant toujours là, nous avons changé la prise.','it' => 'Il visitatore l\'aveva già smontato da solo e aveva portato solo le parti elettriche. Abbiamo controllato la continuità del cavo di collegamento, un filo non ne aveva. Poiché l\'isolamento del cavo era danneggiato in un punto del tamburo del cavo, abbiamo accorciato il cavo in quel punto e lo abbiamo ricollegato. L\'interruzione era ancora lì dopo, quindi abbiamo cambiato la spina.','es' => 'El visitante ya lo había desmontado él mismo y sólo trajo las piezas eléctricas. Comprobamos la continuidad del cable de conexión, un cable no tenía ninguna. Como el aislamiento del cable estaba dañado en un punto de la bobina, acortamos el cable allí y lo volvimos a conectar. La interrupción seguía ahí después, así que cambiamos el enchufe.'),
  array('id_ords' => 'anstiftung_2387','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'End of life','event_date' => '2017-02-28','problem' => 'Roch sehr brenzlig. Der Motor erzeugte ein sehr starkes Bürstenfeuer. Grund ist vermutlich eine defekte Ankerwicklung.','googletrans' => 'Smelled very hot. The engine generated a very strong brush fire. Reason is probably a defective anchor winding.','language' => 'de','fault_type_id' => '0','en' => 'Smelled very dicey. The motor produced a very strong brush fire. The reason is probably a defective armature winding.','de' => 'Roch sehr brenzlig. Der Motor erzeugte ein sehr starkes Bürstenfeuer. Grund ist vermutlich eine defekte Ankerwicklung.','nl' => 'Het rook erg onbetrouwbaar. De motor veroorzaakte een zeer sterk borstelvuur. De reden is waarschijnlijk een defecte wikkeling van de armatuur.','fr' => 'Ça sentait très fort. Le moteur produisait un feu de brosses très puissant. La raison en est probablement un enroulement d\'induit défectueux.','it' => 'Aveva un odore molto rischioso. Il motore ha prodotto un incendio molto forte. La ragione è probabilmente un avvolgimento dell\'armatura difettoso.','es' => 'Olía muy mal. El motor produjo un fuego de maleza muy fuerte. La razón es probablemente un devanado de armadura defectuoso.'),
  array('id_ords' => 'anstiftung_2401','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2017-01-24','problem' => 'Er sagte keinen Mucks mehr. Stecker, Zuleitung, Kontaktübergabe am Kabelaufroller – alles in Ordnung. Auf einer Platine fanden wir dann einen defekten Thyristor für die Motoransteuerung. Diesen haben wir ausgelötet und die Leiterbahn derweil überbrückt. Damit funktioniert er erst einmal wieder. Wenn der Besitzer mit einem Ersatzteil wiederkommt, können wir die Drehzahl-/Leistungssteuerung wieder in Betrieb nehmen.','googletrans' => 'He did not say a Muck anymore. Plug, supply, contact transfer at the cable reel - all right. On a board we found a defective thyristor for the motor drive. We have soldered this and the conductor bridges the conductor. He works with this again. When the owner returns with a spare part, we can put the speed / power control back into operation.','language' => 'de','fault_type_id' => '0','en' => 'He no longer said a peep. Plug, supply line, contact transfer at the cable reel - everything was fine. On a circuit board we found a defective thyristor for the motor control. We desoldered it and bridged the conductive path. Now it works again for the time being. When the owner comes back with a spare part, we can put the speed/power control back into operation.','de' => 'Er sagte keinen Mucks mehr. Stecker, Zuleitung, Kontaktübergabe am Kabelaufroller – alles in Ordnung. Auf einer Platine fanden wir dann einen defekten Thyristor für die Motoransteuerung. Diesen haben wir ausgelötet und die Leiterbahn derweil überbrückt. Damit funktioniert er erst einmal wieder. Wenn der Besitzer mit einem Ersatzteil wiederkommt, können wir die Drehzahl-/Leistungssteuerung wieder in Betrieb nehmen.','nl' => 'Het zei geen woord meer. Stekker, toevoerleiding, contactoverdracht op de kabelhaspel - alles was in orde. We vonden toen een defecte thyristor voor de motorbesturing op een printplaat. We hebben het ontolied en de geleidende weg ondertussen overbrugd. Nu werkt het voorlopig weer. Als de eigenaar terugkomt met een reserveonderdeel, kunnen we de snelheids- en vermogensregeling weer in werking stellen.','fr' => 'Il n\'a plus fait de bruit. Fiche, câble d\'alimentation, transfert de contact sur l\'enrouleur de câble - tout était en ordre. Sur une platine, nous avons trouvé un thyristor défectueux pour la commande du moteur. Nous l\'avons dessoudé et avons ponté la piste conductrice pendant ce temps. Ainsi, il fonctionne à nouveau. Si le propriétaire revient avec une pièce de rechange, nous pourrons remettre en service la commande de vitesse/puissance.','it' => 'Non ha più detto una parola. Spina, linea di alimentazione, trasferimento dei contatti all\'avvolgicavo - tutto era a posto. Abbiamo poi trovato un tiristore difettoso per il controllo del motore su un circuito. L\'abbiamo dissaldato e nel frattempo abbiamo fatto un ponte sul percorso conduttivo. Ora funziona di nuovo per il momento. Quando il proprietario torna con un pezzo di ricambio, possiamo rimettere in funzione il controllo di velocità/potenza.','es' => 'Ya no dijo ni pío. Enchufe, línea de alimentación, transferencia de contactos en el carrete de cable - todo estaba bien. Entonces encontramos un tiristor defectuoso para el control del motor en una placa de circuito. Lo desoldamos y puenteamos el camino conductor mientras tanto. Ahora vuelve a funcionar por el momento. Cuando el propietario vuelva con una pieza de repuesto, podremos volver a poner en funcionamiento el control de velocidad y potencia.'),
  array('id_ords' => 'anstiftung_242','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Black & Decker','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2018-09-22','problem' => 'ohne Funktion, Stromversorgung bzw. Aufladestation defekt?','googletrans' => 'without function, power supply or charging station defective?','language' => 'de','fault_type_id' => '0','en' => 'without function, power supply or charging station defective?','de' => 'ohne Funktion, Stromversorgung bzw. Aufladestation defekt?','nl' => 'Geen functie, stroomvoorziening of laadstation defect?','fr' => 'sans fonction, alimentation électrique ou station de recharge défectueuse ?','it' => 'Nessuna funzione, alimentazione o stazione di ricarica difettosa?','es' => '¿No funciona, la fuente de alimentación o la estación de carga están defectuosas?'),
  array('id_ords' => 'anstiftung_2435','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Kirby','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2016-11-03','problem' => 'Er lief nicht mehr mit voller Leistung, hatte Aussetzer. Wir habeen abgenutzte Kohlen festgestellt. Wenn neue beschafft sind, werden wir durch den Austausch das Problem beheben.','googletrans' => 'He was not running with full performance, had dropouts. We detected worn coals. If new ones are procured, we will fix the problem by replacing.','language' => 'de','fault_type_id' => '0','en' => 'It no longer ran at full power, had dropouts. We found that the carbons were worn out. When new ones are obtained, we will fix the problem by replacing them.','de' => 'Er lief nicht mehr mit voller Leistung, hatte Aussetzer. Wir habeen abgenutzte Kohlen festgestellt. Wenn neue beschafft sind, werden wir durch den Austausch das Problem beheben.','nl' => 'Hij draaide niet meer op volle kracht, had uitval. We ontdekten dat de kooltjes versleten waren. Als we nieuwe krijgen, zullen we het probleem oplossen door ze te vervangen.','fr' => 'Il ne fonctionnait plus à pleine puissance, il avait des ratés. Nous avons constaté que les charbons étaient usés. Lorsque nous en aurons acheté de nouveaux, nous les remplacerons pour résoudre le problème.','it' => 'Non funzionava più a piena potenza, aveva delle cadute. Abbiamo scoperto che i carboni erano consumati. Quando ne avremo di nuovi, risolveremo il problema sostituendoli.','es' => 'Ya no funcionaba a plena potencia, tenía caídas. Encontramos que los carbones estaban desgastados. Cuando tengamos nuevas, solucionaremos el problema sustituyéndolas.'),
  array('id_ords' => 'anstiftung_2455','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2016-09-26','problem' => 'Er funktionierte nicht mehr, d. h. beim ersten Einschalten zuckte er nur kurz, als wolle er anlaufen, blieb dann aber stehen. Nachdem wir ihn auseinandergenommen hatten, prüften wir den Durchgang vom Stecker bis zum Motor und stellten eine Unterbrechung in der Netzzuleitung fest. Bei genauerer Betrachtung des Steckers konnte man Rußspuren erkennen - der Stecker war defekt. Wir bauten das Gerät wieder zusammen und wechselten den Stecker.','googletrans' => 'He did not work anymore, d. H. At the first turn on, he shrugged only as if he started, but then stopped. After we had taken him apart, we tested the passage from the plug to the engine and set an interruption in the power supply line. With closer consideration of the plug you could recognize soot tracks - the plug was defective. We built the device together again and changed the plug.','language' => 'de','fault_type_id' => '0','en' => 'It no longer worked, i.e. when we first switched it on, it only twitched briefly as if it wanted to start up, but then stopped. After taking it apart, we checked the continuity from the plug to the motor and found a break in the power supply line. Upon closer inspection of the plug, we could see traces of soot - the plug was defective. We reassembled the unit and changed the plug.','de' => 'Er funktionierte nicht mehr, d. h. beim ersten Einschalten zuckte er nur kurz, als wolle er anlaufen, blieb dann aber stehen. Nachdem wir ihn auseinandergenommen hatten, prüften wir den Durchgang vom Stecker bis zum Motor und stellten eine Unterbrechung in der Netzzuleitung fest. Bei genauerer Betrachtung des Steckers konnte man Rußspuren erkennen - der Stecker war defekt. Wir bauten das Gerät wieder zusammen und wechselten den Stecker.','nl' => 'Hij werkte niet meer, d.w.z. toen hij voor het eerst werd aangezet, trilde hij alleen even, alsof hij wilde starten, maar stopte toen. Nadat we hem uit elkaar hadden gehaald, controleerden we de continuïteit van de stekker naar de motor en vonden we een breuk in de toevoerleiding. Bij nadere inspectie van de stekker konden we roetsporen zien - de stekker was defect. We hebben de unit weer in elkaar gezet en de stekker vervangen.','fr' => 'Il ne fonctionnait plus, c\'est-à-dire qu\'à la première mise en marche, il ne faisait que tressaillir brièvement, comme s\'il voulait démarrer, mais s\'arrêtait ensuite. Après l\'avoir démonté, nous avons vérifié le passage de la fiche jusqu\'au moteur et avons constaté une interruption dans le câble d\'alimentation. En regardant de plus près la fiche, nous avons pu voir des traces de suie : la fiche était défectueuse. Nous avons remonté l\'appareil et changé la fiche.','it' => 'Non funzionava più, cioè quando si accendeva per la prima volta, si muoveva solo brevemente come se volesse partire, ma poi si fermava. Dopo averlo smontato, abbiamo controllato la continuità dalla spina al motore e abbiamo trovato una rottura nella linea di alimentazione. Ispezionando più da vicino la spina, potevamo vedere tracce di fuliggine - la spina era difettosa. Abbiamo riassemblato l\'unità e cambiato la spina.','es' => 'Ya no funcionaba, es decir, cuando se encendía por primera vez, sólo se movía brevemente como si quisiera arrancar, pero luego se detenía. Después de desmontarlo, comprobamos la continuidad desde el enchufe hasta el motor y encontramos una rotura en la línea de alimentación de la red. Al inspeccionar más de cerca el enchufe, pudimos ver rastros de hollín: el enchufe estaba defectuoso. Volvimos a montar la unidad y cambiamos el enchufe.'),
  array('id_ords' => 'anstiftung_2472','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2016-08-18','problem' => 'Er funktionierte nach wenigen Jahren nicht mehr richtig. Er machte „brutzelnde“ Geräusche, es roch verbrannt und der Motor stotterte. Nach dem Auseinandernehmen stellten wir starkes Bürstenfeuer fest. Wir demontierten die Kohlebürsten, von denen nicht mehr viel übrig war.','googletrans' => 'He did not work properly after a few years. He made "sizzling" sounds, it smelled burned and the engine stuttered. After disassembling, we set strong brush fire. We dismantled the carbon brushes, which was not much left.','language' => 'de','fault_type_id' => '0','en' => 'It stopped working properly after a few years. It made "sizzling" noises, it smelled burnt and the engine sputtered. After taking it apart, we noticed heavy brush fire. We disassembled the carbon brushes, of which there was not much left.','de' => 'Er funktionierte nach wenigen Jahren nicht mehr richtig. Er machte „brutzelnde“ Geräusche, es roch verbrannt und der Motor stotterte. Nach dem Auseinandernehmen stellten wir starkes Bürstenfeuer fest. Wir demontierten die Kohlebürsten, von denen nicht mehr viel übrig war.','nl' => 'Na een paar jaar werkte het niet meer goed. Het maakte "sissende" geluiden, het rook verbrand en de motor sputterde. Nadat we het uit elkaar hadden gehaald, zagen we een sterke brand. We ontmantelden de koolborstels, waarvan er niet veel meer over was.','fr' => 'Après quelques années, il ne fonctionnait plus correctement. Il faisait des bruits de "grillage", il sentait le brûlé et le moteur bégayait. Après l\'avoir démonté, nous avons constaté un fort feu de brosses. Nous avons démonté les balais de charbon, dont il ne restait plus grand-chose.','it' => 'Non ha più funzionato correttamente dopo alcuni anni. Faceva dei rumori "sfrigolanti", puzzava di bruciato e il motore strombazzava. Dopo averla smontata, abbiamo notato un forte fuoco di sterpaglia. Abbiamo smontato le spazzole di carbonio, di cui non era rimasto molto.','es' => 'Al cabo de unos años dejó de funcionar correctamente. Hacía ruidos "chisporroteantes", olía a quemado y el motor chisporroteaba. Después de desmontarlo, notamos un fuerte fuego de maleza. Desmontamos las escobillas de carbón, de las que no quedaba mucho.'),
  array('id_ords' => 'anstiftung_2476','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2016-08-18','problem' => 'Es drehte sich kein Rad mehr. Er soll vor dem Ausfall auch sehr laute Geräusche gemacht haben. Nach der Demontage sahen wir auch hier abgenutzte Kohlebürsten, aber zusätzlich war noch die Motorwelle blockiert. Mehrmaliges Hin- und Herbewegen machte sie zwar wieder drehbar, aber wir vermuten einen Lagerschaden. Hier geht es beim nächsten Mal weiter.','googletrans' => 'There was no bike anymore. He should have made very loud noises before the failure. After dismantling we also saw worn carbon brushes, but in addition the motor shaft was blocked. Moving several times, she made her rotatable again, but we suspect a shelf. Click here next time.','language' => 'de','fault_type_id' => '0','en' => 'No wheel was turning anymore. It was also said to have made very loud noises before the failure. After disassembly, we saw worn carbon brushes here as well, but in addition, the motor shaft was blocked. Moving it back and forth several times made it rotate again, but we suspect bearing damage. We will continue here next time.','de' => 'Es drehte sich kein Rad mehr. Er soll vor dem Ausfall auch sehr laute Geräusche gemacht haben. Nach der Demontage sahen wir auch hier abgenutzte Kohlebürsten, aber zusätzlich war noch die Motorwelle blockiert. Mehrmaliges Hin- und Herbewegen machte sie zwar wieder drehbar, aber wir vermuten einen Lagerschaden. Hier geht es beim nächsten Mal weiter.','nl' => 'Geen wiel draaide meer. Er werd ook gezegd dat het zeer luide geluiden maakte voor de storing. Na demontage zagen we ook versleten koolborstels, maar bovendien was de motoras geblokkeerd. Een paar keer heen en weer bewegen deed hem weer draaien, maar we vermoeden lagerschade. We zullen hier de volgende keer verder gaan.','fr' => 'Aucune roue ne tournait plus. Il paraît qu\'il faisait aussi un bruit très fort avant la panne. Après le démontage, nous avons constaté que les charbons étaient usés, mais que l\'arbre du moteur était également bloqué. Plusieurs mouvements de va-et-vient l\'ont certes fait tourner à nouveau, mais nous soupçonnons une défaillance des roulements. Nous continuerons ici la prochaine fois.','it' => 'Nessuna ruota girava più. Si dice anche che abbia fatto dei rumori molto forti prima del guasto. Dopo lo smontaggio, abbiamo visto anche delle spazzole di carbone consumate, ma in più l\'albero del motore era bloccato. Muovendola avanti e indietro diverse volte l\'ha fatta girare di nuovo, ma sospettiamo un danno ai cuscinetti. Continueremo qui la prossima volta.','es' => 'Ninguna rueda giraba ya. También se dice que hizo ruidos muy fuertes antes de la avería. Tras el desmontaje, también vimos escobillas de carbón desgastadas, pero además, el eje del motor estaba bloqueado. Al moverlo varias veces hacia adelante y hacia atrás, volvió a girar, pero sospechamos que los rodamientos están dañados. Continuaremos aquí la próxima vez.'),
  array('id_ords' => 'anstiftung_2496','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2016-06-16','problem' => 'Funktionierte nicht mehr. Wir stellten nach der Demontage einen Kabelbruch im Aufwickler fest. Nachdem wir das Kabel neu angeschlossen hatten, ging er wieder tadellos.','googletrans' => 'Did not work anymore. We set a cable break in the rewinder after disassembly. After resting the cable, he went perfectly again.','language' => 'de','fault_type_id' => '0','en' => 'No longer functioned. We noticed a cable break in the rewinder after disassembly. After we reconnected the cable, it worked flawlessly again.','de' => 'Funktionierte nicht mehr. Wir stellten nach der Demontage einen Kabelbruch im Aufwickler fest. Nachdem wir das Kabel neu angeschlossen hatten, ging er wieder tadellos.','nl' => 'Werkte niet meer. Na het ontmantelen, ontdekten we een gebroken kabel in de opwindspoel. Nadat we de kabel opnieuw hadden aangesloten, werkte het weer perfect.','fr' => 'Ne fonctionnait plus. Après l\'avoir démonté, nous avons constaté une rupture de câble dans l\'enrouleur. Après avoir rebranché le câble, il fonctionnait à nouveau parfaitement.','it' => 'Non ha più funzionato. Dopo averlo smontato, abbiamo scoperto un cavo rotto nell\'avvolgitore. Dopo aver ricollegato il cavo, ha funzionato di nuovo perfettamente.','es' => 'Ya no funciona. Tras desmontarlo, descubrimos un cable roto en el rebobinador. Después de volver a conectar el cable, volvió a funcionar perfectamente.'),
  array('id_ords' => 'anstiftung_2505','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2016-06-02','problem' => 'Staubsauger hatte Wasser gezogen, an dem er sich dann stark verschluckte. Der Motor drehte sich nicht mehr. Wir nahmen das Gerät auseinander, was sich sehr aufwendig gestaltete, und stellten fest, dass die Führung der Kohlen verklebt war, sodass sie nicht mehr auf den Kollektor gedrückt wurden. Alle Eisenteile im Motor waren zudem stark angerostet. Wir machten die Kohlehalterungen wieder gängig und reinigten den Kollektor. Danach ging der Motor wieder. Leider schafften wir es nicht mehr, das Gerät zusammenzubauen. Das übernimmt nun der Besitzer zu Hause.','googletrans' => 'Vacuum cleaner had pulled water, on which he then swallowed strongly. The engine did not turn anymore. We apart the device, which was very expensive, and found that the leadership of the coals was glued so that they were no longer pushed on the collector. All iron parts in the engine were also strongly grated. We made the coal broker again and cleaned the collector. Then the engine went back. Unfortunately, we no longer managed to assemble the device. This takes over the owner at home.','language' => 'de','fault_type_id' => '0','en' => 'Vacuum cleaner had drawn water, which he then choked heavily. The motor stopped turning. We took the unit apart, which was very time-consuming, and found that the guide of the carbons was stuck so that they were no longer pressed onto the collector. All the iron parts in the motor were also badly rusted. We made the carbon holders common again and cleaned the collector. After that the motor worked again. Unfortunately, we did not manage to reassemble the unit. This is now done by the owner at home.','de' => 'Staubsauger hatte Wasser gezogen, an dem er sich dann stark verschluckte. Der Motor drehte sich nicht mehr. Wir nahmen das Gerät auseinander, was sich sehr aufwendig gestaltete, und stellten fest, dass die Führung der Kohlen verklebt war, sodass sie nicht mehr auf den Kollektor gedrückt wurden. Alle Eisenteile im Motor waren zudem stark angerostet. Wir machten die Kohlehalterungen wieder gängig und reinigten den Kollektor. Danach ging der Motor wieder. Leider schafften wir es nicht mehr, das Gerät zusammenzubauen. Das übernimmt nun der Besitzer zu Hause.','nl' => 'Hoover had water getapt, waar hij zich vervolgens hevig aan verslikte. De motor is gestopt met draaien. Wij haalden het toestel uit elkaar, wat zeer tijdrovend was, en ontdekten dat de geleider van de kooltjes aan elkaar gekleefd was, zodat zij niet meer op de collector werden gedrukt. Alle ijzeren onderdelen in de motor waren ook erg verroest. We hebben de koolstofhouders gerepareerd en de collector schoongemaakt. Daarna werkte de motor weer. Helaas is het ons niet gelukt om het toestel weer in elkaar te zetten. De eigenaar zal het nu thuis doen.','fr' => 'L\'aspirateur avait aspiré de l\'eau, dont il s\'est ensuite fortement étouffé. Le moteur ne tournait plus. Nous avons démonté l\'appareil, ce qui s\'est avéré très laborieux, et avons constaté que le guidage des charbons était collé, de sorte qu\'ils n\'étaient plus pressés sur le collecteur. De plus, toutes les pièces en fer du moteur étaient fortement rouillées. Nous avons remis les supports de charbon en place et nettoyé le collecteur. Le moteur a ensuite redémarré. Malheureusement, nous n\'avons pas pu remonter l\'appareil. C\'est désormais le propriétaire qui s\'en charge à la maison.','it' => 'Hoover aveva attinto acqua, che poi ha soffocato pesantemente. Il motore ha smesso di girare. Abbiamo smontato l\'apparecchio, cosa che ha richiesto molto tempo, e abbiamo scoperto che la guida dei carboni era bloccata insieme in modo che non erano più premuti sul collettore. Tutte le parti in ferro del motore erano anche molto arrugginite. Abbiamo riparato i supporti di carbonio e pulito il collettore. Dopo di che, il motore ha funzionato di nuovo. Purtroppo non siamo riusciti a riassemblare l\'unità. Il proprietario ora lo farà a casa.','es' => 'Hoover había sacado agua, con la que se atragantó fuertemente. El motor dejó de girar. Desmontamos el aparato, lo que nos llevó mucho tiempo, y descubrimos que la guía de los carbones estaba pegada, por lo que ya no se presionaba sobre el colector. Todas las piezas de hierro del motor también estaban muy oxidadas. Reparamos los soportes de carbono y limpiamos el colector. Después de eso, el motor volvió a funcionar. Lamentablemente, no conseguimos volver a montar la unidad. El propietario lo hará ahora en su casa.'),
