  array('id_ords' => 'anstiftung_2582','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2015-11-05','problem' => 'Er lief nur noch, wenn ein an ihn angeschlossenes Gerät betrieben wurde. Ein Solo-Betrieb war nicht mehr möglich. Wir haben die Steuerungsschaltung untersucht und die Schalter kontrolliert, konnten den Fehler aber aufgrund der fehlenden Zeit nicht finden. Beim nächsten Mal könnten wir weitermachen.','googletrans' => 'He only ran when a device connected to him was operated. Solo operation was no longer possible. We have examined the control circuit and controls the switches, but could not find the error due to the missing time. Next time we could continue.','language' => 'de','fault_type_id' => '0','en' => 'It only ran when a device connected to it was operated. Solo operation was no longer possible. We examined the control circuit and checked the switches, but could not find the fault due to lack of time. Next time we could move on.','de' => 'Er lief nur noch, wenn ein an ihn angeschlossenes Gerät betrieben wurde. Ein Solo-Betrieb war nicht mehr möglich. Wir haben die Steuerungsschaltung untersucht und die Schalter kontrolliert, konnten den Fehler aber aufgrund der fehlenden Zeit nicht finden. Beim nächsten Mal könnten wir weitermachen.','nl' => 'Het liep alleen als er een apparaat op aangesloten was. Solo opereren was niet meer mogelijk. Wij onderzochten het regelcircuit en controleerden de schakelaars, maar konden door tijdgebrek de fout niet vinden. Volgende keer kunnen we verder gaan.','fr' => 'Il ne fonctionnait plus que lorsqu\'un appareil qui lui était connecté était utilisé. Un fonctionnement en solo n\'était plus possible. Nous avons examiné le circuit de commande et contrôlé les interrupteurs, mais nous n\'avons pas pu trouver l\'erreur en raison du manque de temps. La prochaine fois, nous pourrions continuer.','it' => 'Funzionava solo quando veniva azionato un dispositivo ad esso collegato. L\'operazione in solitaria non era più possibile. Abbiamo esaminato il circuito di controllo e controllato gli interruttori, ma non siamo riusciti a trovare il guasto per mancanza di tempo. La prossima volta potremmo continuare.','es' => 'Sólo funcionaba cuando se accionaba un dispositivo conectado a él. La operación en solitario ya no era posible. Examinamos el circuito de control y comprobamos los interruptores, pero no pudimos encontrar el fallo por falta de tiempo. La próxima vez podríamos continuar.'),
  array('id_ords' => 'anstiftung_2587','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2015-10-15','problem' => 'Saugte nicht mehr. Beim Zerlegen überprüften wir alle Steckverbindungen und steckten sie neu, dann ging er wieder. War wohl ein Kontaktproblem.','googletrans' => 'No longer sucked. When decomposed, we checked all the connectors and restarted, then he went back. Was probably a contact problem.','language' => 'de','fault_type_id' => '0','en' => 'Did not suck anymore. When we disassembled it, we checked all the connectors and reconnected them, then it worked again. It was probably a contact problem.','de' => 'Saugte nicht mehr. Beim Zerlegen überprüften wir alle Steckverbindungen und steckten sie neu, dann ging er wieder. War wohl ein Kontaktproblem.','nl' => 'Het was niet langer waardeloos. Toen we hem uit elkaar haalden, controleerden we alle verbindingen en sloten ze opnieuw aan, toen werkte hij weer. Het was waarschijnlijk een contactprobleem.','fr' => 'Il n\'aspirait plus. Lors du démontage, nous avons vérifié tous les connecteurs et les avons rebranchés, puis il a recommencé à fonctionner. Il s\'agissait probablement d\'un problème de contact.','it' => 'Non faceva più schifo. Quando l\'abbiamo smontato, abbiamo controllato tutti i collegamenti e li abbiamo ricollegati, poi ha funzionato di nuovo. Probabilmente era un problema di contatto.','es' => 'Ya no apestaba. Cuando lo desmontamos, comprobamos todas las conexiones y las volvimos a conectar, y volvió a funcionar. Probablemente fue un problema de contacto.'),
  array('id_ords' => 'anstiftung_2593','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Black & Decker','year_of_manufacture' => '2009','product_age' => '','repair_status' => 'Repairable','event_date' => '2015-10-01','problem' => 'Er ließ sich nicht mehr aufladen. Wir haben die Akkus überprüft. Mehrere Zellen waren defekt und ließen sich nicht mehr aufladen. Leider ist die Empfehlung des Herstellers in diesem Fall, das Gerät fachgerecht zu entsorgen, was völlig unnötig ist! Wenn der Besitzer mit den nachgekauften Akkuzellen wiederkommt, können wir das Akkupack austauschen und das Gerät reparieren.','googletrans' => 'He could no longer recharge. We checked the batteries. Several cells were defective and could not be charged anymore. Unfortunately, the manufacturer\'s recommendation in this case is to dispose of the device professionally, which is completely unnecessary! If the owner comes back with the buybacked battery cells, we can exchange the battery pack and repair the device.','language' => 'de','fault_type_id' => '0','en' => 'It could no longer be charged. We checked the batteries. Several cells were defective and could no longer be charged. Unfortunately, the manufacturer\'s recommendation in this case is to dispose of the device properly, which is completely unnecessary! If the owner comes back with the repurchased battery cells, we can replace the battery pack and repair the device.','de' => 'Er ließ sich nicht mehr aufladen. Wir haben die Akkus überprüft. Mehrere Zellen waren defekt und ließen sich nicht mehr aufladen. Leider ist die Empfehlung des Herstellers in diesem Fall, das Gerät fachgerecht zu entsorgen, was völlig unnötig ist! Wenn der Besitzer mit den nachgekauften Akkuzellen wiederkommt, können wir das Akkupack austauschen und das Gerät reparieren.','nl' => 'Hij kon niet meer worden opgeladen. We hebben de batterijen gecontroleerd. Verschillende cellen waren defect en konden niet meer worden opgeladen. Helaas raadt de fabrikant in dit geval aan het apparaat op de juiste manier weg te gooien, wat volstrekt onnodig is! Als de eigenaar terugkomt met de teruggekochte batterijcellen, kunnen wij de batterij vervangen en het toestel repareren.','fr' => 'Il ne se rechargeait plus. Nous avons vérifié les batteries. Plusieurs cellules étaient défectueuses et ne pouvaient plus être rechargées. Malheureusement, la recommandation du fabricant dans ce cas est de se débarrasser de l\'appareil de manière appropriée, ce qui est totalement inutile ! Si le propriétaire revient avec les cellules de batterie rachetées, nous pourrons remplacer le pack de batteries et réparer l\'appareil.','it' => 'Non poteva più essere caricato. Abbiamo controllato le batterie. Diverse celle erano difettose e non potevano più essere caricate. Purtroppo, la raccomandazione del produttore in questo caso è di smaltire il dispositivo in modo appropriato, il che è completamente inutile! Se il proprietario torna con le celle della batteria ricomprate, possiamo sostituire il pacco batteria e riparare il dispositivo.','es' => 'Ya no se podía cargar. Comprobamos las baterías. Varias celdas estaban defectuosas y ya no se podían cargar. Desgraciadamente, la recomendación del fabricante en este caso es deshacerse del aparato de forma profesional, lo cual es completamente innecesario. Si el propietario vuelve con las pilas recompradas, podemos sustituir el paquete de pilas y reparar el aparato.'),
  array('id_ords' => 'anstiftung_2623','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2015-06-04','problem' => 'Es lag ein Wasserschaden vor und der Motor tat nichts mehr. Wir haben das Gerät auseinandergenommen und den Motor untersucht. Leider lag ein Kurzschluss vor, der sich nicht beheben ließ. Der Besucher schaut sich nach einem Ersatzmotor um und wenn das klappt, können wir den Staubsauger wiederbeleben.','googletrans' => 'There was a water damage before and the engine did nothing more. We have taken out the device and examined the engine. Unfortunately, there was a short circuit that could not be remedied. The visitor looks after a replacement motor and if it works, we can revive the vacuum cleaner.','language' => 'de','fault_type_id' => '0','en' => 'There was water damage and the motor did nothing. We took the device apart and examined the motor. Unfortunately, there was a short circuit that could not be fixed. The visitor looks around for a replacement motor and if that works, we can revive the vacuum cleaner.','de' => 'Es lag ein Wasserschaden vor und der Motor tat nichts mehr. Wir haben das Gerät auseinandergenommen und den Motor untersucht. Leider lag ein Kurzschluss vor, der sich nicht beheben ließ. Der Besucher schaut sich nach einem Ersatzmotor um und wenn das klappt, können wir den Staubsauger wiederbeleben.','nl' => 'Er was waterschade en de motor deed niets meer. We haalden het toestel uit elkaar en onderzochten de motor. Helaas was er een kortsluiting die niet kon worden gerepareerd. De bezoeker zoekt een vervangmotor en als die werkt, kunnen we de stofzuiger weer aan de praat krijgen.','fr' => 'Il y avait un dégât des eaux et le moteur ne faisait plus rien. Nous avons démonté l\'appareil et examiné le moteur. Malheureusement, il y avait un court-circuit qui ne pouvait pas être réparé. Le visiteur se met à la recherche d\'un moteur de remplacement et si cela fonctionne, nous pourrons faire revivre l\'aspirateur.','it' => 'C\'era un danno da acqua e il motore non faceva più nulla. Abbiamo smontato l\'unità ed esaminato il motore. Purtroppo, c\'era un corto circuito che non poteva essere riparato. Il visitatore si guarda intorno per un motore sostitutivo e se questo funziona, possiamo far rivivere l\'aspirapolvere.','es' => 'Había daños por agua y el motor ya no hacía nada. Desmontamos la unidad y examinamos el motor. Lamentablemente, se produjo un cortocircuito que no pudo ser reparado. El visitante busca un motor de repuesto y, si funciona, podemos reactivar la aspiradora.'),
  array('id_ords' => 'anstiftung_2630','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Bosch','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2015-05-21','problem' => 'Der Motor drehte sich nicht mehr. Wir haben ihn komplett freigelegt und dabei bemerkt, dass der Statorkorb verzogen war - leider irreparabel. Wir haben noch den Tipp gegeben, auf einem Wertstoffhof nach einem vergleichbaren Gerät zu fragen, um kostengünstig an einen Austauschmotors zu kommen.','googletrans' => 'The engine did not turn anymore. We have completely exposed him and noticed that the stator basket was warped - unfortunately irreparable. We still have given the tip to ask on a recycling station after a comparable device in order to be inexpensive to come to an exchange motor.','language' => 'de','fault_type_id' => '0','en' => 'The motor no longer turned. We uncovered it completely and noticed that the stator basket was warped - unfortunately irreparable. We also gave the tip to ask for a comparable device at a recycling center in order to get a replacement motor at a reasonable price.','de' => 'Der Motor drehte sich nicht mehr. Wir haben ihn komplett freigelegt und dabei bemerkt, dass der Statorkorb verzogen war - leider irreparabel. Wir haben noch den Tipp gegeben, auf einem Wertstoffhof nach einem vergleichbaren Gerät zu fragen, um kostengünstig an einen Austauschmotors zu kommen.','nl' => 'De motor draaide niet meer. We legden hem helemaal bloot en zagen dat de korf van de stator krom was - helaas onherstelbaar. Wij gaven ook de tip om bij een recyclingcentrum naar een vergelijkbaar toestel te vragen om tegen een redelijke prijs een vervangingsmotor te krijgen.','fr' => 'Le moteur ne tournait plus. Nous l\'avons entièrement dégagé et avons remarqué que la cage du stator était déformée - malheureusement irréparable. Nous avons encore donné le conseil de demander un appareil comparable dans une déchetterie pour obtenir un moteur de remplacement à moindre coût.','it' => 'Il motore non girava più. L\'abbiamo scoperto completamente e abbiamo notato che il cestello dello statore era deformato - purtroppo irreparabile. Abbiamo anche dato il consiglio di chiedere un dispositivo comparabile in un centro di riciclaggio per ottenere un motore di ricambio a un prezzo ragionevole.','es' => 'El motor ya no giraba. Lo destapamos por completo y nos dimos cuenta de que la cesta del estator estaba alabeada, desgraciadamente irreparable. También dimos el consejo de preguntar por un aparato similar en un centro de reciclaje para conseguir un motor de sustitución a un precio razonable.'),
  array('id_ords' => 'anstiftung_2653','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2015-03-05','problem' => 'Hier konnten wir einen Kabelbruch am Netzstecker finden und werden es beim nächsten Mal reparieren, wenn ein neuer Stecker vorhanden ist.','googletrans' => 'Here we could find a cable break on the power plug and will repair it next time when a new plug is present.','language' => 'de','fault_type_id' => '0','en' => 'Here we were able to find a broken cable on the power plug and will repair it next time when a new plug is available.','de' => 'Hier konnten wir einen Kabelbruch am Netzstecker finden und werden es beim nächsten Mal reparieren, wenn ein neuer Stecker vorhanden ist.','nl' => 'Hier konden we een gebroken kabel aan de netstekker vinden en we zullen het de volgende keer repareren als er een nieuwe stekker beschikbaar is.','fr' => 'Ici, nous avons pu trouver une rupture de câble au niveau de la fiche d\'alimentation et nous la réparerons la prochaine fois qu\'une nouvelle fiche sera disponible.','it' => 'Qui siamo stati in grado di trovare un cavo rotto sulla spina di rete e lo ripareremo la prossima volta quando sarà disponibile una nuova spina.','es' => 'Aquí pudimos encontrar un cable roto en el enchufe de la red eléctrica y lo repararemos la próxima vez cuando haya un nuevo enchufe disponible.'),
  array('id_ords' => 'anstiftung_2655','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2015-03-05','problem' => 'Er hatte nicht mehr die gewohnte Leistung. Nach eingehender Fehlersuche konnte eine verstopfte Bodendüse ausgemacht werden. Nach intensiver Reinigung des Geräts saugte es wieder wie früher.','googletrans' => 'He did not have the usual performance anymore. After incoming troubleshooting, a clogged floor nozzle could be identified. After intensive cleaning of the device it sucked again as soon as possible.','language' => 'de','fault_type_id' => '0','en' => 'It no longer had the usual performance. After thorough troubleshooting, a clogged floor nozzle was identified. After intensive cleaning of the device, it sucked again as before.','de' => 'Er hatte nicht mehr die gewohnte Leistung. Nach eingehender Fehlersuche konnte eine verstopfte Bodendüse ausgemacht werden. Nach intensiver Reinigung des Geräts saugte es wieder wie früher.','nl' => 'Het had niet meer de gebruikelijke prestaties. Na een grondige probleemoplossing werd een verstopte vloermond vastgesteld. Na intensieve reiniging van het toestel, zoog het weer als voorheen.','fr' => 'Il n\'avait plus les performances habituelles. Après une recherche approfondie du problème, il a été possible d\'identifier un suceur de sol bouché. Après un nettoyage intensif de l\'appareil, il a de nouveau aspiré comme avant.','it' => 'Non aveva più le solite prestazioni. Dopo un\'accurata risoluzione dei problemi, è stato identificato un ugello del pavimento intasato. Dopo la pulizia intensiva dell\'apparecchio, succhiava di nuovo come prima.','es' => 'Ya no tenía el rendimiento habitual. Tras una exhaustiva resolución de problemas, se identificó una boquilla de suelo obstruida. Después de la limpieza intensiva del a