  array('id_ords' => 'anstiftung_2774','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'AEG','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-08-05','problem' => 'Keinerlei Funktion - schon die Zerlegung stellte sich wegen einiger unter Plastikkappen versteckter Gehäuseschrauben als echte Herausforderung heraus und dauerte entsprechend länger. Nachdem wir uns aber bis zum Elektromotor und der Steuerelektronik vorgearbeitet hatten, war der Rest dann fast schon Routine: Durchgangsprüfung von Kabel und Netzzuleitung sowie Widerstandsmessungen am Motor, wobei Letztere auf einen Defekt hindeuteten. Bei genauerer Suche entdeckten wir einen Drahtriss an der Kontaktstelle zur Statorspule, der durch Anlöten zu beheben war. Hinterher lief er dann wieder wie eh und je.','googletrans' => 'No function - even the decomposition made itself as a true challenge because of some under plastic caps hidden housing screws and last longer. However, after we have worked up to the electric motor and the control electronics, the rest was almost routine: passage testing of cables and power supply and resistance measurements on the engine, the latter indicative of a defect. In case of more closer searches, we discovered a wire triss on the contact point to fix the stator coil, which was soldered by soldering. Afterwards then he ran again like anyway.','language' => 'de','fault_type_id' => '0','en' => 'No function at all - already the disassembly turned out to be a real challenge due to some housing screws hidden under plastic caps and took correspondingly longer. After we had worked our way to the electric motor and the control electronics, the rest was almost routine: continuity check of cable and power supply line as well as resistance measurements on the motor, whereby the latter indicated a defect. On closer inspection, we discovered a wire break at the contact point to the stator coil, which could be repaired by soldering. Afterwards, it ran again as it always had.','de' => 'Keinerlei Funktion - schon die Zerlegung stellte sich wegen einiger unter Plastikkappen versteckter Gehäuseschrauben als echte Herausforderung heraus und dauerte entsprechend länger. Nachdem wir uns aber bis zum Elektromotor und der Steuerelektronik vorgearbeitet hatten, war der Rest dann fast schon Routine: Durchgangsprüfung von Kabel und Netzzuleitung sowie Widerstandsmessungen am Motor, wobei Letztere auf einen Defekt hindeuteten. Bei genauerer Suche entdeckten wir einen Drahtriss an der Kontaktstelle zur Statorspule, der durch Anlöten zu beheben war. Hinterher lief er dann wieder wie eh und je.','nl' => 'Geen enkele functie - reeds de demontage bleek een echte uitdaging vanwege enkele onder plastic kapjes verborgen schroeven in de behuizing en duurde dienovereenkomstig langer. Nadat wij ons een weg hadden gebaand naar de elektromotor en de besturingselektronica, was de rest bijna routine: continuïteitscontrole van kabel en netsnoer, alsmede weerstandsmetingen aan de motor, waarbij de laatste op een defect wees. Bij nadere inspectie ontdekten we een draadbreuk bij het contactpunt met de statorspoel, die kon worden gerepareerd door solderen. Daarna liep hij weer als vanouds.','fr' => 'Aucune fonction - le démontage s\'est avéré être un véritable défi en raison des quelques vis du boîtier cachées sous des capuchons en plastique et a donc pris plus de temps. Mais après avoir travaillé jusqu\'au moteur électrique et à l\'électronique de commande, le reste était presque de la routine : contrôle de la continuité du câble et du cordon d\'alimentation ainsi que mesures de la résistance du moteur, ces dernières indiquant un défaut. En cherchant plus précisément, nous avons découvert une rupture de fil au point de contact avec la bobine du stator, qui a pu être réparée en la soudant. Après cela, il a recommencé à fonctionner comme avant.','it' => 'Nessuna funzione - già lo smontaggio si è rivelato una vera sfida a causa di alcune viti dell\'alloggiamento nascoste sotto tappi di plastica e ha richiesto un tempo corrispondente. Dopo aver raggiunto il motore elettrico e l\'elettronica di controllo, il resto è stato quasi di routine: controllo della continuità del cavo e del cavo di alimentazione e misurazioni della resistenza del motore, quando quest\'ultima indicava un difetto. Ad un\'ispezione più attenta, abbiamo scoperto una rottura del filo nel punto di contatto con la bobina dello statore, che potrebbe essere riparata con una saldatura. In seguito, ha ripreso a funzionare come ha sempre fatto.','es' => 'No funciona en absoluto - ya el desmontaje resultó ser un verdadero desafío debido a algunos tornillos de la carcasa ocultos bajo tapas de plástico y tomó correspondientemente más tiempo. Una vez que llegamos al motor eléctrico y a la electrónica de control, el resto fue casi rutinario: comprobación de la continuidad del cable y del cable de alimentación, así como mediciones de la resistencia del motor, si este último indicaba un defecto. Al inspeccionar más de cerca, descubrimos una rotura de cable en el punto de contacto con la bobina del estator, que podía repararse soldando. Después, volvió a funcionar como siempre.'),
  array('id_ords' => 'anstiftung_2782','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Dirt Devil','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2018-08-02','problem' => 'Problem am Elektromotor - zwei völlig abgenutzte Bürstenkohlen Ersatz wird bestellt','googletrans' => 'Problem on the electric motor - two completely worn brushes replacement is ordered','language' => 'de','fault_type_id' => '0','en' => 'Problem on the electric motor - two brush carbons completely worn out Replacement is ordered','de' => 'Problem am Elektromotor - zwei völlig abgenutzte Bürstenkohlen Ersatz wird bestellt','nl' => 'Probleem met de elektromotor - twee volledig versleten koolborstels Vervanging is besteld','fr' => 'Problème au niveau du moteur électrique - deux charbons de brosse complètement usés Le remplacement est commandé','it' => 'Problema sul motore elettrico - due carboni delle spazzole completamente usurati La sostituzione è stata ordinata','es' => 'Problema en el motor eléctrico - dos carbones de escobillas completamente desgastados Se pide su sustitución'),
  array('id_ords' => 'anstiftung_2808','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Dirt Devil','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2018-07-26','problem' => 'Mit einem neuen Triac machten wir uns daran, die Reparatur des „Dirt Devil DD 2200“ Staubsaugers vom letzten Gruna-Termin fortzusetzen. Der Austausch brachte jedoch nicht den gewünschten Erfolg, weshalb wir erneut auf Fehlersuche gingen und dabei insbesondere den Elektromotor genauer in den Blick nahmen. Seltsamerweise ließ sich an dessen Kontakten in keiner Rotorposition ein Widerstand messen, was unserer Vermutung nach auf eine verklemmte Bürstenkohle hindeutet. Eine genauere Inspektion musste allerdings auf den nächsten Termin vertagt werden, da sich der Abend an dieser Stelle bereits dem Ende neigte.','googletrans' => 'With a new Triac we made ourselves the repair of the "Dirt Devil DD 2200" vacuum cleaner from the last GRUNA appointment. However, the exchange did not bring the desired success, which is why we went again to troubleshooting and especially the electric motor took more closely. Strangely, there was a resistance in any rotor position at its contacts, which suggests our guess in a jammed brush coal. However, a more accurate inspection had to be postponed on the next appointment, as the evening at this point already tended to the end.','language' => 'de','fault_type_id' => '0','en' => 'With a new triac, we set about continuing the repair of the "Dirt Devil DD 2200" vacuum cleaner from the last Gruna appointment. However, the replacement did not bring the desired success, so we went troubleshooting again and took a closer look at the electric motor in particular. Strangely, no resistance could be measured at its contacts in any rotor position, which we suspected to be a jammed brush carbon. However, a more detailed inspection had to be postponed until the next appointment, as the evening was already drawing to a close at this point.','de' => 'Mit einem neuen Triac machten wir uns daran, die Reparatur des „Dirt Devil DD 2200“ Staubsaugers vom letzten Gruna-Termin fortzusetzen. Der Austausch brachte jedoch nicht den gewünschten Erfolg, weshalb wir erneut auf Fehlersuche gingen und dabei insbesondere den Elektromotor genauer in den Blick nahmen. Seltsamerweise ließ sich an dessen Kontakten in keiner Rotorposition ein Widerstand messen, was unserer Vermutung nach auf eine verklemmte Bürstenkohle hindeutet. Eine genauere Inspektion musste allerdings auf den nächsten Termin vertagt werden, da sich der Abend an dieser Stelle bereits dem Ende neigte.','nl' => 'Met een nieuwe triac, gingen we verder met de reparatie van de "Dirt Devil DD 2200" stofzuiger van de laatste Gruna afspraak. De vervanging bracht echter niet het gewenste succes, dus gingen we opnieuw op zoek naar problemen en namen we de elektromotor in het bijzonder onder de loep. Vreemd genoeg kon in geen enkele positie van de rotor weerstand worden gemeten aan de contacten, hetgeen wij verdachten van een vastzittende koolborstel. Een meer gedetailleerde inspectie moest echter worden uitgesteld tot de volgende afspraak, omdat de avond op dat moment al ten einde liep.','fr' => 'Avec un nouveau triac, nous avons entrepris de poursuivre la réparation de l\'aspirateur "Dirt Devil DD 2200" lors du dernier rendez-vous de Gruna. Le remplacement n\'ayant pas donné les résultats escomptés, nous sommes repartis à la recherche de la panne, notamment en examinant de plus près le moteur électrique. Bizarrement, aucune résistance n\'a été mesurée sur les contacts de ce dernier, quelle que soit la position du rotor, ce qui, selon nous, indique que le charbon des brosses est coincé. Une inspection plus approfondie a toutefois dû être reportée au prochain rendez-vous, car la soirée touchait déjà à sa fin à ce stade.','it' => 'Con un nuovo triac, abbiamo iniziato a continuare la riparazione dell\'aspirapolvere "Dirt Devil DD 2200" dell\'ultimo appuntamento di Gruna. Tuttavia, la sostituzione non ha portato il successo desiderato, così siamo andati di nuovo a risolvere i problemi e abbiamo dato un\'occhiata più da vicino al motore elettrico in particolare. Stranamente, nessuna resistenza poteva essere misurata ai suoi contatti in qualsiasi posizione del rotore, cosa che sospettavamo essere un carbone di spazzola inceppato. Tuttavia, un\'ispezione più dettagliata dovette essere rimandata al prossimo appuntamento, dato che la serata stava già volgendo al termine.','es' => 'Con un nuevo triac, nos dispusimos a continuar la reparación de la aspiradora "Dirt Devil DD 2200" de la última cita de Gruna. Sin embargo, la sustitución no tuvo el éxito deseado, por lo que volvimos a revisar el motor eléctrico en particular. Extrañamente, no se pudo medir ninguna resistencia en sus contactos en ninguna posición del rotor, lo que nos hizo sospechar que se trataba de un carbón de escobilla atascado. Sin embargo, hubo que posponer una inspección más detallada hasta la siguiente cita, ya que la velada estaba llegando a su fin.'),
  array('id_ords' => 'anstiftung_2837','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Dirt Devil','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2018-06-28','problem' => 'Der Staubsauger verweigerte seinen Dienst und zeigte keinerlei Reaktion auf unsere Einschaltversuche. Wir kontrollierten das Zuleitungskabel und alle Verbindungen im Inneren, maßen die Spannung an der Steuerbaugruppe und prüften verschiedene Bauteile sowie den Elektromotor auf bekannte Defekte. Der Verdacht fiel schließlich auf den Triac, welcher für die Motorsteuerung zuständig ist. Ein Neuer wird bestellt und die Reparatur beim nächsten Mal fortgesetzt.','googletrans' => 'The vacuum cleaner refused his service and showed no response to our turn-on attempts. We controlled the supply cable and all connections inside, measure the voltage at the control assembly and tested different components as well as the electric motor on known defects. The suspicion finally fell on the Triac, which is responsible for the engine control. A newer is ordered and the repair continues next time.','language' => 'de','fault_type_id' => '0','en' => 'The vacuum cleaner refused to work and showed no reaction to our attempts to switch it on. We checked the supply cable and all connections inside, measured the voltage at the control module and checked various components as well as the electric motor for known defects. Suspicion finally fell on the triac, which is responsible for motor control. A new one will be ordered and the repair will be continued next time.','de' => 'Der Staubsauger verweigerte seinen Dienst und zeigte keinerlei Reaktion auf unsere Einschaltversuche. Wir kontrollierten das Zuleitungskabel und alle Verbindungen im Inneren, maßen die Spannung an der Steuerbaugruppe und prüften verschiedene Bauteile sowie den Elektromotor auf bekannte Defekte. Der Verdacht fiel schließlich auf den Triac, welcher für die Motorsteuerung zuständig ist. Ein Neuer wird bestellt und die Reparatur beim nächsten Mal fortgesetzt.','nl' => 'De stofzuiger weigerde te werken en reageerde niet op onze pogingen hem aan te zetten. Wij controleerden de voedingskabel en alle aansluitingen binnenin, maten de spanning op de regelmodule en controleerden diverse onderdelen en de elektromotor op bekende defecten. De triac, die verantwoordelijk is voor de motorsturing, werd uiteindelijk verdacht. Er zal een nieuwe worden besteld en de reparatie zal de volgende keer worden voortgezet.','fr' => 'L\'aspirateur a refusé de fonctionner et n\'a pas réagi à nos tentatives de mise en marche. Nous avons contrôlé le câble d\'alimentation et toutes les connexions à l\'intérieur, mesuré la tension au niveau du module de commande et vérifié si différents composants et le moteur électrique présentaient des défauts connus. Les soupçons se sont finalement portés sur le triac, qui est responsable de la commande du moteur. Un nouveau sera commandé et la réparation se poursuivra la prochaine fois.','it' => 'L\'aspirapolvere si è rifiutato di funzionare e non ha mostrato alcuna reazione ai nostri tentativi di accenderlo. Abbiamo controllato il cavo di alimentazione e tutte le connessioni all\'interno, misurato la tensione al modulo di controllo e controllato vari componenti così come il motore elettrico per difetti noti. Il triac, che è responsabile del controllo del motore, è stato infine sospettato. Ne verrà ordinata una nuova e la riparazione verrà continuata la prossima volta.','es' => 'La aspiradora se negó a funcionar y no mostró ninguna reacción a nuestros intentos de encenderla. Hemos comprobado el cable de alimentación y todas las conexiones del interior, hemos medido la tensión en el módulo de control y hemos comprobado varios componentes, así como el motor eléctrico, en busca de defectos conocidos. Finalmente se sospechó del triac, responsable del control del motor. Se pedirá uno nuevo y se continuará con la reparación la próxima vez.'),
  array('id_ords' => 'anstiftung_2856','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Privileg','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-02-01','problem' => 'Er ging nicht mehr an. Wir untersuchten die Elektronik genauer einen Triac, der für die Drehzahlsteuerung des Motors zuständig ist. Der war OK. Wie es sich herausstellte, hatte das Gerät ein wesentlich simpleres Problem: einer kalten Lötstelle auf der Platine, die im Handumdrehen nachgelötet war, sowie einem verschmutzten Mikroschalter, dessen Kontakte mit einem Glasfaserpinsel und etwas Alkohol gereinigt wurden. Hiernach zeigte sich der Staubsauger dann wieder so agil wie eh und jeh.','googletrans' => 'He did not go anymore. We examined the electronics more precisely a triac, which is responsible for the speed control of the motor. He was ok. As it turned out, the device had a much simpler problem: a cold solder joint on the board, which was subsequently sustained, as well as a dirty microswitch, whose contacts were cleaned with a glass fiber brush and a little alcohol. After that, the vacuum cleaner then showed up again as Agile as Eh and Jeh.','language' => 'de','fault_type_id' => '0','en' => 'It no longer started. We examined the electronics more closely a triac, which is responsible for the speed control of the engine. It was OK. As it turned out, the device had a much simpler problem: a cold solder joint on the circuit board, which was re-soldered in no time, as well as a dirty microswitch, whose contacts were cleaned with a fiberglass brush and some alcohol. After this, the vacuum cleaner was as agile as ever.','de' => 'Er ging nicht mehr an. Wir untersuchten die Elektronik genauer einen Triac, der für die Drehzahlsteuerung des Motors zuständig ist. Der war OK. Wie es sich herausstellte, hatte das Gerät ein wesentlich simpleres Problem: einer kalten Lötstelle auf der Platine, die im Handumdrehen nachgelötet war, sowie einem verschmutzten Mikroschalter, dessen Kontakte mit einem Glasfaserpinsel und etwas Alkohol gereinigt wurden. Hiernach zeigte sich der Staubsauger dann wieder so agil wie eh und jeh.','nl' => 'Hij startte niet meer. We hebben de elektronica nader bekeken, een triac die verantwoordelijk is voor het regelen van het motortoerental. Het was oké. Het bleek dat het apparaat een veel eenvoudiger probleem had: een koude soldeerverbinding op de printplaat, die in een mum van tijd opnieuw werd gesoldeerd, en een vuile microschakelaar, waarvan de contacten werden schoongemaakt met een glasvezelborsteltje en wat alcohol. Daarna was de stofzuiger even wendbaar als altijd.','fr' => 'Il ne démarrait plus. Nous avons examiné l\'électronique et plus particulièrement un triac qui contrôle le régime du moteur. Il n\'était pas défectueux. Il s\'est avéré que l\'appareil avait un problème beaucoup plus simple : un point de soudure froid sur la platine, qui a été ressoudé en un tour de main, et un microcommutateur encrassé, dont les contacts ont été nettoyés avec un pinceau en fibre de verre et un peu d\'alcool. Après cela, l\'aspirateur est redevenu aussi agile que jamais.','it' => 'Non è più partito. Abbiamo esaminato l\'elettronica più da vicino, un triac che è responsabile del controllo della velocità del motore. Era ok. Come si è scoperto, l\'unità aveva un problema molto più semplice: un giunto di saldatura freddo sul circuito, che è stato risaldato in poco tempo, e un microswitch sporco, i cui contatti sono stati puliti con una spazzola di fibra di vetro e un po\' di alcol. Dopo di che, l\'aspirapolvere era agile come sempre.','es' => 'Ya no arranca. Examinamos la electrónica más de cerca, un triac que es responsable de controlar la velocidad del motor. Estaba bien. Resultó que el aparato tenía un problema mucho más sencillo: una junta de soldadura fría en la placa del circuito, que se volvió a soldar en un santiamén, así como un microinterruptor sucio, cuyos contactos se limpiaron con un cepillo de fibra de vidrio y algo de alcohol. Después de eso, la aspiradora fue tan ágil como siempre.'),
  array('id_ords' => 'anstiftung_2861','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-02-01','problem' => 'Das Netzkabel war voll heraus gezogen und das Gerät zog es nicht mehr ein. Das Gerät wurde geöffnet, die Kabeltrommel ausgebaut und der Rückstellmechanismus entriegelt. Anschließend konnte das Kabel wieder komplett aufgewickelt werden. Wir empfahlen, es in Zukunft nicht mehr bis zum Anschlag herauszuziehen, um dem Mechanismus ein Wiederaufrollen zu ermöglichen.','googletrans' => 'The power cord was fully pulled out and the device did not take it anymore. The device was opened, the cable drum removed and the reset mechanism unlocks. Then the cable could be completely wound up. We recommend that in the future no longer pull out to the stop to allow the mechanism to re-roll.','language' => 'de','fault_type_id' => '0','en' => 'The power cord was pulled out fully and the unit did not retract it. The unit was opened, the cable drum removed and the reset mechanism unlocked. The cable could then be completely wound up again. We recommended not pulling it out all the way in the future to allow the mechanism to rewind.','de' => 'Das Netzkabel war voll heraus gezogen und das Gerät zog es nicht mehr ein. Das Gerät wurde geöffnet, die Kabeltrommel ausgebaut und der Rückstellmechanismus entriegelt. Anschließend konnte das Kabel wieder komplett aufgewickelt werden. Wir empfahlen, es in Zukunft nicht mehr bis zum Anschlag herauszuziehen, um dem Mechanismus ein Wiederaufrollen zu ermöglichen.','nl' => 'Het netsnoer was volledig uitgetrokken en het toestel trok het niet terug. Het toestel werd geopend, de kabeltrommel verwijderd en het resetmechanisme ontgrendeld. Daarna kon de kabel weer volledig worden opgerold. Wij raden aan om hem in de toekomst niet helemaal uit te trekken, zodat het mechanisme kan terugspoelen.','fr' => 'Le câble d\'alimentation était complètement sorti et l\'appareil ne le rentrait plus. L\'appareil a été ouvert, le tambour de câble a été retiré et le mécanisme de rappel a été déverrouillé. Le câble a ensuite pu être complètement enroulé. Nous avons recommandé de ne pas le tirer à fond à l\'avenir afin de permettre au mécanisme de se réenrouler.','it' => 'Il cavo di alimentazione è stato completamente tirato fuori e l\'unità non l\'ha ritirato. L\'unità è stata aperta, il tamburo del cavo rimosso e il meccanismo di reset sbloccato. Poi il cavo potrebbe essere riavvolto completamente. Si raccomanda di non estrarlo completamente in futuro per permettere al meccanismo di riavvolgersi.','es' => 'El cable de la red eléctrica estaba totalmente extraído y la unidad no lo retraía. Se abrió la unidad, se retiró el tambor de cable y se desbloqueó el mecanismo de reposición. Entonces, el cable podría volver a enrollarse por completo. Recomendamos no sacarlo del todo en el futuro para permitir que el mecanismo se rebobine.'),
