  array('id_ords' => 'anstiftung_2893','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Philips','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-06-07','problem' => 'Abschluss der Reparatur vom letzten Male - Daheim war er offenbar am Zusammenbau des Gerätes gescheitert und benötigte hierbei noch einmal unsere Hilfe. Gemeinsam setzten wir alles zusammen und konnten die Reparatur somit zu einem gelungenen Abschluss bringen.','googletrans' => 'Completion of the repair of the last time - at home, he was evidently failed to assemble the device and once again needed our help. Together we put everything together and were able to bring the repair to a successful conclusion.','language' => 'de','fault_type_id' => '0','en' => 'Completion of the repair from last time - At home, he had apparently failed at assembling the device and needed our help once again. Together we put everything together and were thus able to bring the repair to a successful conclusion.','de' => 'Abschluss der Reparatur vom letzten Male - Daheim war er offenbar am Zusammenbau des Gerätes gescheitert und benötigte hierbei noch einmal unsere Hilfe. Gemeinsam setzten wir alles zusammen und konnten die Reparatur somit zu einem gelungenen Abschluss bringen.','nl' => 'Voltooiing van de reparatie van de vorige keer - Thuis was hij er blijkbaar niet in geslaagd het toestel in elkaar te zetten en had hij opnieuw onze hulp nodig. Samen hebben we alles op een rijtje gezet en konden we de reparatie tot een goed einde brengen.','fr' => 'Fin de la réparation de la dernière fois - Chez lui, il n\'avait apparemment pas réussi à assembler l\'appareil et avait encore besoin de notre aide pour cela. Nous avons tout assemblé ensemble et avons réussi à terminer la réparation.','it' => 'Completamento della riparazione dell\'ultima volta - A casa, aveva apparentemente fall