  array('id_ords' => 'anstiftung_2900','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Dirt Devil','year_of_manufacture' => '','product_age' => '','repair_status' => 'End of life','event_date' => '2018-05-03','problem' => 'Mehrere Wicklungen im Motor durchgebrannt','googletrans' => 'Multiple windings blown in the engine','language' => 'de','fault_type_id' => '0','en' => 'Several windings in the motor burned out','de' => 'Mehrere Wicklungen im Motor durchgebrannt','nl' => 'Verschillende wikkelingen in de motor zijn doorgebrand.','fr' => 'Plusieurs enroulements du moteur grillés','it' => 'Diversi avvolgimenti del motore sono bruciati','es' => 'Se han quemado varios devanados del motor'),
  array('id_ords' => 'anstiftung_2903','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Miele','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-05-03','problem' => 'Keine Saugleistung -  nach genauerer Begutachtung stellten wir fest, dass hier offenbar schon jemand dran gewesen war und ein Taschentuch vor den Filter ins Saugrohr geklemmt hatte. Kein Wunder also, dass die Saugleistung zu gering war. Ohne die Verstopfung lief er wieder tadellos.','googletrans' => 'No suction power - after a closer assessment we realized that here obviously someone was already on it and a handkerchief had clamped in front of the filter into the suction tube. No wonder so that the suction power was too low. Without the constipation, he ran perfectly again.','language' => 'de','fault_type_id' => '0','en' => 'No suction power - after a closer inspection, we noticed that someone had obviously already been at it and had clamped a handkerchief in front of the filter in the suction tube. No wonder, then, that the suction power was too low. Without the blockage, it ran perfectly again.','de' => 'Keine Saugleistung -  nach genauerer Begutachtung stellten wir fest, dass hier offenbar schon jemand dran gewesen war und ein Taschentuch vor den Filter ins Saugrohr geklemmt hatte. Kein Wunder also, dass die Saugleistung zu gering war. Ohne die Verstopfung lief er wieder tadellos.','nl' => 'Geen zuigkracht - bij nadere inspectie zagen we dat iemand hier duidelijk al geweest was en een zakdoek voor het filter in de zuigpijp had gestopt. Geen wonder dus dat de zuigkracht te laag was. Zonder de verstopping, liep hij weer perfect.','fr' => 'Pas de puissance d\'aspiration - après un examen plus approfondi, nous avons constaté que quelqu\'un était apparemment déjà passé par là et avait coincé un mouchoir devant le filtre dans le tube d\'aspiration. Il n\'est donc pas étonnant que la puissance d\'aspiration soit trop faible. Sans l\'obstruction, il fonctionnait à nouveau parfaitement.','it' => 'Nessuna potenza di aspirazione - dopo un\'ispezione più approfondita, abbiamo notato che qualcuno era ovviamente già stato qui e aveva infilato un fazzoletto davanti al filtro nel tubo di aspirazione. Non c\'è da stupirsi, quindi, che la potenza di aspirazione fosse troppo bassa. Senza il blocco, funzionava di nuovo perfettamente.','es' => 'No hay potencia de succión - después de una inspección más cercana, nos dimos cuenta de que obviamente alguien ya había estado aquí y había metido un pañuelo delante del filtro en el tubo de succión. No es de extrañar, pues, que la potencia de succión fuera demasiado baja. Sin la obstrucción, volvió a funcionar perfectamente.'),
  array('id_ords' => 'anstiftung_2933','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Philips','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2018-05-24','problem' => 'Der Motor des Staubsaugers „performte“ nicht mehr ganz so zuverlässig und ging mitunter auch gar nicht mehr. Bei genauerer Betrachtung fiel auf, dass der Kommutator verschmutzt und die Bürstenkohlen in ihren Führungen verklemmt waren, sodass an dieser Stelle nur ein unzureichender elektrischer Kontakt zustande kam. Nach einer gründlichen Reinigung lief der Motor dann wieder tadellos. Da sich der Abend hier bereits dem Ende neigte, blieb für den Zusammenbau des Staubsaugers keine Zeit. Der Besitzer wird dies daher daheim alleine versuchen oder beim nächsten Mal wiederkommen.','googletrans' => 'The engine of the vacuum cleaner "Performed" is no longer so reliable and sometimes did not go anymore. In a closer consideration, it was noticed that the commutator was dirty and the brush coals were jammed in their guides, so that only an insufficient electrical contact came about at this point. After a thorough cleaning, the engine then ran perfectly again. Since the evening tended to the end here, there was no time for the assembly of the vacuum cleaner. The owner will try this at home alone or come back next time.','language' => 'de','fault_type_id' => '0','en' => 'The motor of the vacuum cleaner no longer "performed" quite as reliably and sometimes even stopped working. A closer look revealed that the commutator was dirty and the brush brushes were jammed in their guides, so that there was only insufficient electrical contact at this point. After a thorough cleaning, the motor ran perfectly again. Since the evening was already drawing to a close here, there was no time to assemble the vacuum cleaner. The owner will therefore try this on his own at home or come back next time.','de' => 'Der Motor des Staubsaugers „performte“ nicht mehr ganz so zuverlässig und ging mitunter auch gar nicht mehr. Bei genauerer Betrachtung fiel auf, dass der Kommutator verschmutzt und die Bürstenkohlen in ihren Führungen verklemmt waren, sodass an dieser Stelle nur ein unzureichender elektrischer Kontakt zustande kam. Nach einer gründlichen Reinigung lief der Motor dann wieder tadellos. Da sich der Abend hier bereits dem Ende neigte, blieb für den Zusammenbau des Staubsaugers keine Zeit. Der Besitzer wird dies daher daheim alleine versuchen oder beim nächsten Mal wiederkommen.','nl' => 'De motor van de stofzuiger "presteerde" niet meer zo betrouwbaar en deed het soms helemaal niet meer. Bij nadere inspectie bleek dat de commutator vuil was en dat de borstelborstels in hun geleiders waren vastgelopen, zodat op dit punt slechts onvoldoende elektrisch contact werd gemaakt. Na een grondige schoonmaakbeurt liep de motor weer perfect. Aangezien de avond hier al ten einde liep, was er geen tijd om de stofzuiger te monteren. De eigenaar zal dit dus thuis zelf proberen of de volgende keer terugkomen.','fr' => 'Le moteur de l\'aspirateur n\'était plus aussi fiable et ne fonctionnait parfois même plus du tout. En y regardant de plus près, on s\'est aperçu que le collecteur était encrassé et que les charbons des brosses étaient coincés dans leurs guides, de sorte qu\'il n\'y avait pas assez de contact électrique à cet endroit. Après un nettoyage minutieux, le moteur a de nouveau fonctionné sans problème. Comme la soirée touchait à sa fin, il n\'y avait pas le temps de remonter l\'aspirateur. Le propriétaire tentera donc de le faire seul à la maison ou reviendra la prochaine fois.','it' => 'Il motore dell\'aspirapolvere non "funzionava" più in modo così affidabile e a volte non funzionava affatto. Ad un\'ispezione più approfondita, è diventato evidente che il commutatore era sporco e le spazzole erano bloccate nelle loro guide, in modo che solo un contatto elettrico insufficiente è stato fatto in questo punto. Dopo un\'accurata pulizia, il motore ha ripreso a funzionare perfettamente. Dato che la serata stava già volgendo al termine, non c\'era tempo per montare l\'aspirapolvere. Il proprietario lo proverà quindi da solo a casa o tornerà la prossima volta.','es' => 'El motor de la aspiradora ya no "funcionaba" con tanta fiabilidad y a veces no funcionaba en absoluto. Al inspeccionarla más de cerca, se vio que el colector estaba sucio y que las escobillas estaban atascadas en sus guías, por lo que el contacto eléctrico era insuficiente en este punto. Tras una limpieza a fondo, el motor volvió a funcionar perfectamente. Como la noche ya estaba llegando a su fin, no hubo tiempo de montar la aspiradora. Por lo tanto, el propietario lo intentará por su cuenta en casa o volverá la próxima vez.'),
  array('id_ords' => 'anstiftung_2987','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-04-05','problem' => 'Störende Betriebsgeräusche und nachlassende Saugleistung waren der Grund, weswegen ein Saugroboter zu uns gebracht wurde. Nach der Zerlegung befreiten wir ihn von größeren Staubflusen und reinigten ihn gründlich. Hinterher surrte er auf gewohnt leise Weise und saugte einige Runden über den Fußboden im Vereinshaus.','googletrans' => 'Disturbing operating noises and decreasing suction power were the reason why a suction robot was brought to us. After the decomposition, we liberate him from larger dust flowers and cleans him thoroughly. Afterwards he squatted quietly and sucked some laps over the floor in the clubhouse.','language' => 'de','fault_type_id' => '0','en' => 'Disturbing operating noises and decreasing suction power were the reasons why a vacuum robot was brought to us. After disassembling it, we freed it from larger dust fluff and cleaned it thoroughly. Afterwards, it whirred in its usual quiet manner and vacuumed a few rounds over the floor in the clubhouse.','de' => 'Störende Betriebsgeräusche und nachlassende Saugleistung waren der Grund, weswegen ein Saugroboter zu uns gebracht wurde. Nach der Zerlegung befreiten wir ihn von größeren Staubflusen und reinigten ihn gründlich. Hinterher surrte er auf gewohnt leise Weise und saugte einige Runden über den Fußboden im Vereinshaus.','nl' => 'Storende werkingsgeluiden en een afnemende zuigkracht waren de redenen om met een robotstofzuiger te komen. Na de demontage hebben we hem vrijgemaakt van grotere stofpluizen en grondig schoongemaakt. Daarna zoemde het op zijn gebruikelijke stille manier en stofzuigde een paar rondjes over de vloer van het clubhuis.','fr' => 'Des bruits de fonctionnement gênants et une baisse de la puissance d\'aspiration sont les raisons pour lesquelles un robot aspirateur a été amené chez nous. Après l\'avoir démonté, nous l\'avons débarrassé des grosses poussières et nettoyé en profondeur. Ensuite, il a ronronné de manière silencieuse et a fait quelques tours d\'aspirateur sur le sol de la maison des associations.','it' => 'Rumori di funzionamento fastidiosi e potenza di aspirazione decrescente sono stati i motivi per cui ci è stato portato un aspirapolvere robot. Dopo averla smontata, l\'abbiamo liberata dalla polvere più grande e l\'abbiamo pulita a fondo. In seguito, ha ronzato nel suo solito modo tranquillo e ha aspirato qualche giro sul pavimento della clubhouse.','es' => 'Los ruidos molestos de funcionamiento y la disminución de la potencia de succión fueron las razones por las que nos trajeron un robot aspirador. Después de desmontarlo, lo liberamos de las pelusas de polvo más grandes y lo limpiamos a fondo. Después, zumbó en su habitual silencio y aspiró unas cuantas rondas sobre el suelo de la sede del club.'),
  array('id_ords' => 'anstiftung_301','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Bosch','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-10-20','problem' => 'Ein- / Ausschalter hat einen Wackelkontakt - Staubsauger geht beim Saugen dauernd aus.','googletrans' => 'On / off switch has a loose contact - vacuum cleaner goes permanently when sucking.','language' => 'de','fault_type_id' => '0','en' => 'On / off switch has a loose contact - vacuum cleaner goes off continuously while vacuuming.','de' => 'Ein- / Ausschalter hat einen Wackelkontakt - Staubsauger geht beim Saugen dauernd aus.','nl' => 'Aan/uit schakelaar heeft een los contact - stofzuiger gaat steeds uit tijdens het stofzuigen.','fr' => 'L\'interrupteur marche/arrêt a un faux contact - l\'aspirateur s\'éteint constamment pendant l\'aspiration.','it' => 'L\'interruttore on/off ha un contatto allentato - l\'aspirapolvere continua a spegnersi durante l\'aspirazione.','es' => 'El interruptor de encendido/apagado tiene un contacto suelto - la aspiradora sigue apagándose mientras se aspira.'),
  array('id_ords' => 'anstiftung_3020','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Fakir','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-03-15','problem' => 'Einem „Farkir“ Saugroboter war die Arbeit wohl zu viel gewesen und er streikte. Allerdings litt dieser nicht an allgemeiner Arbeitsunlust, sondern unter einem defekten Hauptschalter. Dieser wurde ausgebaut, gereinigt und wieder eingebaut. Jetzt läuft er wieder und saugt dem Besitzer alle Krümel vom Boden.','googletrans' => 'A "Farkir" suction robot was probably too much had been too much and he was striking. However, this did not suffer from general work loss, but under a defective main switch. This was expanded, cleaned and rebuilt. Now he runs again and sucks the owner all the crumbs from the ground.','language' => 'de','fault_type_id' => '0','en' => 'The work was probably too much for a "Farkir" robot vacuum cleaner and it went on strike. However, it did not suffer from a general lack of enthusiasm for work, but from a defective main switch. This was removed, cleaned and reinstalled. Now it runs again and sucks all the crumbs off the floor for the owner.','de' => 'Einem „Farkir“ Saugroboter war die Arbeit wohl zu viel gewesen und er streikte. Allerdings litt dieser nicht an allgemeiner Arbeitsunlust, sondern unter einem defekten Hauptschalter. Dieser wurde ausgebaut, gereinigt und wieder eingebaut. Jetzt läuft er wieder und saugt dem Besitzer alle Krümel vom Boden.','nl' => 'Een "Farkir" robotstofzuiger leek te veel werk te hebben en ging in staking. Het had echter niet te lijden van een algemeen gebrek aan werk, maar van een defecte hoofdschakelaar. Het werd verwijderd, schoongemaakt en opnieuw geïnstalleerd. Nu draait hij weer en zuigt alle kruimels van de vloer voor de eigenaar.','fr' => 'Un robot aspirateur "Farkir" n\'a pas supporté la charge de travail et s\'est mis en grève. Il ne souffrait toutefois pas d\'un manque général d\'enthousiasme au travail, mais d\'un interrupteur principal défectueux. Celui-ci a été démonté, nettoyé et remonté. Maintenant, il fonctionne à nouveau et aspire toutes les miettes du sol de son propriétaire.','it' => 'Un robot aspirapolvere "Farkir" sembra aver avuto troppo lavoro ed è entrato in sciopero. Tuttavia, non soffriva di una mancanza generale di lavoro, ma di un interruttore principale difettoso. È stato rimosso, pulito e reinstallato. Ora funziona di nuovo e succhia tutte le briciole dal pavimento per il proprietario.','es' => 'Un robot aspirador "Farkir" parece haber tenido demasiado trabajo y se ha puesto en huelga. Sin embargo, no sufría de una falta de trabajo general, sino de un interruptor principal defectuoso. Se quitó, se limpió y se volvió a instalar. Ahora vuelve a funcionar y a aspirar todas las migajas del suelo para el propietario.'),
  array('id_ords' => 'anstiftung_3021','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-03-15','problem' => 'Ein Krümelfresser namens „Omega“ versagte ebenfalls die Arbeit – dieser litt aber an einem Kabelbruch in der Zuleitung. Nach einem Kürzen der Leitung lief er wieder.','googletrans' => 'A crumb-eater named "Omega" also failed the work - but this suffered on a cable break in the supply line. After a shortening of the line he ran again.','language' => 'de','fault_type_id' => '0','en' => 'A crumb eater called "Omega" also failed to work - but this one suffered from a broken cable in the supply line. After shortening the cable, it ran again.','de' => 'Ein Krümelfresser namens „Omega“ versagte ebenfalls die Arbeit – dieser litt aber an einem Kabelbruch in der Zuleitung. Nach einem Kürzen der Leitung lief er wieder.','nl' => 'Een kruimelvreter genaamd "Omega" werkte ook niet - maar deze had last van een gebroken kabel in de toevoerleiding. Na het inkorten van de kabel, liep hij weer.','fr' => 'Un ramasse-miettes appelé "Omega" ne fonctionnait pas non plus, mais il souffrait d\'une rupture de câble dans la ligne d\'alimentation. Après avoir raccourci le câble, il s\'est remis à fonctionner.','it' => 'Anche un mangia briciole chiamato "Omega" non ha funzionato - ma questo soffriva di un cavo rotto nella linea di alimentazione. Dopo aver accorciato il cavo, ha ripreso a funzionare.','es' => 'Un desmenuzador llamado "Omega" tampoco funcionó, pero éste sufrió la rotura de un cable en la línea de suministro. Después de acortar el cable, volvió a funcionar.'),
  array('id_ords' => 'anstiftung_3046','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Siemens','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2019-06-17','problem' => 'Ein Siemens Bodenstaubsauger „Super 510 Typ BS5“ ließ sich nicht mehr ausschalten. Hier war wirklich der Schalter defekt, für den nun Ersatz benötigt wird. Der Besucher wusste noch nicht, ob er sich um einen neuen Schalter bemüht oder ihn einfach überbrückt.','googletrans' => 'A Siemens floor vacuum cleaner "Super 510 type BS5" could not turn off. Here the switch was really defective, for which now replacement is needed. The visitor did not know if he strives for a new counter or simply bridges him.','language' => 'de','fault_type_id' => '0','en' => 'A Siemens floor vacuum cleaner "Super 510 Type BS5" could no longer be switched off. Here was really the switch defective, for which a replacement is now needed. The visitor did not yet know whether to look for a new switch or simply bypass it.','de' => 'Ein Siemens Bodenstaubsauger „Super 510 Typ BS5“ ließ sich nicht mehr ausschalten. Hier war wirklich der Schalter defekt, für den nun Ersatz benötigt wird. Der Besucher wusste noch nicht, ob er sich um einen neuen Schalter bemüht oder ihn einfach überbrückt.','nl' => 'Een Siemens "Super 510 Type BS5" stofzuiger kon niet meer worden uitgeschakeld. Hier was de schakelaar echt defect, waarvoor nu een vervanging nodig is. De bezoeker wist nog niet of hij een nieuwe schakelaar moest zoeken of deze gewoon moest omzeilen.','fr' => 'Un aspirateur Siemens "Super 510 type BS5" ne s\'éteignait plus. Ici, c\'est vraiment l\'interrupteur qui était défectueux et il faut maintenant le remplacer. Le visiteur ne savait pas encore s\'il allait chercher un nouvel interrupteur ou simplement le ponter.','it' => 'Un aspirapolvere Siemens "Super 510 Tipo BS5" non poteva p