  array('id_ords' => 'anstiftung_4163','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Omega','year_of_manufacture' => '1999','product_age' => '','repair_status' => 'Fixed','event_date' => '2019-11-14','problem' => 'er funktionierte nicht mehr. Nach eingehender Untersuchung stellten wir einen Kabelbruch am Gehäuse fest. Wir kürzten das Netzkabel und schlossen es im Gerät neu an.','googletrans' => 'He did not work anymore. After incoming examination, we set a cable break on the housing. We kept the power cord and turned it back in the device.','language' => 'de','fault_type_id' => '0','en' => 'it no longer functioned. After a thorough examination, we found a broken cable on the casing. We shortened the power cord and reconnected it in the device.','de' => 'er funktionierte nicht mehr. Nach eingehender Untersuchung stellten wir einen Kabelbruch am Gehäuse fest. Wir kürzten das Netzkabel und schlossen es im Gerät neu an.','nl' => 'werkte het niet meer. Na een grondig onderzoek, vonden we een gebroken kabel op de behuizing. We hebben de stroomkabel ingekort en opnieuw aangesloten in het toestel.','fr' => 'il ne fonctionnait plus. Après un examen approfondi, nous avons constaté une rupture du câble sur le boîtier. Nous avons raccourci le câble d\'alimentation et l\'avons rebranché dans l\'appareil.','it' => 'non funzionava più. Dopo un esame approfondito, abbiamo trovato un cavo rotto sull\'alloggiamento. Abbiamo accorciato il cavo di alimentazione e l\'abbiamo ricollegato nell\'unità.','es' => 'ya no funcionaba. Tras un examen exhaustivo, encontramos un cable roto en la carcasa. Acortamos el cable de alimentación y lo reconectamos en la unidad.'),
  array('id_ords' => 'anstiftung_4175','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Severin','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2019-11-21','problem' => 'der Saugmotor funktionierte nicht mehr. Da vermutlich die Sensorik im Motor defekt ist, versucht der Gast ein Ersatzmotor zu bekommen. Die Reparatur wird dann fortgesetzt.','googletrans' => 'The suction motor did not work anymore. Since probably the sensors in the engine is defective, the guest tries to get a replacement motor. The repair is then continued.','language' => 'de','fault_type_id' => '0','en' => 'the suction motor stopped working. Since the sensor system in the motor is probably defective, the guest tries to get a replacement motor. The repair is then continued.','de' => 'der Saugmotor funktionierte nicht mehr. Da vermutlich die Sensorik im Motor defekt ist, versucht der Gast ein Ersatzmotor zu bekommen. Die Reparatur wird dann fortgesetzt.','nl' => 'werkte de zuigmotor niet meer. Aangezien het sensorsysteem in de motor waarschijnlijk defect is, probeert de gast een vervangmotor te krijgen. De reparatie wordt dan voortgezet.','fr' => 'le moteur d\'aspiration ne fonctionnait plus. Comme c\'est probablement le capteur du moteur qui est défectueux, le client essaie d\'obtenir un moteur de remplacement. La réparation se poursuit alors.','it' => 'il motore di aspirazione non funzionava più. Poiché il sistema di sensori nel motore è probabilmente difettoso, l\'ospite cerca di ottenere un motore sostitutivo. La riparazione viene poi continuata.','es' => 'el motor de aspiración dejó de funcionar. Dado que el sistema de sensores del motor es probablemente defectuoso, el huésped intenta conseguir un motor de repuesto. A continuación, se continúa con la reparación.'),
  array('id_ords' => 'anstiftung_4182','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2019-11-21','problem' => 'der Motor drehte nicht mehr. Wir stellten fest, dass trotz des hohen Alters, die Motorkohlen noch nicht verschlissen waren. Eine der Motorkohlen hatte sich allerdings in ihrer Führung verhakt. Woraufhin diese keinen richtigen Kontakt mehr gab. Wir setzten die Führung wieder instand und der Motor funktionierte wieder.','googletrans' => 'The engine did not turn anymore. We realized that despite the old age, the motor coals were not worn. However, one of the motor coals had hooked in their lead. Whereupon this no longer contacted. We reset the lead again and the engine worked again.','language' => 'de','fault_type_id' => '0','en' => 'the motor no longer turned. We noticed that, despite their great age, the motor brushes were not yet worn out. However, one of the motor brushes had become stuck in its guide. As a result, it no longer made proper contact. We repaired the guide and the motor worked again.','de' => 'der Motor drehte nicht mehr. Wir stellten fest, dass trotz des hohen Alters, die Motorkohlen noch nicht verschlissen waren. Eine der Motorkohlen hatte sich allerdings in ihrer Führung verhakt. Woraufhin diese keinen richtigen Kontakt mehr gab. Wir setzten die Führung wieder instand und der Motor funktionierte wieder.','nl' => 'draaide de motor niet meer. Het viel ons op dat ondanks de ouderdom, de motorborstels nog niet versleten waren. Een van de motorborstels was echter vast komen te zitten in zijn geleider. Daardoor maakte hij niet langer goed contact. We repareerden de geleider en de motor werkte weer.','fr' => 'le moteur ne tournait plus. Nous avons constaté que malgré son âge avancé, les charbons du moteur n\'étaient pas encore usés. L\'un des charbons s\'était toutefois coincé dans son guide. Celui-ci n\'a donc plus donné de contact correct. Nous avons remis le guide en état et le moteur a fonctionné à nouveau.','it' => 'il motore non girava più. Abbiamo notato che nonostante la vecchiaia, le spazzole del motore non erano ancora consumate. Tuttavia, una delle spazzole del motore era rimasta bloccata nella sua guida. Di conseguenza, non faceva più un contatto corretto. Abbiamo riparato la guida e il motore ha funzionato di nuovo.','es' => 'el motor ya no giraba. Nos dimos cuenta de que, a pesar de la edad, las escobillas del motor aún no estaban desgastadas. Sin embargo, una de las escobillas del motor se había atascado en su guía. Como resultado, ya no hacía un contacto adecuado. Reparamos la guía y el motor volvió a funcionar.'),
