  array('id_ords' => 'anstiftung_427','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Unknown','event_date' => '2018-11-17','problem' => 'Bürste ist deffekt','googletrans' => 'Brush is the effect','language' => 'de','fault_type_id' => '0','en' => 'Brush is deffect','de' => 'Bürste ist deffekt','nl' => 'Borstel is niet effectief','fr' => 'La brosse est inefficace','it' => 'La spazzola è inefficace','es' => 'El cepillo es ineficaz'),
  array('id_ords' => 'anstiftung_4271','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Omega','year_of_manufacture' => '1989','product_age' => '','repair_status' => 'Repairable','event_date' => '2019-11-28','problem' => 'Der Motor lief nicht mehr rund und sorgte so für laute Geräusche und Vibrationen. Trotz Reinigung bestand das Problem danach aber weiter. Wir sahen uns den Motor noch einmal genauer an und vermuten einen Lagerschaden. Reparieren konnten wir das nicht. Sofern der Besitzer keinen neuen Motor auftreiben kann, ist das Gerät wohl ein Fall für den Schrott.','googletrans' => 'The engine no longer ran around and thus caused loud noises and vibrations. Despite cleaning, the problem continued thereafter. We looked at the engine more closely and suspect a shelf. We could not repair that. If the owner can not build a new engine, the device is probably a case for the scrap.','language' => 'de','fault_type_id' => '0','en' => 'The engine no longer ran smoothly, causing loud noises and vibrations. Despite cleaning, the problem persisted afterwards. We took another closer look at the engine and suspected bearing damage. We could not repair it. Unless the owner can find a new motor, the device is probably a case for scrap.','de' => 'Der Motor lief nicht mehr rund und sorgte so für laute Geräusche und Vibrationen. Trotz Reinigung bestand das Problem danach aber weiter. Wir sahen uns den Motor noch einmal genauer an und vermuten einen Lagerschaden. Reparieren konnten wir das nicht. Sofern der Besitzer keinen neuen Motor auftreiben kann, ist das Gerät wohl ein Fall für den Schrott.','nl' => 'De motor liep niet meer soepel en veroorzaakte harde geluiden en trillingen. Ondanks het schoonmaken, bleef het probleem daarna bestaan. We hebben de motor nader bekeken en vermoedden schade aan de lagers. We konden het niet repareren. Tenzij de eigenaar een nieuwe motor kan vinden, is de eenheid waarschijnlijk een zaak voor de sloop.','fr' => 'Le moteur ne tournait plus rond, ce qui provoquait de forts bruits et des vibrations. Malgré le nettoyage, le problème a persisté. Nous avons examiné le moteur de plus près et avons supposé que les roulements étaient endommagés. Nous ne pouvions pas le réparer. A moins que le propriétaire ne puisse trouver un nouveau moteur, l\'appareil est probablement bon pour la casse.','it' => 'Il motore non funzionava più bene, causando forti rumori e vibrazioni. Nonostante la pulizia, il problema persisteva anche dopo. Abbiamo dato un\'occhiata più da vicino al motore e abbiamo sospettato un danno ai cuscinetti. Non potevamo ripararlo. A meno che il proprietario non riesca a trovare un nuovo motore, l\'unità è probabilmente un caso da rottamare.','es' => 'El motor dejó de funcionar con suavidad, provocando fuertes ruidos y vibraciones. A pesar de la limpieza, el problema persistía después. Miramos de cerca el motor y sospechamos que los rodamientos están dañados. No pudimos repararlo. A menos que el propietario pueda encontrar un nuevo motor, la unidad es probablemente un caso para la chatarra.'),
  array('id_ords' => 'anstiftung_4276','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'AEG','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2019-11-23','problem' => 'Bei diesem sollte angeblich die Nasssaugung nicht funktionieren und dieser kein Wasser mehr ziehen. Scheinbar hatte aber bereits der Transport zu uns für eine \'Selbstheilung\' ausgereicht, denn der Sauger ging beim Test vor Ort tadellos. Vermutlich hat hier bloß ein Schalter gehangen.','googletrans' => 'In this, the wet suction should not work and do not pull this water anymore. Apparently, however, the transport had already been enough for a \'self-healing\', because the sucker went perfectly at the test on site. Probably here was just a switch.','language' => 'de','fault_type_id' => '0','en' => 'The wet suction should allegedly not work and it should no longer draw water. Apparently, the transport to us was enough for a \'self-healing\', because the vacuum cleaner worked flawlessly during the on-site test. Presumably, there was just a switch hanging here.','de' => 'Bei diesem sollte angeblich die Nasssaugung nicht funktionieren und dieser kein Wasser mehr ziehen. Scheinbar hatte aber bereits der Transport zu uns für eine \'Selbstheilung\' ausgereicht, denn der Sauger ging beim Test vor Ort tadellos. Vermutlich hat hier bloß ein Schalter gehangen.','nl' => 'Er werd gezegd dat de natte afzuiging niet werkte en dat hij geen water meer opnam. Blijkbaar was het vervoer naar ons echter voldoende voor een "zelfgenezing", want de stofzuiger werkte perfect toen hij ter plaatse werd getest. Het was waarschijnlijk gewoon een schakelaar die vast zat.','fr' => 'Sur celui-ci, l\'aspiration humide ne devait pas fonctionner et il ne tirait plus l\'eau. Apparemment, le transport jusqu\'à nous avait déjà suffi pour une \'auto-réparation\', car l\'aspirateur fonctionnait parfaitement lors du test sur place. Il s\'agissait probablement d\'un simple interrupteur.','it' => 'Si diceva che l\'aspirazione a umido non funzionava e che non tirava più acqua. A quanto pare, però, il trasporto fino a noi è stato sufficiente per un \'auto-guarigione\', perché l\'aspirapolvere ha funzionato perfettamente quando è stato testato sul posto. Probabilmente era solo un interruttore che era bloccato.','es' => 'Se dijo que la aspiración húmeda no funcionaba y que ya no sacaba agua. Sin embargo, parece que el transporte hasta nosotros fue suficiente para una "autocuración", porque la aspiradora funcionó perfectamente cuando se probó in situ. Probablemente era un interruptor que estaba atascado.'),
