  array('id_ords' => 'anstiftung_4320','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Miele','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2019-12-05','problem' => 'Ein Vater kam mit seinem Sohn und einem Miele Bodenstaubsauger mit kaputter Kabelaufwicklung ins RepairCafé. Der Blockiermechanismus greife nicht mehr, sodass der Sauger das Netzkabel ständig einzieht, erzählte er uns. Leider konnten wir uns aufgrund des großen Andrangs heute aber nicht mehr darum kümmern. Nach einigem Warten entschied er sich dann doch dafür, zu einem anderen Termin mit dem Staubsauger wiederzukommen.','googletrans' => 'A father came with his son and a Miele floor vacuum with broken cable rewind to the repair café. The blocking mechanism no longer reach so that the sucker continuously feeds the power cord, he told us. Unfortunately, we could not take care of ourselves today because of the great crowd today. After some wait, he decided to come back to another appointment with the vacuum cleaner.','language' => 'de','fault_type_id' => '0','en' => 'A father came to the RepairCafé with his son and a Miele vacuum cleaner with a broken cord rewind. He told us that the blocking mechanism no longer works, so that the vacuum cleaner constantly pulls in the power cord. Unfortunately, however, we couldn\'t take care of it today due to the large crowd. After waiting for a while, he decided to come back with the vacuum cleaner at another time.','de' => 'Ein Vater kam mit seinem Sohn und einem Miele Bodenstaubsauger mit kaputter Kabelaufwicklung ins RepairCafé. Der Blockiermechanismus greife nicht mehr, sodass der Sauger das Netzkabel ständig einzieht, erzählte er uns. Leider konnten wir uns aufgrund des großen Andrangs heute aber nicht mehr darum kümmern. Nach einigem Warten entschied er sich dann doch dafür, zu einem anderen Termin mit dem Staubsauger wiederzukommen.','nl' => 'Een vader kwam naar het RepairCafé met zijn zoon en een Miele stofzuiger met een gebroken snoeroproller. Het blokkeringsmechanisme werkt niet meer, zodat de stofzuiger voortdurend aan het netsnoer trekt, zo vertelde hij ons. Helaas konden we het vandaag niet afhandelen vanwege de grote drukte. Na een tijdje wachten, besloot hij op een ander tijdstip terug te komen met de stofzuiger.','fr' => 'Un père est venu au RepairCafé avec son fils et un aspirateur Miele dont l\'enrouleur de câble était cassé. Il nous a expliqué que le mécanisme de blocage ne fonctionnait plus et que l\'aspirateur rétractait constamment le câble d\'alimentation. Malheureusement, en raison de l\'affluence, nous n\'avons pas pu nous en occuper aujourd\'hui. Après avoir attendu quelques minutes, il a décidé de revenir avec l\'aspirateur à un autre moment.','it' => 'Un padre è venuto al RepairCafé con suo figlio e un aspirapolvere Miele con un cavo di avvolgimento rotto. Il meccanismo di blocco non funziona più, per cui l\'aspirapolvere tira costantemente il cavo di alimentazione, ci ha detto. Sfortunatamente, non abbiamo potuto occuparcene oggi a causa della grande fretta. Dopo aver aspettato un po\', ha deciso di tornare con l\'aspirapolvere in un altro momento.','es' => 'Un padre vino al RepairCafé con su hijo y una aspiradora Miele con el cable de rebobinado roto. Nos dijo que el mecanismo de bloqueo ya no funcionaba, por lo que la aspiradora tiraba constantemente del cable de alimentación. Desgraciadamente, hoy no hemos podido ocuparnos de ello debido a las grandes prisas. Después de esperar un rato, decidió volver con la aspiradora en otro momento.'),
