  array('id_ords' => 'anstiftung_4586','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'dyson','year_of_manufacture' => '2017','product_age' => '','repair_status' => 'Repairable','event_date' => '2020-01-16','problem' => 'Der Akkustaubsauger gab keinerlei Lebenszeichen mehr von sich. Zuerst lag die Vermutung nahe, dass Motor oder komplexe Bauteile defekt wären. Wir überprüften jedoch Akkus und Ladegerät. Dabei stellten sich beide Energiespeicher als „völlig hinüber“ heraus. Sie nahmen weder Strom an, noch gaben sie ihn ab. Der Besucher wird einen neuen Akku erwerben.','googletrans' => 'The acoustic vacuum cleaner gave no longer signs of life. First, the assumption was suggested that engine or complex components would be defective. However, we checked batteries and charger. Both energy stores turned out as "completely over". They did not accept electricity, nor were they released. The visitor will purchase a new battery.','language' => 'de','fault_type_id' => '0','en' => 'The cordless vacuum cleaner no longer showed any signs of life. At first, we suspected that the motor or complex components were defective. However, we checked the batteries and charger. Both energy accumulators turned out to be "completely over". They neither accepted nor emitted power. The visitor will purchase a new battery.','de' => 'Der Akkustaubsauger gab keinerlei Lebenszeichen mehr von sich. Zuerst lag die Vermutung nahe, dass Motor oder komplexe Bauteile defekt wären. Wir überprüften jedoch Akkus und Ladegerät. Dabei stellten sich beide Energiespeicher als „völlig hinüber“ heraus. Sie nahmen weder Strom an, noch gaben sie ihn ab. Der Besucher wird einen neuen Akku erwerben.','nl' => 'De batterijzuiger vertoonde geen teken van leven meer. In eerste instantie vermoedden we dat de motor of complexe onderdelen defect waren. Maar we hebben de batterijen en de lader gecontroleerd. Beide energie-opslagunits bleken "volledig defect" te zijn. Ze aanvaarden geen stroom en zenden die ook niet uit. De bezoeker zal een nieuwe batterij kopen.','fr' => 'L\'aspirateur à batterie ne donnait plus aucun signe de vie. Nous avons d\'abord pensé que le moteur ou des composants complexes étaient défectueux. Nous avons toutefois vérifié les batteries et le chargeur. Les deux accumulateurs d\'énergie se sont révélés "complètement foutus". Ils n\'acceptaient ni ne fournissaient de courant. Le visiteur fera l\'acquisition d\'une nouvelle batterie.','it' => 'L\'aspirapolvere a batteria non mostrava più alcun segno di vita. All\'inizio, abbiamo sospettato che il motore o i componenti complessi fossero difettosi. Tuttavia, abbiamo controllato le batterie e il caricatore. Entrambe le unità di stoccaggio dell\'energia si sono rivelate "completamente difettose". Non accettavano né emettevano energia. Il visitatore acquisterà una nuova batteria.','es' => 'El aspirador de baterías ya no daba señales de vida. Al principio, sospechamos que el motor o los componentes complejos estaban defectuosos. Sin embargo, comprobamos las baterías y el cargador. Ambas unidades de almacenamiento de energía resultaron ser "completamente defectuosas". No aceptaban ni emitían energía. El visitante comprará una batería nueva.'),
  array('id_ords' => 'anstiftung_4587','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Vorwerk','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2020-01-16','problem' => 'Der Staubsauger funktionierte lange Zeit nur sporadisch und zuletzt überhaupt nicht mehr. Glücklicherweise konnte hier schnell das defekte Zuleitungskabel ermittelt werden. Es hat an der Anschlussseite einen Kabelbruch. Der Besucher wird sich beim Hersteller ein neues Kabel für etwa 13 € erwerben.','googletrans' => 'The vacuum cleaner worked for a long time only sporadic and at last no more. Fortunately, the defective supply cable could be determined quickly here. It has a cable break at the connection side. The visitor will acquire a new cable for about 13 € at the manufacturer.','language' => 'de','fault_type_id' => '0','en' => 'The vacuum cleaner worked only sporadically for a long time, and finally not at all. Fortunately, the defective supply cable was quickly identified. It has a cable break on the connection side. The visitor will purchase a new cable from the manufacturer for about 13 €.','de' => 'Der Staubsauger funktionierte lange Zeit nur sporadisch und zuletzt überhaupt nicht mehr. Glücklicherweise konnte hier schnell das defekte Zuleitungskabel ermittelt werden. Es hat an der Anschlussseite einen Kabelbruch. Der Besucher wird sich beim Hersteller ein neues Kabel für etwa 13 € erwerben.','nl' => 'De stofzuiger werkte lange tijd slechts sporadisch en uiteindelijk helemaal niet meer. Gelukkig werd de defecte voedingskabel snel gevonden. Het heeft een gebroken kabel aan de verbindingskant. De bezoeker zal een nieuwe kabel kopen bij de fabrikant voor ongeveer 13 €.','fr' => 'Pendant longtemps, l\'aspirateur n\'a fonctionné que sporadiquement, puis plus du tout. Heureusement, le câble d\'alimentation défectueux a pu être rapidement identifié. Il présente une rupture de câble du côté du raccordement. Le visiteur se procurera un nouveau câble auprès du fabricant pour environ 13 €.','it' => 'L\'aspirapolvere ha funzionato solo sporadicamente per molto tempo e alla fine per niente. Fortunatamente, il cavo di alimentazione difettoso è stato rapidamente identificato. Ha un cavo rotto sul lato della connessione. Il visitatore acquisterà un nuovo cavo dal produttore per circa 13 €.','es' => 'La aspiradora funcionó sólo esporádicamente durante mucho tiempo y finalmente no funcionó en absoluto. Afortunadamente, se identificó rápidamente el cable de alimentación defectuoso. Tiene un cable roto en el lado de la conexión. El visitante comprará un cable nuevo al fabricante por unos 13 euros.'),
