  array('id_ords' => 'anstiftung_5010','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'AEG','year_of_manufacture' => '2018','product_age' => '','repair_status' => 'Repairable','event_date' => '2020-01-02','problem' => 'In dem Handstaubsauger war das Lüfterrad im Inneren zerbrochen. Mit der Bitte um Hilfe beim Ersatz des Teils kam er nun ins RepairCafé. Wir zerlegten den Sauger gemeinsam und entfernten die Bruchstücke des Kunststoffteils, das wohl nicht so einfach als Ersatz zu bekommen ist. Der Gast probiert es daher direkt beim Hersteller, vielleicht hat er ja Glück.','googletrans' => 'In the handstable vacuum cleaner, the fan wheel was broken inside. With the request for help with the replacement of the part he came to the repair café. We pollined the sucker together and removed the fragments of the plastic part, which is probably not so easy to get as a substitute. The guest therefore tries it directly from the manufacturer, maybe he\'s lucky.','language' => 'de','fault_type_id' => '0','en' => 'In the hand vacuum cleaner, the fan wheel inside was broken. With the request for help in replacing the part, he now came to the RepairCafé. We disassembled the vacuum cleaner together and removed the broken pieces of the plastic part, which is probably not so easy to get as a replacement. The guest is therefore trying it directly with the manufacturer, maybe he will have luck.','de' => 'In dem Handstaubsauger war das Lüfterrad im Inneren zerbrochen. Mit der Bitte um Hilfe beim Ersatz des Teils kam er nun ins RepairCafé. Wir zerlegten den Sauger gemeinsam und entfernten die Bruchstücke des Kunststoffteils, das wohl nicht so einfach als Ersatz zu bekommen ist. Der Gast probiert es daher direkt beim Hersteller, vielleicht hat er ja Glück.','nl' => 'Het wiel van de ventilator in de handstofzuiger was kapot. Hij kwam naar het RepairCafé en vroeg om hulp bij het vervangen van het onderdeel. Wij hebben de stofzuiger samen gedemonteerd en de gebroken stukken van het plastic onderdeel verwijderd, dat waarschijnlijk niet zo gemakkelijk te krijgen is als vervanging. De gast zal het dus rechtstreeks met de fabrikant proberen, misschien heeft hij geluk.','fr' => 'Le ventilateur de l\'aspirateur à main s\'était cassé à l\'intérieur. Il est venu au RepairCafé en demandant de l\'aide pour remplacer cette pièce. Nous avons démonté ensemble l\'aspirateur et retiré les morceaux de la pièce en plastique, qui n\'est pas facile à remplacer. L\'invité essaie donc de se rendre directement chez le fabricant, peut-être aura-t-il de la chance.','it' => 'La ruota della ventola all\'interno dell\'aspirapolvere manuale era rotta. È venuto al RepairCafé chiedendo aiuto per sostituire il pezzo. Abbiamo smontato l\'aspirapolvere insieme e rimosso i pezzi rotti della parte in plastica, che probabilmente non è così facile da ottenere come ricambio. L\'ospite proverà quindi direttamente con il produttore, forse avrà fortuna.','es' => 'La rueda del ventilador dentro de la aspiradora de mano estaba rota. Vino al RepairCafé pidiendo ayuda para sustituir la pieza. Desmontamos juntos el aspirador y retiramos los trozos rotos de la pieza de plástico, que probablemente no sea tan fácil de conseguir como repuesto. Por lo tanto, el invitado lo intentará directamente con el fabricante, tal vez tenga suerte.'),
