  array('id_ords' => 'anstiftung_5277','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Vorwerk','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-03-03','problem' => 'Laufzettel 115. Bürstenlager locker. Abgenutzte Räder ausgetauscht (Kunststoff gegen Holz).','googletrans' => 'Pulp 115. Brush bearing loosely. Worn wheels exchanged (plastic against wood).','language' => 'de','fault_type_id' => '0','en' => 'Slip 115. brush bearings loose. Worn wheels replaced (plastic for wood).','de' => 'Laufzettel 115. Bürstenlager locker. Abgenutzte Räder ausgetauscht (Kunststoff gegen Holz).','nl' => 'Slip 115. Borstellagers los. Versleten wielen vervangen (kunststof voor hout).','fr' => 'Fiche de marche 115. Palier de brosse desserré. Roues usées remplacées (plastique contre bois).','it' => 'Slittamento 115. Cuscinetti a spazzola allentati. Ruote usurate sostituite (plastica per legno).','es' => 'Deslizamiento 115. Cojinetes del cepillo sueltos. Sustitución de las ruedas desgastadas (plástico por madera).'),
  array('id_ords' => 'anstiftung_5283','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Siemens','year_of_manufacture' => '2007','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-03-12','problem' => 'Er funktionierte nicht mehr. Vorher hatte es in dem Gerät „gefatscht“ und dann ging nichts mehr. Wir schraubten ihn auf und sahen uns den Netzstecker, das Kabel und den Aufwickler an. Dort fanden wir auch einen Kabelbruch, den wir durch Neuanschließen wieder behoben.','googletrans' => 'He did not work anymore. Before, it had "gossy" in the device and then nothing left. We screwed it up and looked at the mains plug, the cable and the rewinder. There we also found a cable break, which we resolved by reintroducing.','language' => 'de','fault_type_id' => '0','en' => 'It no longer worked. Previously, there had been "flapping" in the device and then nothing worked. We unscrewed it and looked at the power plug, the cable and the rewinder. There we also found a broken cable, which we fixed by reconnecting it.','de' => 'Er funktionierte nicht mehr. Vorher hatte es in dem Gerät „gefatscht“ und dann ging nichts mehr. Wir schraubten ihn auf und sahen uns den Netzstecker, das Kabel und den Aufwickler an. Dort fanden wir auch einen Kabelbruch, den wir durch Neuanschließen wieder behoben.','nl' => 'Het werkte niet meer. Voordien was er een "geratel" in de machine en daarna werkte niets meer. We schroefden hem los en keken naar de stekker, het snoer en de oproller. Daar vonden we ook een gebroken kabel, die we hebben gerepareerd door hem opnieuw aan te sluiten.','fr' => 'Il ne fonctionnait plus. Auparavant, il y avait eu un "cliquetis" dans l\'appareil, puis plus rien ne fonctionnait. Nous l\'avons dévissé et avons examiné la fiche d\'alimentation, le câble et l\'enrouleur. Nous y avons également trouvé une rupture de câble, que nous avons réparée en la rebranchant.','it' => 'Non funzionava più. Prima, c\'era stato un \'rantolo\' nella macchina e poi non funzionava nulla. L\'abbiamo svitato e abbiamo guardato la spina di rete, il cavo e l\'avvolgitore. Lì abbiamo anche trovato un cavo rotto, che abbiamo riparato ricollegandolo.','es' => 'Ya no funcionaba. Antes, había un "traqueteo" en la máquina y luego no funcionaba nada. Lo desenroscamos y miramos el enchufe, el cable y el rebobinador. Allí también encontramos un cable roto, que arreglamos volviendo a conectarlo.'),
  array('id_ords' => 'anstiftung_5295','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Progress','year_of_manufacture' => '1990','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-03-12','problem' => 'Er funktionierte zwar noch einwandfrei, aber das Netzkabel war aus dem Stecker herausgezogen worden und man konnte die einzelnen Drähte sehen. Wir schnitten den alten Stecker ab und brachten einen neuen Konturenstecker an.','googletrans' => 'He worked flawlessly, but the power cord had been pulled out of the plug and you could see the individual wires. We cut off the old plug and attached a new contour plug.','language' => 'de','fault_type_id' => '0','en' => 'It still worked fine, but the power cord had been pulled out of the plug and you could see the individual wires. We cut off the old plug and attached a new contour plug.','de' => 'Er funktionierte zwar noch einwandfrei, aber das Netzkabel war aus dem Stecker herausgezogen worden und man konnte die einzelnen Drähte sehen. Wir schnitten den alten Stecker ab und brachten einen neuen Konturenstecker an.','nl' => 'Hij werkte nog prima, maar het netsnoer was uit de stekker getrokken en je kon de afzonderlijke draden zien. We sneden de oude plug eraf en bevestigden een nieuwe contour plug.','fr' => 'Il fonctionnait encore parfaitement, mais le câble d\'alimentation avait été retiré de la fiche et on pouvait voir les différents fils. Nous avons coupé l\'ancienne fiche et installé une nouvelle fiche à contours.','it' => 'Funzionava ancora bene, ma il cavo di alimentazione era stato estratto dalla spina e si potevano vedere i singoli fili. Abbiamo tagliato la vecchia spina e attaccato una nuova spina di contorno.','es' => 'Todavía funcionaba bien, pero el cable de alimentación se había sacado del enchufe y se podían ver los cables individuales. Cortamos el viejo tapón y colocamos un nuevo tapón de co