  array('id_ords' => 'anstiftung_5399','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'AEG','year_of_manufacture' => '2015','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-06-18','problem' => 'Netzstecker war verkohlt und wurde von jemanden durch einen Schukostecker ersetzt. Dieser wurde allerdings falsch angeschlossen (Pol und Schutzleiter).Gegen Konturenstecker getauscht und richtig angeschlossen.','googletrans' => 'Power plug was charred and was replaced by someone by a Schuko plug. However, this was incorrectly connected (pol and protective conductors). Required against contour plugs and connected correctly.','language' => 'de','fault_type_id' => '0','en' => 'Mains plug was charred and was replaced by someone with a Schuko plug. However, this was connected incorrectly (pole and protective conductor).exchanged for contour plug and connected correctly.','de' => 'Netzstecker war verkohlt und wurde von jemanden durch einen Schukostecker ersetzt. Dieser wurde allerdings falsch angeschlossen (Pol und Schutzleiter).Gegen Konturenstecker getauscht und richtig angeschlossen.','nl' => 'De netstekker was verkoold en werd vervangen door iemand met een Schuko stekker. Deze was echter verkeerd aangesloten (pool en randaarde).omgeruild voor een contourstekker en correct aangesloten.','fr' => 'La fiche d\'alimentation était carbonisée et a été remplacée par une fiche de sécurité. Celle-ci a toutefois été mal raccordée (pôle et conducteur de protection). Remplacée par une fiche à contours et correctement raccordée.','it' => 'La spina di rete era carbonizzata ed è stata sostituita da qualcuno con una spina Schuko. Tuttavia, questa spina è stata collegata in modo errato (polo e conduttore di protezione), sostituita con una spina di contorno e collegata correttamente.','es' => 'El enchufe de la red eléctrica estaba carbonizado y fue sustituido por un enchufe Schuko. Sin embargo, éste estaba conectado incorrectamente (polo y tierra de protección).Se cambió por un enchufe de contorno y se conectó correctamente.'),
  array('id_ords' => 'anstiftung_5421','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Siemens','year_of_manufacture' => '2012','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-07-02','problem' => 'Reagiert nicht mehr. Kabelbruch am angegossenen Stecker.Gegen Konturenstecker ausgewechselt','googletrans' => 'Do not react anymore. Cable break on the cast plug. Required against contour plug','language' => 'de','fault_type_id' => '0','en' => 'No longer responds. Cable breakage at the molded connector.replaced with contour connector.','de' => 'Reagiert nicht mehr. Kabelbruch am angegossenen Stecker.Gegen Konturenstecker ausgewechselt','nl' => 'Reageert niet meer. Kabelbreuk bij de gegoten stekker. Vervangen door contourstekker.','fr' => 'Ne réagit plus. Rupture de câble au niveau de la fiche moulée, remplacée par une fiche à contours.','it' => 'Non risponde più. Rottura del cavo sulla spina stampata. Sostituita con una spina sagomata.','es' => 'Ya no responde. Rotura del cable en el enchufe moldeado. Sustituido por un enchufe de contorno.'),
  array('id_ords' => 'anstiftung_5441','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Bosch','year_of_manufacture' => '2016','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-07-09','problem' => 'dieses Exemplar funktionierte nur hin und wieder. Wir zerlegten das Gerät und suchten nach Kontaktunsicherheiten. Wir fanden eine Kontaktunterbrechung am Griff vor und reparierten sie durch das Nachbiegen und Nachlöten der Kontakte. Dann funktionierte die Verbindung zum Schalter wieder zuverlässig.','googletrans' => 'This copy worked only now and then. We disappeared the device and searched for contact uncertainties. We found a contact interruption on the handle and repaired them by re-bending and toilting the contacts. Then the connection to the switch worked reliably again.','language' => 'de','fault_type_id' => '0','en' => 'this specimen only worked every now and then. We disassembled the unit and searched for contact inconsistencies. We found a contact break on the handle and repaired it by re-bending and re-soldering the contacts. Then the connection to the switch worked reliably again.','de' => 'dieses Exemplar funktionierte nur hin und wieder. Wir zerlegten das Gerät und suchten nach Kontaktunsicherheiten. Wir fanden eine Kontaktunterbrechung am Griff vor und reparierten sie durch das Nachbiegen und Nachlöten der Kontakte. Dann funktionierte die Verbindung zum Schalter wieder zuverlässig.','nl' => 'dit exemplaar werkte alleen zo nu en dan. We hebben het toestel gedemonteerd en gezocht naar onvolkomenheden in het contact. We vonden een contactbreuk op het handvat en repareerden die door de contacten opnieuw te buigen en te solderen. Daarna werkte de verbinding met de schakelaar weer betrouwbaar.','fr' => 'cet exemplaire ne fonctionnait que de temps en temps. Nous avons démonté l\'appareil et recherché des incertitudes de contact. Nous avons trouvé une interruption de contact au niveau de la poignée et l\'avons réparée en repliant et en ressoudant les contacts. Ensuite, la connexion avec l\'interrupteur a de nouveau fonctionné de manière fiable.','it' => 'questo esemplare funzionava solo di tanto in tanto. Abbiamo smontato l\'unità e cercato le imperfezioni di contatto. Abbiamo trovato una rottura di contatto sulla maniglia e l\'abbiamo riparata piegando e risaldando i contatti. Poi la connessione all\'interruttore ha funzionato di nuovo in modo affidabile.','es' => 'este espécimen sólo funcionaba de vez en cuando. Desmontamos la unidad y buscamos las imperfecciones de los contactos. Encontramos una rotura de contacto en el mango y la reparamos doblando y soldando de nuevo los contactos. Entonces la conexión con el interruptor volvió a funcionar de forma fiable.'),
