  array('id_ords' => 'anstiftung_5511','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'AEG','year_of_manufacture' => '2015','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-08-13','problem' => 'Er funktionierte gar nicht mehr. Vor einiger Zeit versagte schon der Aufrollmechanismus und nun hatte das Kabel vor den Rausziehversuchen des Besitzers endgültig kapituliert, man konnte die Anschlussdrähte aus dem Gerät schauen sehen. Wir zerlegten den Staubsauger. Zum Glück war das Kabel nicht vom Wickler abgerissen, sondern eine Steckverbindung hatte sich gelöst. Wir machten den Wickler mit Silikonspray wieder leichtgängig, steckten das Kabel an und fixierten es gut. Der Staubsauger funktioniert wieder gut und zieht auch zuverlässig sein Kabel ein.','googletrans' => 'He did not work anymore. Some time ago, the retrieval mechanism failed and now the cable had finally surrendered in front of the removal attempts of the owner, they could see the connection wires from the device. We dismissed the vacuum cleaner. Luckily, the cable was not demolished by the winder, but a connector had been solved. We made the winder with silicone spray smoothly, plugged on the cable and fixed it well. The vacuum cleaner works well again and also reliably pulls its cable.','language' => 'de','fault_type_id' => '0','en' => 'It no longer worked at all. Some time ago, the rewind mechanism failed and now the cable had finally capitulated to the owner\'s attempts to pull it out; you could see the connecting wires peeking out of the device. We disassembled the vacuum cleaner. Fortunately, the cable had not torn off the winder, but a connector had come loose. We made the winder smooth again with silicone spray, plugged in the cable and fixed it well. The vacuum cleaner works well again and also reliably pulls in its cable.','de' => 'Er funktionierte gar nicht mehr. Vor einiger Zeit versagte schon der Aufrollmechanismus und nun hatte das Kabel vor den Rausziehversuchen des Besitzers endgültig kapituliert, man konnte die Anschlussdrähte aus dem Gerät schauen sehen. Wir zerlegten den Staubsauger. Zum Glück war das Kabel nicht vom Wickler abgerissen, sondern eine Steckverbindung hatte sich gelöst. Wir machten den Wickler mit Silikonspray wieder leichtgängig, steckten das Kabel an und fixierten es gut. Der Staubsauger funktioniert wieder gut und zieht auch zuverlässig sein Kabel ein.','nl' => 'Het werkte helemaal niet meer. Enige tijd geleden had het oprolmechanisme het al begeven en nu was de kabel eindelijk bezweken aan de pogingen van de eigenaar om hem eruit te trekken; je kon de verbindingsdraden uit het toestel zien piepen. We hebben de stofzuiger uit elkaar gehaald. Gelukkig was de kabel niet van de spoel gescheurd, maar was een stekkerverbinding losgeraakt. We maakten de spoel weer glad met siliconenspray, plugden de kabel in en repareerden hem goed. De stofzuiger werkt weer goed en trekt ook betrouwbaar zijn snoer aan.','fr' => 'Il ne fonctionnait plus du tout. Il y a quelque temps, le mécanisme d\'enroulement était déjà tombé en panne et maintenant le câble avait définitivement capitulé devant les tentatives d\'arrachage du propriétaire, on pouvait voir les fils de raccordement sortir de l\'appareil. Nous avons démonté l\'aspirateur. Heureusement, le câble n\'avait pas été arraché de l\'enrouleur, mais un connecteur s\'était détaché. Nous avons remis l\'enrouleur en place à l\'aide d\'un spray au silicone, puis nous avons rebranché le câble et l\'avons bien fixé. L\'aspirateur fonctionne à nouveau correctement et tire son câble de manière fiable.','it' => 'Non ha più funzionato affatto. Qualche tempo fa, il meccanismo di riavvolgimento si era già guastato e ora il cavo aveva finalmente capitolato ai tentativi del proprietario di tirarlo fuori; si potevano vedere i fili di collegamento che sbucavano dall\'unità. Abbiamo smontato l\'aspirapolvere. Fortunatamente, il cavo non era stato strappato dall\'avvolgitore, ma una connessione della spina si era allentata. Abbiamo reso di nuovo liscio l\'avvolgitore con spray al silicone, abbiamo collegato il cavo e l\'abbiamo fissato bene. L\'aspirapolvere funziona di nuovo bene e tira anche il suo cavo in modo affidabile.','es' => 'Ya no funcionaba en absoluto. Hacía tiempo que el mecanismo de rebobinado ya había fallado y ahora el cable había capitulado finalmente ante los intentos del propietario de sacarlo; se podían ver los cables de conexión asomando por la unidad. Desmontamos la aspiradora. Afortunadamente, el cable no se había arrancado de la bobina, sino que se había soltado una conexión de enchufe. Volvimos a alisar el enrollador con spray de silicona, conectamos el cable y lo arreglamos bien. La aspiradora vuelve a funcionar bien y también tira del cable de forma fiable.'),
