  array('id_ords' => 'anstiftung_5651','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-09-01','problem' => 'Laufzettel 190: Kabeleinzug, Kabel liegen am Ende frei. Kabel neu fachgerecht angeschlosen. VDI-Prüfung ok.','googletrans' => 'Leads 190: Cable Clock, Cables are released at the end. Cable newly closed. VDI exam OK.','language' => 'de','fault_type_id' => '0','en' => 'Docket no. 190: Cable pull-in, cable exposed at the end. Cable professionally reconnected. VDI test ok.','de' => 'Laufzettel 190: Kabeleinzug, Kabel liegen am Ende frei. Kabel neu fachgerecht angeschlosen. VDI-Prüfung ok.','nl' => 'Docket nr. 190: kabel in te trekken, kabel blootgesteld aan het einde. Kabels vakkundig opnieuw aangesloten. VDI test ok.','fr' => 'Feuille de route 190 : Tirage de câble, les câbles sont libres à l\'extrémité. Câble rebranché dans les règles de l\'art. Contrôle VDI ok.','it' => 'Docket n. 190: ingresso del cavo, cavo esposto all\'estremità. Cavi ricollegati professionalmente. Test VDI ok.','es' => 'Expediente nº 190: Tirón de cable, cable expuesto en el extremo. Cables reconectados profesionalmente. La prueba VDI está bien.'),
  array('id_ords' => 'anstiftung_5656','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Bosch','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-09-22','problem' => 'Der Akkusauger „Bosch HighPower VCAS010V25“ lief nur noch auf Stufe 1. Die nächsten Stufen ließen sich nicht einschalten. Zusammen mit dem Besitzer haben wir das Gerät geöffnet und die Ursache gesucht. Ein Plastikteil der Griffhalterung war abgebrochen und hatte sich im Schiebeschalter verklemmt. Das Teil wurde entfernt und der Gast konnte mit dem reparierten Gerät nach Hause gehen.','googletrans' => 'The battery vacuum "Bosch Highpower VCAS010V25" ran only on stage 1. The next steps did not turn on. Together with the owner we opened the device and the cause was sought. A plastic part of the handle bracket was canceled and had jammed in the slide switch. The part was removed and the guest could go home with the repaired device.','language' => 'de','fault_type_id' => '0','en' => 'The cordless vacuum cleaner "Bosch HighPower VCAS010V25" was only running on level 1. The next levels could not be switched on. Together with the owner, we opened the device and searched for the cause. A plastic part of the handle holder had broken off and got stuck in the slide switch. The part was removed and the guest could go home with the repaired unit.','de' => 'Der Akkusauger „Bosch HighPower VCAS010V25“ lief nur noch auf Stufe 1. Die nächsten Stufen ließen sich nicht einschalten. Zusammen mit dem Besitzer haben wir das Gerät geöffnet und die Ursache gesucht. Ein Plastikteil der Griffhalterung war abgebrochen und hatte sich im Schiebeschalter verklemmt. Das Teil wurde entfernt und der Gast konnte mit dem reparierten Gerät nach Hause gehen.','nl' => 'De "Bosch HighPower VCAS010V25" snoerloze stofzuiger werkte alleen op niveau 1. De volgende niveaus konden niet worden ingeschakeld. Samen met de eigenaar openden we het toestel en zochten naar de oorzaak. Een plastic deel van de handgreephouder was afgebroken en zat vast in de schuifschakelaar. Het onderdeel werd verwijderd en de gast kon naar huis met het gerepareerde toestel.','fr' => 'L\'aspirateur sans fil "Bosch HighPower VCAS010V25" ne fonctionnait plus qu\'au niveau 1. Les niveaux suivants ne pouvaient pas être enclenchés. Avec le propriétaire, nous avons ouvert l\'appareil et cherché la cause. Une pièce en plastique du support de la poignée s\'était cassée et s\'était coincée dans l\'interrupteur à glissière. La pièce a été retirée et le client a pu rentrer chez lui avec l\'appareil réparé.','it' => 'L\'aspirapolvere a batteria "Bosch HighPower VCAS010V25" funzionava solo sul livello 1. I livelli successivi non potevano essere attivati. Insieme al proprietario, abbiamo aperto l\'apparecchio e cercato la causa. Una parte di plastica del supporto della maniglia si era rotta ed era rimasta bloccata nell\'interruttore a scorrimento. Il pezzo è stato rimosso e l\'ospite è potuto tornare a casa con l\'unità riparata.','es' => 'La aspiradora sin cable "Bosch HighPower VCAS010V25" sólo funcionaba en el nivel 1. Los siguientes niveles no se podían encender. Junto con el propietario, abrimos el aparato y buscamos la causa. Una parte de plástico del soporte de la manilla se había roto y se había atascado en el interruptor deslizante. La pieza fue retirada y el huésped pudo volver a casa con la unidad reparada.'),
  array('id_ords' => 'anstiftung_5677','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'AEG','year_of_manufacture' => '2010','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-10-08','problem' => 'Nach den Angaben des Gasts sollte er sich nur noch schlecht bis gar nicht mehr einschalten lassen. Wir konnten das beim ersten Test nicht nachvollziehen. Trotzdem öffneten wir das Gerät und untersuchten den Schalter. Der war i. O. Auch die Kondensatoren im Netzteil der Steuerplatine nahmen wir unter die Lupe, aber alles OK. Wir gehen davon aus, dass der Schalte sich mechanisch verklemmt hatte und zeigten dem Gast, wie er das in Zukunft verhindern kann.','googletrans' => 'According to the information provided by the guest, he should only be able to turn on even badly. We could not understand that at the first test. Nevertheless, we opened the device and examined the switch. That was i. O. The capacitors in the power supply of the control board we took under the magnifying glass, but everything ok. We assume that the turning mechanically jammed and showed the guest how he can prevent that in the future.','language' => 'de','fault_type_id' => '0','en' => 'According to the guest\'s information, it should only turn on poorly or not at all. We could not verify this during the first test. Nevertheless, we opened the device and examined the switch. It was OK. We also examined the capacitors in the power supply of the control board, but everything was OK. We assume that the switch had jammed mechanically and showed the guest how to prevent this in the future.','de' => 'Nach den Angaben des Gasts sollte er sich nur noch schlecht bis gar nicht mehr einschalten lassen. Wir konnten das beim ersten Test nicht nachvollziehen. Trotzdem öffneten wir das Gerät und untersuchten den Schalter. Der war i. O. Auch die Kondensatoren im Netzteil der Steuerplatine nahmen wir unter die Lupe, aber alles OK. Wir gehen davon aus, dass der Schalte sich mechanisch verklemmt hatte und zeigten dem Gast, wie er das in Zukunft verhindern kann.','nl' => 'Volgens de gast, moet het moeilijk of onmogelijk zijn om in te schakelen. Wij konden dit tijdens de eerste test niet verifiëren. Toch openden we het toestel en onderzochten de schakelaar. Het was oké. We hebben ook de condensatoren in de voedingseenheid van de besturingsprintplaat onderzocht, maar alles was in orde. Wij nemen aan dat de schakelaar mechanisch was vastgelopen en hebben de gast laten zien hoe hij dit in de toekomst kan voorkomen.','fr' => 'D\'après les indications du client, il devrait être difficile, voire impossible, de l\'allumer. Nous n\'avons pas pu le vérifier lors du premier test. Nous avons néanmoins ouvert l\'appareil et examiné l\'interrupteur. Il était en bon état. Nous avons également examiné les condensateurs du bloc d\'alimentation de la carte de commande, mais tout était OK. Nous avons supposé que l\'interrupteur s\'était coincé mécaniquement et avons montré à l\'invité comment il pouvait éviter cela à l\'avenir.','it' => 'Secondo l\'ospite, dovrebbe essere difficile o impossibile da accendere. Non abbiamo potuto verificarlo durante il primo test. Tuttavia, abbiamo aperto l\'unità ed esaminato l\'interruttore. Era ok. Abbiamo anche esaminato i condensatori nell\'unità di alimentazione della scheda di controllo, ma tutto era OK. Supponiamo che l\'interruttore si sia bloccato meccanicamente e abbiamo mostrato all\'ospite come prevenirlo in futuro.','es' => 'Según el huésped, debería ser difícil o imposible de encender. No pudimos comprobarlo durante la primera prueba. No obstante, abrimos la unidad y examinamos el interruptor. Estaba bien. También examinamos los condensadores de la fuente de alimentación de la placa de control, pero todo estaba bien. Suponemos que el interruptor se había atascado mecánicamente y mostramos al huésped cómo evitarlo en el futuro.'),
