  array('id_ords' => 'anstiftung_5708','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Omega','year_of_manufacture' => '2011','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-10-22','problem' => 'Keine Funktion.Kabelbruch am Stecker, Kabel auch beschädigt.Besitzer versorgt neues27.10.: Fortsetzung  - eigentlich sollte das komplette Kabel gewechselt werden. Der Besitzer hat aber ein 3-poliges Anschlußkabel gekauft. Also haben wir an das Kabel einem neuen Konturenstecker angeschlossen. Weiterhin haben wir mit dem Gast die Leitung auch noch im Gerät neu angeschlossen.','googletrans' => 'No function . Cable breaking on the plug, cable also damaged. Owner supplies newness. 10.: Continued - Actually, the complete cable should be changed. However, the owner has bought a 3-pole connection cable. So we connected to the cable a new contour plug. Furthermore, we have also re-connected with the guest the line in the device.','language' => 'de','fault_type_id' => '0','en' => 'No function.cable break at the connector, cable also damaged.owner supplies new27.10.: Continuation - actually the complete cable should be replaced. But the owner bought a 3-pole connection cable. So we have connected to the cable a new contour plug. Further we connected the cable with the guest also still in the device new.','de' => 'Keine Funktion.Kabelbruch am Stecker, Kabel auch beschädigt.Besitzer versorgt neues27.10.: Fortsetzung  - eigentlich sollte das komplette Kabel gewechselt werden. Der Besitzer hat aber ein 3-poliges Anschlußkabel gekauft. Also haben wir an das Kabel einem neuen Konturenstecker angeschlossen. Weiterhin haben wir mit dem Gast die Leitung auch noch im Gerät neu angeschlossen.','nl' => 'Geen functie.kabelbreuk bij de connector, kabel ook beschadigd.eigenaar levert nieuwe27.10.: Vervolg - eigenlijk moet de complete kabel worden vervangen. Maar de eigenaar kocht een 3-polige verbindingskabel. Dus hebben we een nieuwe contourstekker op de kabel aangesloten. We hebben ook de kabel in de unit opnieuw aangesloten samen met de gast.','fr' => 'Pas de fonction.rupture de câble au niveau du connecteur, câble également endommagé.le propriétaire fournit un nouveau27.10. : suite - en fait, le câble complet devait être changé. Mais le propriétaire a acheté un câble de raccordement à 3 pôles. Nous avons donc branché un nouveau connecteur de contour sur le câble. Nous avons également rebranché le câble dans l\'appareil avec le client.','it' => 'Nessuna funzione.rottura del cavo al connettore, cavo anche danneggiato.proprietario fornisce nuovo27.10.: Continuazione - in realtà il cavo completo dovrebbe essere cambiato. Ma il proprietario ha comprato un cavo di collegamento a 3 poli. Così abbiamo collegato una nuova spina di contorno al cavo. Abbiamo anche ricollegato il cavo nell\'unità insieme all\'ospite.','es' => 'No funciona.Rotura del cable en el conector, el cable también está dañado.El propietario suministra nuevo27.10.: Continuación - en realidad se debe cambiar el cable completo. Pero el propietario compró un cable de conexión de 3 polos. Así que conectamos un nuevo enchufe de contorno al cable. También reconectamos el cable en la unidad junto con el huésped.'),
