  array('id_ords' => 'anstiftung_6404','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'BOB-Home','year_of_manufacture' => '2009','product_age' => '','repair_status' => 'Repairable','event_date' => '2021-07-08','problem' => 'Er machte sehr laute Geräusche und roch verbrannt. Wir fanden einen sehr stark mit Kohlenabrieb verschmierten Kommutator. Die Kohlen machten im Betrieb ein starkes Bürstenfeuer und die Geräusche.','googletrans' => 'He made very loud noises and smelled. We found a very strongly smeared commutator. The coals made a strong brush fire and the sounds during operation.','language' => 'de','fault_type_id' => '0','en' => 'It made very loud noises and smelled burnt. We found a commutator very heavily smeared with coal abrasion. The coals made a strong brush fire and the noises during operation.','de' => 'Er machte sehr laute Geräusche und roch verbrannt. Wir fanden einen sehr stark mit Kohlenabrieb verschmierten Kommutator. Die Kohlen machten im Betrieb ein starkes Bürstenfeuer und die Geräusche.','nl' => 'Het maakte erg harde geluiden en rook verbrand. We vonden een commutator die zwaar besmeurd was met kolenslijpsel. De kolen zorgden voor een sterk kreupelhoutvuur en de geluiden tijdens de werking.','fr' => 'Il faisait un bruit très fort et sentait le brûlé. Nous avons trouvé un commutateur très fortement encrassé par des résidus de charbon. En fonctionnement, les charbons faisaient un feu de brosses très important et ces bruits.','it' => 'Faceva dei rumori molto forti e puzzava di bruciato. Abbiamo trovato un commutatore molto pesantemente imbrattato dall\'abrasione del carbone. I carboni hanno fatto un forte fuoco di spazzola e i rumori durante il funzionamento.','es' => 'Hacía ruidos muy fuertes y olía a quemado. Encontramos un conmutador muy manchado por la abrasión del carbón. Los carbones hacían un fuerte fuego de matorral y los ruidos duran