  array('id_ords' => 'anstiftung_6423','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'AEG','year_of_manufacture' => '2006','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-06-17','problem' => 'saugte nicht mehr, Kabelbruch am Netzkabel. Der Besitzer hat ein neues Kabel montiert. In diesem Zuge wurde im Netzteil ein hoch belasteter Kondensator getauscht, der nur noch die halbe Kapazität hatte.','googletrans' => 'No longer sucked, cable break on the power cord. The owner has mounted a new cable. In this course, a highly loaded capacitor has been exchanged in the power supply, which only had half the capacity.','language' => 'de','fault_type_id' => '0','en' => 'no longer sucked, cable break on the power cord. The owner mounted a new cable. In the course of this, a highly loaded capacitor was replaced in the power supply, which had only half the capacity.','de' => 'saugte nicht mehr, Kabelbruch am Netzkabel. Der Besitzer hat ein neues Kabel montiert. In diesem Zuge wurde im Netzteil ein hoch belasteter Kondensator getauscht, der nur noch die halbe Kapazität hatte.','nl' => 'niet meer gezogen, kabelbreuk op het netsnoer. De eigenaar heeft een nieuwe kabel gemonteerd. Daarbij werd een zwaar belaste condensator in de voedingseenheid vervangen, die nog maar de helft van zijn capaciteit had.','fr' => 'n\'aspirait plus, rupture du câble d\'alimentation. Le propriétaire a monté un nouveau câble. Dans la foulée, un condensateur très sollicité a été remplacé dans le bloc d\'alimentation, qui n\'avait plus que la moitié de sa capacité.','it' => 'non succhiava più, rottura del cavo di rete. Il proprietario ha montato un nuovo cavo. Nel corso di questo, un condensatore molto carico è stato sostituito nell\'unità di alimentazione, che aveva solo la metà della sua capacità.','es' => 'ya no se chupan, rotura del cable de la red. El propietario instaló un cab