  array('id_ords' => 'anstiftung_6702','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Miele','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-03-07','problem' => 'geht nicht --&gt; stark verschmutzt, Motor läuft --&gt; sauber gemacht','googletrans' => 'Does not - & gt; Strongly dirty, engine runs - & gt; cleaned','language' => 'de','fault_type_id' => '0','en' => 'does not go --&gt; heavily soiled, engine runs --&gt; made clean','de' => 'geht nicht --&gt; stark verschmutzt, Motor läuft --&gt; sauber gemacht','nl' => 'gaat niet --&gt; zwaar vervuild, motor loopt --&gt; opgeruimd','fr' => 'ne fonctionne pas --&gt ; fortement encrassé, le moteur tourne --&gt ; nettoyé','it' => 'non va --&gt; molto sporco, il motore funziona --&gt; pulito','es' => 'no va --&gt; muy sucio, el motor funciona --&gt; limpiado'),
  array('id_ords' => 'anstiftung_6768','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Miele','year_of_manufacture' => '2018','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-09-02','problem' => 'Gerät hatte eine große Menge Wasser eingezogen und ging nicht mehr. Motor zerlegt. Kohlebürsten steckten in den korrodierten Führungen fest und waren weggebrannt.- Kommutator gereinigt- Führungen gangbar gemacht- Kohlen wieder eingeschliffen','googletrans' => 'Device had moved into a large amount of water and did not go anymore. Motor disassembled. Carbon brushes stuck in the corroded guided tours and were burned away.- Commutator purified guides Gearbox-coalupled coales','language' => 'de','fault_type_id' => '0','en' => 'Unit had drawn in a large amount of water and stopped working. Motor disassembled. Carbon brushes were stuck in the corroded guides and had burned away- Commutator cleaned- Guides made passable- Carbon brushes ground back in.','de' => 'Gerät hatte eine große Menge Wasser eingezogen und ging nicht mehr. Motor zerlegt. Kohlebürsten steckten in den korrodierten Führungen fest und waren weggebrannt.- Kommutator gereinigt- Führungen gangbar gemacht- Kohlen wieder eingeschliffen','nl' => 'De unit had een grote hoeveelheid water opgezogen en werkte niet meer. Motor gedemonteerd. Koolborstels zaten vast in de gecorrodeerde geleiders en waren weggebrand - commutator schoongemaakt - geleiders begaanbaar gemaakt - koolborstels opnieuw geslepen.','fr' => 'L\'appareil avait absorbé une grande quantité d\'eau et ne fonctionnait plus. Le moteur a été démonté. Les balais de charbon étaient coincés dans les guides corrodés et avaient été brûlés.','it' => 'L\'unità aveva aspirato una grande quantità d\'acqua e non funzionava più. Motore smontato. Le spazzole di carbonio erano bloccate nelle guide corrose e si erano bruciate - commutatore pulito - guide rese praticabili - spazzole di carbonio riaffilate.','es' => 'La unidad había absorbido una gran cantidad de agua y ya no funcionaba. Motor desmontado. Las escobillas de carbón estaban atascadas en las guías corroídas y se habían quemado - se limpió el colector - se hicieron pasables las guías - se rectificaron las escobillas de carbón.'),
  array('id_ords' => 'anstiftung_6772','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Elektro Sonstiges ~ Saugroboter','product_category' => 'Vacuum','brand' => 'Zaco','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-09-02','problem' => 'Er lief immer kurz an und blieb dann stehen. Wir schauten uns das genauer Gerät an und sahen, dass es innen sehr verstaubt war. Auch die Sensoren, die dem Roboter mitteilen, dass er sich auf ein Hindernis zubewegt, war sehr schmutzig. Dadurch übermittelten sie falsche Angaben und der Roboter blieb immer gleich wieder stehen, weil er ein Hindernis „sah“. Wir reinigten das Gerät und die Sensoren , danach funktionierte er wieder.Auslöser war hier fehlende Wartung durch die Besitzerin.','googletrans' => 'He always started and then stopped. We looked at the exact device and saw that it was very dusty inside. Also, the sensors that tell the robot that it moves to an obstacle was very dirty. As a result, they transmitted false information and the robot always stopped right away because he "saw" an obstacle. We cleaned the device and the sensors, then he worked again. Trigger was missing maintenance here by the owner.','language' => 'de','fault_type_id' => '0','en' => 'It always started up briefly and then stopped. We looked at the exact device and saw that it was very dusty inside. The sensors that tell the robot that it is moving towards an obstacle were also very dirty. As a result, they transmitted incorrect information and the robot always stopped right away because it "saw" an obstacle. We cleaned the device and the sensors , then he worked again.trigger here was lack of maintenance by the owner.','de' => 'Er lief immer kurz an und blieb dann stehen. Wir schauten uns das genauer Gerät an und sahen, dass es innen sehr verstaubt war. Auch die Sensoren, die dem Roboter mitteilen, dass er sich auf ein Hindernis zubewegt, war sehr schmutzig. Dadurch übermittelten sie falsche Angaben und der Roboter blieb immer gleich wieder stehen, weil er ein Hindernis „sah“. Wir reinigten das Gerät und die Sensoren , danach funktionierte er wieder.Auslöser war hier fehlende Wartung durch die Besitzerin.','nl' => 'Hij startte altijd even en stopte dan. We bekeken het apparaat precies en zagen dat het van binnen erg stoffig was. De sensoren die de robot vertellen dat hij naar een obstakel toe beweegt, waren ook erg vuil. Het resultaat was dat ze verkeerde informatie doorgaven en dat de robot altijd meteen stopte omdat hij een obstakel "zag". We hebben het apparaat en de sensoren schoongemaakt, waarna het weer werkte, wegens gebrek aan onderhoud door de eigenaar.','fr' => 'Il démarrait brièvement et s\'arrêtait ensuite. Nous avons regardé l\'appareil de plus près et avons vu qu\'il était très poussiéreux à l\'intérieur. Les capteurs qui indiquent au robot qu\'il se dirige vers un obstacle étaient également très sales. Ils transmettaient donc des informations erronées et le robot s\'arrêtait toujours immédiatement parce qu\'il "voyait" un obstacle. Nous avons nettoyé l\'appareil et les capteurs, puis il a recommencé à fonctionner.','it' => 'Si avviava sempre brevemente e poi si fermava. Abbiamo guardato il dispositivo esatto e abbiamo visto che era molto polveroso all\'interno. Anche i sensori che dicono al robot che si sta muovendo verso un ostacolo erano molto sporchi. Di conseguenza, trasmettevano informazioni sbagliate e il robot si fermava sempre subito perché "vedeva" un ostacolo. Abbiamo pulito il dispositivo e i sensori, dopo di che ha funzionato di nuovo, a causa della mancanza di manutenzione da parte del proprietario.','es' => 'Siempre arrancaba brevemente y luego se detenía. Miramos exactamente el aparato y vimos que estaba muy polvoriento por dentro. Los sensores que indican al robot que se acerca a un obstáculo también estaban muy sucios. Como resultado, transmitían información errónea y el robot siempre se detenía de inmediato porque "veía" un obstáculo. Limpiamos el aparato y los sensores, tras lo cual volvió a funcionar, debido a la falta de mantenimiento del propietario.'),
  array('id_ords' => 'anstiftung_6791','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'AEG','year_of_manufacture' => '2013','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-09-09','problem' => 'Die Akkus ließen trotz voller Ladung sehr schnell nach. Der Besitzer hatte schon Ersatzakkus besorgt und so konnten wir sie gleich gemeinsam auswechseln.','googletrans' => 'The batteries read very quickly despite the full charge. The owner had already worried substitute batteries and so we could replace them together.','language' => 'de','fault_type_id' => '0','en' => 'The batteries wore out very quickly despite being fully charged. The owner had already procured replacement batteries and so we were able to replace them together right away.','de' => 'Die Akkus ließen trotz voller Ladung sehr schnell nach. Der Besitzer hatte schon Ersatzakkus besorgt und so konnten wir sie gleich gemeinsam auswechseln.','nl' => 'Hoewel ze volledig waren opgeladen, raakten de batterijen zeer snel leeg. De eigenaar had al vervangende batterijen gekocht en dus konden we ze meteen samen vervangen.','fr' => 'Malgré une charge complète, les batteries s\'épuisaient très rapidement. Le propriétaire avait déjà acheté des batteries de rechange et nous avons donc pu les changer ensemble tout de suite.','it' => 'Nonostante fossero completamente cariche, le batterie si stavano consumando molto rapidamente. Il proprietario aveva già comprato delle batterie di ricambio e così siamo stati in grado di sostituirle insieme subito.','es' => 'A pesar de estar completamente cargadas, las baterías se gastaban muy rápidamente. El propietario ya había comprado baterías de repuesto, por lo que pudimos reemplazarlas juntos de inmediato.'),
