  array('id_ords' => 'anstiftung_7177','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Miele','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2021-10-23','problem' => 'Ein/Aus-Schalter defekt','googletrans' => 'ON / OFF switch defective','language' => 'de','fault_type_id' => '0','en' => 'On/Off switch defective','de' => 'Ein/Aus-Schalter defekt','nl' => 'Aan/uit schakelaar defect','fr' => 'Interrupteur marche/arrêt défectueux','it' => 'Interruttore on/off difettoso','es' => 'Interruptor de encendido/apagado defectuoso'),
  array('id_ords' => 'anstiftung_7192','data_provider' => 'anstiftung','country' => 'DEU','partner_product_category' => 'Haushaltsgeräte ~ Staubsauger','product_category' => 'Vacuum','brand' => 'Miele','year_of_manufacture' => '2017','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-10-07','problem' => 'Die Kohlen des Motors hatten Wasser abbekommen und rutschten in den Führungen nicht mehr nach. Nach Abschleifen der Kohlebürsten lagen sie wieder gut an und der Motor lief wieder. Eine aufwendige Reparatur, die fast 3 Stunden dauerte, aber es hat sich gelohnt!','googletrans' => 'The coals of the engine had to get water and did not slip in the guided tours. After sanding the carbon brushes, they lay well again and the engine ran again. An elaborate repair that took almost 3 hours, but it was worth it!','language' => 'de','fault_type_id' => '0','en' => 'The carbon brushes of the motor had gotten water and no longer slid in the guides. After grinding off the carbon brushes, they were in good contact again and the engine ran again. A complex repair that took almost 3 hours, but it was worth it!','de' => 'Die Kohlen des Motors hatten Wasser abbekommen und rutschten in den Führungen nicht mehr nach. Nach Abschleifen der Kohlebürsten lagen sie wieder gut an und der Motor lief wieder. Eine aufwendige Reparatur, die fast 3 Stunden dauerte, aber es hat sich gelohnt!','nl' => 'De koolborstels van de motor waren blootgesteld aan water en gleden niet meer in de geleiders. Na het slijpen van de koolborstels maakten ze weer goed contact en liep de motor weer. Een complexe reparatie die bijna 3 uur duurde, maar het was het waard!','fr' => 'Les charbons du moteur avaient pris l\'eau et ne glissaient plus dans les guides. Après avoir poncé les balais de charbon, ils étaient à nouveau bien en place et le moteur tournait à nouveau. Une réparation laborieuse qui a duré près de 3 heures, mais qui en valait la peine !','it' => 'Le spazzole di carbonio del motore erano st