  array('id_ords' => 'fixitclinic_682','data_provider' => 'Fixit Clinic','country' => 'USA','partner_product_category' => 'upright vacuum','product_category' => 'Vacuum','brand' => 'Hoover','year_of_manufacture' => '','product_age' => '','repair_status' => 'Unknown','event_date' => '2018-01-14','problem' => 'upright vacuum ~ On the way to the clinic I stopped at the Vacuum Cleaner shop to buy a belt, which had been suggested by a couple of people as the probable problem.  Turns out the store would install the belt for me, so I left it there for them to do it.  I would not have known they could instantly diagnose the problem and take care of it if I hadn\'t gone there on the way to the clinic. . When you buy a product try and make sure it is made to allow future repairs and not made to be disposable. ','googletrans' => 'upright vacuum ~ On the way to the clinic I stopped at the Vacuum Cleaner shop to buy a belt, which had been suggested by a couple of people as the probable problem.  Turns out the store would install the belt for me, so I left it there for them to do it.  I would not have known they could instantly diagnose the problem and take care of it if I hadn\'t gone there on the way to the clinic. . When you buy a product try and make sure it is made to allow future repairs and not made to be disposable. ','language' => 'en','fault_type_id' => '0','en' => 'upright vacuum ~ On the way to the clinic I stopped at the Vacuum Cleaner shop to buy a belt, which had been suggested by a couple of people as the probable problem.  Turns out the store would install the belt for me, so I left it there for them to do it.  I would not have known they could instantly diagnose the problem and take care of it if I hadn\'t gone there on the way to the clinic. . When you buy a product try and make sure it is made to allow future repairs and not made to be disposable. ','de' => 'Staubsauger ~ Auf dem Weg zur Klinik hielt ich am Staubsaugergeschäft an, um einen Riemen zu kaufen, der von einigen Leuten als wahrscheinliches Problem vorgeschlagen worden war.  Es stellte sich heraus, dass der Laden den Riemen für mich einbauen würde, also ließ ich ihn dort, damit sie es tun konnten.  Ich hätte nicht gewusst, dass sie das Problem sofort diagnostizieren und beheben können, wenn ich auf dem Weg zur Klinik nicht dorthin gegangen wäre. . Wenn Sie ein Produkt kaufen, sollten Sie darauf achten, dass es für künftige Reparaturen geeignet ist und nicht zum Wegwerfen gedacht ist.','nl' => 'stofzuiger ~ Op weg naar de kliniek stopte ik bij de stofzuigerwinkel om een riem te kopen, die door een paar mensen was voorgesteld als het waarschijnlijke probleem.  Het bleek dat de winkel de riem voor mij zou installeren, dus liet ik hem daar achter zodat zij het konden doen.  Ik zou niet geweten hebben dat zij het probleem onmiddellijk konden diagnosticeren en oplossen als ik daar niet was geweest op weg naar de kliniek. . Wanneer u een product koopt, probeer er dan zeker van te zijn dat het gemaakt is om toekomstige reparaties mogelijk te maken en niet gemaakt is om wegwerp te zijn.','fr' => 'aspirateur vertical ~ Sur le chemin de la clinique, je me suis arrêté au magasin d\'aspirateurs pour acheter une courroie, qui avait été suggérée par quelques personnes comme étant le problème probable.  Il s\'est avéré que le magasin installerait la courroie pour moi, alors je l\'ai laissé là pour qu\'ils le fassent.  Je n\'aurais pas su qu\'ils pouvaient instantanément diagnostiquer le problème et s\'en occuper si je n\'y étais pas allé en allant à la clinique. . Lorsque vous achetez un produit, essayez de vous assurer qu\'il est conçu pour permettre des réparations futures et non pour être jetable.','it' => 'aspirapolvere ~ Sulla strada per la clinica mi sono fermato al negozio di aspirapolvere per comprare una cinghia, che era stata suggerita da un paio di persone come probabile problema.  Si è scoperto che il negozio avrebbe installato la cinghia per me, così l\'ho lasciato lì perché lo facessero loro.  Non avrei saputo che potevano diagnosticare immediatamente il problema e occuparsene se non fossi andato lì mentre andavo alla clinica. . Quando comprate un prodotto cercate di assicurarvi che sia fatto per permettere riparazioni future e non fatto per essere usa e getta.','es' => 'Aspiradora vertical ~ De camino a la clínica me detuve en la tienda de aspiradoras para comprar una correa, que había sido sugerida por un par de personas como el probable problema.  Resulta que la tienda me instalaría la correa, así que la dejé allí para que lo hicieran.  No habría sabido que podían diagnosticar el problema al instante y encargarse de él si no hubiera ido allí de camino a la clínica. . Cuando compres un producto intenta asegurarte de que está hecho para permitir futuras reparaciones y no para ser desechable.'),
