  array('id_ords' => 'rcint_26025','data_provider' => 'Repair Café International','country' => 'FRA','partner_product_category' => 'Tools electric ~ Vacuum cleaner','product_category' => 'Vacuum','brand' => 'Einhell','year_of_manufacture' => '2019','product_age' => '','repair_status' => 'Repairable','event_date' => '2019-11-30','problem' => 'Après démontage de l\'appareil pour changer le sens de rotation de la turbine, un bruit et un perte de puissance important apparaisent sur l\'appareil. Une poussière grise est également présente à l\'intérieur de la zone moteur. L\'écrou qui tient la turbine n\'a pas été remis, ce qui explique la perte de vitesse et le bruit. Remettre l\'écrou. ','googletrans' => 'After disassembly of the appliance to change the direction of rotation of the turbine, a noise and a loss of important power appear on the device. Gray dust is also present inside the engine area. The nut that holds the turbine has not been delivered, which explains the loss of speed and noise. Replace the nut.','language' => 'fr','fault_type_id' => '0','en' => 'After disassembling the device to change the direction of rotation of the turbine, a noise and a significant loss of power appear on the device. A grey dust is also present inside the motor area. The nut that holds the turbine has not been replaced, which explains the loss of speed and noise. Replace the nut.','de' => 'Nachdem das Gerät auseinandergenommen wurde, um die Drehrichtung der Turbine zu ändern, treten am Gerät Geräusche und ein starker Leistungsverlust auf. Im Inneren des Motorbereichs ist außerdem grauer Staub vorhanden. Die Mutter, die die Turbine hält, wurde nicht wieder angebracht, was den Geschwindigkeitsverlust und das Geräusch erklärt. Setzen Sie die Mutter wieder ein.','nl' => 'Na demontage van de eenheid om de draairichting van de turbine te veranderen, verschijnt er een aanzienlijk lawaai en verlies van vermogen op de eenheid. Een grijze stof is ook aanwezig in de motorruimte. De moer die de turbine vasthoudt is niet vervangen, wat het verlies van snelheid en het lawaai verklaart. Plaats de moer terug.','fr' => 'Après démontage de l\'appareil pour changer le sens de rotation de la turbine, un bruit et un perte de puissance important apparaisent sur l\'appareil. Une poussière grise est également présente à l\'intérieur de la zone moteur. L\'écrou qui tient la turbine n\'a pas été remis, ce qui explique la perte de vitesse et le bruit. Remettre l\'écrou. ','it' => 'Dopo aver smontato l\'unità per cambiare il senso di rotazione della turbina, sull\'unità appare un rumore significativo e una perdita di potenza. Una polvere grigia è presente anche all\'interno della zona del motore. Il dado che tiene la turbina non è stato sostituito, il che spiega la perdita di velocità e il rumore. Sostituire il dado.','es' => 'Tras desmontar la unidad para cambiar el sentido de giro de la turbina, aparece un ruido importante y una pérdida de potencia en la unidad. También hay un polvo gris dentro de la zona del motor. La tuerca que sujeta la turbina no ha sido sustituida, lo que explica la pérdida de velocidad y el ruido. Vuelva a colocar la tuerca.'),
