  array('id_ords' => 'rcint_32214','data_provider' => 'Repair Café International','country' => 'CAN','partner_product_category' => 'Household appliances electric ~ Vacuum cleaner','product_category' => 'Vacuum','brand' => 'Sanyo','year_of_manufacture' => '2005','product_age' => '','repair_status' => 'Fixed','event_date' => '2020-09-27','problem' => '"wasn\'t sucking" ~ turned out to be that the sweeper shaft wasn\'t turning - suction didn\'t seem to be a problem. the belt that drove the sweeper shaft had slipped off of the motor shaft. Disassembled, attempted to diagnose lack of suction. Realized suction wasn\'t an issue and continued to reassemble, and return the drive belt back onto the motor shaft. Also cleaned out a large buildup of hair in the end portion of the sweeper shaft. Worked once reassembled!. ','googletrans' => '"wasn\'t sucking" ~ turned out to be that the sweeper shaft wasn\'t turning - suction didn\'t seem to be a problem. the belt that drove the sweeper shaft had slipped off of the motor shaft. Disassembled, attempted to diagnose lack of suction. Realized suction wasn\'t an issue and continued to reassemble, and return the drive belt back onto the motor shaft. Also cleaned out a large buildup of hair in the end portion of the sweeper shaft. Worked once reassembled!. ','language' => 'en','fault_type_id' => '0','en' => '"wasn\'t sucking" ~ turned out to be that the sweeper shaft wasn\'t turning - suction didn\'t seem to be a problem. the belt that drove the sweeper shaft had slipped off of the motor shaft. Disassembled, attempted to diagnose lack of suction. Realized suction wasn\'t an issue and continued to reassemble, and return the drive belt back onto the motor shaft. Also cleaned out a large buildup of hair in the end portion of the sweeper shaft. Worked once reassembled!. ','de' => '"saugte nicht" ~ Es stellte sich heraus, dass sich die Kehrmaschinenwelle nicht drehte - die Absaugung schien kein Problem zu sein. Der Riemen, der die Kehrmaschinenwelle antrieb, war von der Motorwelle abgerutscht. Demontiert und versucht, die fehlende Saugkraft zu diagnostizieren. Ich erkannte, dass die Absaugung kein Problem darstellte, und fuhr fort, die Maschine wieder zusammenzubauen und den Antriebsriemen wieder auf die Motorwelle zu legen. Außerdem habe ich eine große Ansammlung von Haaren im Endteil der Kehrmaschinenwelle entfernt. Nach dem Wiederzusammenbau funktionierte es!','nl' => '"zoog niet" ~ bleek dat de as van de veegmachine niet draaide - aanzuigen leek geen probleem te zijn. de riem die de as aandreef was van de motoras gegleden. Gedemonteerd, geprobeerd het gebrek aan zuigkracht vast te stellen. Realiseerde me dat de zuigkracht geen probleem was en ging verder met het opnieuw monteren en het terugplaatsen van de aandrijfriem op de motoras. Ook een grote haarophoping in het eindgedeelte van de veegas verwijderd. Het werkte weer toen het weer in elkaar zat!','fr' => '"La courroie qui entraînait l\'arbre de la balayeuse avait glissé de l\'arbre du moteur. J\'ai démonté l\'appareil et tenté de diagnostiquer le manque d\'aspiration. J\'ai réalisé que l\'aspiration n\'était pas un problème et j\'ai continué à remonter et à remettre la courroie d\'entraînement sur l\'arbre du moteur. J\'ai également nettoyé une grande accumulation de cheveux dans la partie terminale de l\'arbre de la balayeuse. Le tout a fonctionné une fois réassemblé.','it' => '"non succhiava" ~ è risultato che l\'albero della spazzatrice non girava - l\'aspirazione non sembrava essere un problema. la cinghia che guidava l\'albero della spazzatrice era scivolata via dall\'albero del motore. Smontato, ho cercato di diagnosticare la mancanza di aspirazione. Realizzato l\'aspirazione non era un problema e ha continuato a rimontare, e riportare la cinghia di trasmissione sull\'albero motore. Ho anche pulito un grande accumulo di capelli nella parte finale dell\'albero della spazzatrice. Ha funzionato una volta riassemblato.','es' => '"no aspiraba" ~ resultó ser que el eje de la barredora no giraba - la succión no parecía ser un problema. la correa que impulsaba el eje de la barredora se había salido del eje del motor. Desmontado, intenté diagnosticar la falta de succión. Me di cuenta de que la succión no era un problema y seguí montando y volviendo a colocar la correa de transmisión en el eje del motor. También limpié una gran acumulación de pelo en la parte final del eje de la barredora. Funcionó una vez que se volvió a montar!.'),
