  array('id_ords' => 'rcint_32714','data_provider' => 'Repair Café International','country' => 'CAN','partner_product_category' => 'Household appliances electric ~ Vacuum cleaner','product_category' => 'Vacuum','brand' => 'Hoover','year_of_manufacture' => '1960','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-06-05','problem' => 'When I took it apart to reattach the stand (2 screws in the bottom half of the canister), and put it back together, it didn\'t work. Some electrical disconnect. Appeared to be loose connections to main power switch. wiggled switch wires to make better contact. ','googletrans' => 'When I took it apart to reattach the stand (2 screws in the bottom half of the canister), and put it back together, it didn\'t work. Some electrical disconnect. Appeared to be loose connections to main power switch. wiggled switch wires to make better contact. ','language' => 'en','fault_type_id' => '0','en' => 'When I took it apart to reattach the stand (2 screws in the bottom half of the canister), and put it back together, it didn\'t work. Some electrical disconnect. Appeared to be loose connections to main power switch. wiggled switch wires to make better contact. ','de' => 'Als ich ihn auseinandergenommen habe, um den Ständer wieder anzubringen (2 Schrauben in der unteren Hälfte des Behälters), und ihn wieder zusammengesetzt habe, hat er nicht funktioniert. Irgendeine elektrische Unterbrechung. Schien ein Wackelkontakt am Hauptschalter zu sein. Ich habe an den Drähten des Schalters gewackelt, um einen besseren Kontakt herzustellen.','nl' => 'Toen ik hem uit elkaar haalde om de standaard weer vast te maken (2 schroeven in de onderste helft van de bus), en hem weer in elkaar zette, deed hij het niet. Een of andere elektrische storing. Het leek erop dat de verbindingen met de hoofdschakelaar los zaten. Ik heb aan de schakeldraden gewrongen om beter contact te maken.','fr' => 'Lorsque je l\'ai démonté pour rattacher le support (2 vis dans la moitié inférieure de la boîte), et que je l\'ai remonté, il n\'a pas fonctionné. Une certaine déconnexion électrique. Il semble que les connexions à l\'interrupteur principal soient lâches. J\'ai remué les fils de l\'interrupteur pour établir un meilleur contact.','it' => 'Quando l\'ho smontato per riattaccare il supporto (2 viti nella metà inferiore del contenitore), e l\'ho rimontato, non ha funzionato. Qualche disconnessione elettrica. Sembrava che le connessioni all\'interruttore principale fossero allentate. Ho mosso i fili dell\'interruttore per fare un contatto migliore.','es' => 'Cuando lo desmonté para volver a colocar el soporte (2 tornillos en la mitad inferior del bote), y lo volví a montar, no funcionó. Alguna desconexión eléctrica. Parecía que había conexiones sueltas en el interruptor principal.'),
  array('id_ords' => 'rcint_32729','data_provider' => 'Repair Café International','country' => 'CAN','partner_product_category' => 'Household appliances electric ~ Vacuum cleaner','product_category' => 'Vacuum','brand' => 'Kenmore','year_of_manufacture' => '2012','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-05-08','problem' => 'Doesn\'t suck and makes strangled noise instead. Massive clog in main air way. Advise them to go ahead and follow the on-line directions on clearing a clog.  Previously, she was hesitant because it involved taking the device apart.  I told her she had nothing to lose and go for it. ','googletrans' => 'Doesn\'t suck and makes strangled noise instead. Massive clog in main air way. Advise them to go ahead and follow the on-line directions on clearing a clog.  Previously, she was hesitant because it involved taking the device apart.  I told her she had nothing to lose and go for it. ','language' => 'en','fault_type_id' => '0','en' => 'Doesn\'t suck and makes strangled noise instead. Massive clog in main air way. Advise them to go ahead and follow the on-line directions on clearing a clog.  Previously, she was hesitant because it involved taking the device apart.  I told her she had nothing to lose and go for it. ','de' => 'Saugt nicht und macht stattdessen ein ersticktes Geräusch. Massive Verstopfung im Hauptluftweg. Raten Sie ihnen, die Online-Anleitung zur Beseitigung einer Verstopfung zu befolgen.  Zuvor hatte sie gezögert, weil das Gerät dazu zerlegt werden musste.  Ich sagte ihr, sie habe nichts zu verlieren und solle es einfach tun.','nl' => 'Zuigt niet en maakt in plaats daarvan een wurgend geluid. Enorme verstopping in de hoofdluchtleiding. Adviseer ze om door te gaan en de online aanwijzingen te volgen om een verstopping te verhelpen.  Eerder was ze terughoudend omdat ze het apparaat uit elkaar moest halen.  Ik zei haar dat ze niets te verliezen had en er voor moest gaan.','fr' => 'Il n\'aspire pas et fait un bruit d\'étranglement à la place. Un gros bouchon dans le conduit d\'air principal. Conseillez-lui d\'aller de l\'avant et de suivre les instructions en ligne sur le débouchage.  Auparavant, elle était hésitante car cela impliquait de démonter l\'appareil.  Je lui ai dit qu\'elle n\'avait rien à perdre et de se lancer.','it' => 'Non succhia e fa invece un rumore strozzato. Enorme intasamento nella via principale dell\'aria. Consiglia loro di andare avanti e seguire le indicazioni on-line su come eliminare un intasamento.  In precedenza, era titubante perché implicava lo smontaggio del dispositivo.  Le ho detto che non aveva niente da perdere e di farlo.','es' => 'No aspira y en cambio hace un ruido de estrangulamiento. Obstrucción masiva en la vía de aire principal. Le aconsejo que siga las instrucciones en línea para eliminar el atasco.  Antes, dudaba porque había que desmontar el aparato.  Le dije que no tenía nada que perder y que lo hiciera.'),
  array('id_ords' => 'rcint_32732','data_provider' => 'Repair Café International','country' => 'CAN','partner_product_category' => 'Household appliances electric ~ Vacuum cleaner','product_category' => 'Vacuum','brand' => 'Roomba','year_of_manufacture' => '2017','product_age' => '','repair_status' => 'Repairable','event_date' => '2021-05-08','problem' => 'Doesn\'t charge. Advised that the next step was checking the internal circuitry with a multimeter.  Told her about Lee\'s Electronics as a source for one and there are lots of basic electricity videos to learn from.','googletrans' => 'Doesn\'t charge. Advised that the next step was checking the internal circuitry with a multimeter.  Told her about Lee\'s Electronics as a source for one and there are lots of basic electricity videos to learn from.','language' => 'en','fault_type_id' => '0','en' => 'Doesn\'t charge. Advised that the next step was checking the internal circuitry with a multimeter.  Told her about Lee\'s Electronics as a source for one and there are lots of basic electricity videos to learn from.','de' => 'Lädt sich nicht auf. Ich riet ihr, als nächsten Schritt die internen Schaltkreise mit einem Multimeter zu überprüfen.  Ich erzählte ihr von Lee\'s Electronics als Bezugsquelle für ein solches Messgerät und dass es dort viele Videos mit grundlegenden elektrischen Funktionen gibt, aus denen man lernen kann.','nl' => 'Laadt niet op. Ik adviseerde haar dat de volgende stap was om het interne circuit te controleren met een multimeter.  Ik heb haar verteld dat Lee\'s Electronics er een kan leveren en dat er veel video\'s over elektriciteit zijn om van te leren.','fr' => 'Ne se charge pas. Je lui ai dit que l\'étape suivante consistait à vérifier les circuits internes avec un multimètre.  Je lui ai parlé de Lee\'s Electronics, qui peut en fournir un, et de nombreuses vidéos sur l\'électricité de base.','it' => 'Non si carica. Le ho consigliato che il prossimo passo è controllare il circuito interno con un multimetro.  Le ho detto di Lee\'s Electronics come fonte per uno e ci sono molti video sull\'elettricità di base da cui imparare.','es' => 'No carga. Le aconsejé que el siguiente paso era comprobar los circuitos internos con un multímetro.  Le hablé de Lee\'s Electronics como una fuente para uno y hay un montón de videos de electricidad básica para aprender.'),
  array('id_ords' => 'rcint_32747','data_provider' => 'Repair Café International','country' => 'CAN','partner_product_category' => 'Household appliances electric ~ Handheld vacuum cleaner','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '2014','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-03-20','problem' => 'vacuum working intermittently. 12v power cable frayed at strain relief where cable enters device. cut bad cable out at strain relief. stripped new cable ends and did union join. wrapped cable in electrical tape. added ad-hoc strain relief with cable-tie and more tape.','googletrans' => 'vacuum working intermittently. 12v power cable frayed at strain relief where cable enters device. cut bad cable out at strain relief. stripped new cable ends and did union join. wrapped cable in electrical tape. added ad-hoc strain relief with cable-tie and more tape.','language' => 'en','fault_type_id' => '0','en' => 'vacuum working intermittently. 12v power cable frayed at strain relief where cable enters device. cut bad cable out at strain relief. stripped new cable ends and did union join. wrapped cable in electrical tape. added ad-hoc strain relief with cable-tie and more tape.','de' => 'Vakuum funktioniert nur sporadisch. 12-V-Stromkabel an der Zugentlastung, wo das Kabel in das Gerät eintritt, ausgefranst. Schlechtes Kabel an der Zugentlastung herausgeschnitten. neue Kabelenden abisoliert und mit Überwurfmutter verbunden. Kabel mit Isolierband umwickelt. Ad-hoc-Zugentlastung mit Kabelbinder und weiterem Band hinzugefügt.','nl' => 'vacuüm werkt met tussenpozen. 12v-stroomkabel gerafeld bij trekontlasting waar kabel het apparaat binnenkomt. slechte kabel doorgeknipt bij trekontlasting. nieuwe kabeleinden gestript en unieverbinding gemaakt. kabel in elektrische tape gewikkeld. ad-hoc trekontlasting toegevoegd met kabelbinder en meer tape.','fr' => 'le vide fonctionne par intermittence. Le câble d\'alimentation 12v s\'est effiloché au niveau de la décharge de traction à l\'endroit où le câble entre dans l\'appareil. couper le mauvais câble au niveau de la décharge de traction. dénuder les extrémités du nouveau câble et faire un raccord union. envelopper le câble dans du ruban électrique. ajouter une décharge de traction ad-hoc avec un collier de serrage et plus de ruban.','it' => 'Il vuoto funziona a intermittenza. Il cavo di alimentazione a 12v si è sfilacciato nel punto di scarico della trazione dove il cavo entra nel dispositivo. ha tagliato il cavo difettoso nel punto di scarico della trazione. ha spogliato le estremità del nuovo cavo e si è unito all\'unione. ha avvolto il cavo in nastro isolante. ha aggiunto uno scarico della trazione ad-hoc con fascette e altro nastro.','es' => 'la aspiradora funciona intermitentemente. El cable de alimentación de 12v se deshilachó en el alivio de tensión donde el cable entra en el dispositivo. cortó el cable malo en el alivio de tensión. peló los extremos del cable nuevo e hizo una unión. envolvió el cable en cinta eléctrica. añadió un alivio de tensión ad-hoc con una atadura de cable y más cinta.'),
