nicamente danneggiato e piegato su un lato. 1. La valvola non si chiude correttamente 2. L\'interruttore rotativo non funziona più. 1. la valvola è stata messa a terra con un dremel 2. collegata al circuito, l\'aspirapolvere ora funziona sempre alla massima velocità.','es' => 'La aspiradora está dañada mecánicamente y doblada en un lado. 1. La válvula no cierra bien 2. El interruptor giratorio ya no funciona. 1. se ha rectificado la válvula con una dremel 2. se ha conectado a la placa de circuito, ahora la aspiradora funciona siempre a la máxima velocidad.'),
