  array('id_ords' => 'restart_18859','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Dyson','year_of_manufacture' => '2013','product_age' => '','repair_status' => 'Repairable','event_date' => '2021-06-19','problem' => 'Not sucking.Followed electric connections etc and found motor in brush head not working.  Owner to purchase replacement motor as new item would be costly.','googletrans' => 'Not sucking . Followed electric connections etc and found motor in brush head not working.  Owner to purchase replacement motor as new item would be costly.','language' => 'en','fault_type_id' => '0','en' => 'Not sucking.Followed electric connections etc and found motor in brush head not working.  Owner to purchase replacement motor as new item would be costly.','de' => 'Nach Überprüfung der elektrischen Anschlüsse usw. wurde festgestellt, dass der Motor im Bürstenkopf nicht funktioniert.  Besitzer zu kaufen Ersatzmotor als neues Element wäre kostspielig.','nl' => 'Zuigt niet. Volgde elektrische aansluitingen enz. en ontdekte dat motor in borstelkop niet werkte.  Eigenaar moet vervangende motor kopen omdat een nieuwe duur zou zijn.','fr' => 'Il a suivi les connexions électriques, etc. et a découvert que le moteur de la tête de brosse ne fonctionnait pas.  Le propriétaire doit acheter un moteur de remplacement car un nouvel article serait coûteux.','it' => 'Ha seguito i collegamenti elettrici ecc. e ha scoperto che il motore della testa della spazzola non funziona.  Il proprietario deve acquistare un motore sostitutivo perché un nuovo elemento sarebbe costoso.','es' => 'No aspiraba. Comprobé las conexiones eléctricas, etc. y descubrí que el motor del cabezal del cepillo no funcionaba.  El propietario debe comprar un motor de repuesto, ya que un artículo nuevo sería costoso.'),
  array('id_ords' => 'restart_18862','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Bosch','year_of_manufacture' => '2017','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-07-17','problem' => 'Unable to empty the bag area as switch was stuck and unresponsive.','googletrans' => 'Unable to empty the bag area as switch was stuck and unresponsive.','language' => 'en','fault_type_id' => '0','en' => 'Unable to empty the bag area as switch was stuck and unresponsive.','de' => 'Der Beutelbereich konnte nicht geleert werden, da der Schalter feststeckte und nicht reagierte.','nl' => 'Ik kon de zak niet legen, de schakelaar zat vast en reageerde niet.','fr' => 'Impossible de vider la zone des sacs car l\'interrupteur était bloqué et ne répondait pas.','it' => 'Impossibile svuotare la zona delle borse perché l\'interruttore era bloccato e non rispondeva.','es' => 'No se pudo vaciar la zona de la bolsa porque el interruptor estaba atascado y no respondía.'),
  array('id_ords' => 'restart_18863','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Panasonic','year_of_manufacture' => '2016','product_age' => '','repair_status' => 'End of life','event_date' => '2021-07-17','problem' => 'Not working.','googletrans' => 'Not working.','language' => 'en','fault_type_id' => '0','en' => 'Not working.','de' => 'Funktioniert nicht.','nl' => 'Het werkt niet.','fr' => 'Ne fonctionne pas.','it' => 'Non funziona.','es' => 'No funciona.'),
  array('id_ords' => 'restart_18881','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Dyson','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-06-19','problem' => 'Not moving correctly.Latch loose inside wheel which could be causing issue, but also brush head seriously clogged with pet hair and looks like used with damp flouring. Given a good clean and instructions on how to maintain in future.  Appears to be working OK now.','googletrans' => 'Not moving correctly . Latch loose inside wheel which could be causing issue, but also brush head seriously clogged with pet hair and looks like used with damp flouring. Given a good clean and instructions on how to maintain in future.  Appears to be working OK now.','language' => 'en','fault_type_id' => '0','en' => 'Not moving correctly.Latch loose inside wheel which could be causing issue, but also brush head seriously clogged with pet hair and looks like used with damp flouring. Given a good clean and instructions on how to maintain in future.  Appears to be working OK now.','de' => 'Die Verriegelung im Rad ist lose, was das Problem verursachen könnte, aber auch der Bürstenkopf ist stark mit Tierhaaren verstopft und sieht aus wie mit feuchtem Mehl benutzt. Wurde gründlich gereinigt und erhielt Anweisungen für die künftige Pflege.  Scheint jetzt gut zu funktionieren.','nl' => 'Beweegt niet goed. Vergrendeling aan de binnenkant van het wiel zit los, wat de oorzaak kan zijn, maar ook de borstelkop zit vol met haren van huisdieren en lijkt te zijn gebruikt met vochtig meel. Goed schoongemaakt en instructies gekregen hoe in de toekomst te onderhouden.  Lijkt nu goed te werken.','fr' => 'Le loquet est desserré à l\'intérieur de la roue, ce qui pourrait être la cause du problème, mais aussi la tête de la brosse est sérieusement obstruée par des poils d\'animaux et semble avoir été utilisée avec de la farine humide. On lui a donné un bon nettoyage et des instructions sur la façon de l\'entretenir à l\'avenir.  Il semble que l\'appareil fonctionne bien maintenant.','it' => 'Non si muove correttamente, il chiavistello si allenta all\'interno della ruota che potrebbe causare il problema, ma anche la testa della spazzola è seriamente intasata da peli di animali domestici e sembra usata con un\'infarinatura umida. Dato una buona pulizia e istruzioni su come mantenere in futuro.  Sembra funzionare bene ora.','es' => 'No se mueve correctamente. El pestillo está suelto en el interior de la rueda, lo que podría ser la causa del problema, pero también el cabezal del cepillo está seriamente obstruido con pelos de animales domésticos y parece que se ha utilizado con harina húmeda. Se ha limpiado bien y se han dado instrucciones sobre cómo mantenerlo en el futuro.  Parece que ahora funciona bien.'),
  array('id_ords' => 'restart_18886','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Nilfisk','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2021-06-19','problem' => 'Stopped working.Issue with cable reel - looking to source replacement, and if that fails, could be hardwired with out retractability.  Will return next month to finish either way.','googletrans' => 'Stopped working . Issue with cable reel - looking to source replacement, and if that fails, could be hardwired with out retractability.  Will return next month to finish either way.','language' => 'en','fault_type_id' => '0','en' => 'Stopped working.Issue with cable reel - looking to source replacement, and if that fails, could be hardwired with out retractability.  Will return next month to finish either way.','de' => 'Problem mit der Kabeltrommel - auf der Suche nach Ersatz, und wenn das scheitert, könnte fest verdrahtet werden, ohne Aufrollbarkeit.  Wird nächsten Monat zurückkehren, um so oder so zu beenden.','nl' => 'Stopte met werken. Probleem met kabelhaspel - op zoek naar vervanging, en als dat mislukt, kan het hardwired zijn zonder intrekbaarheid.  Kom volgende maand terug om het hoe dan ook af te maken.','fr' => 'Problème avec l\'enrouleur de câble - je cherche à le remplacer, et si cela échoue, il pourrait être câblé sans rétractabilité.  Je reviendrai le mois prochain pour finir de toute façon.','it' => 'Ha smesso di funzionare. problema con la bobina del cavo - cercando di fonte di sostituzione, e se questo non riesce, potrebbe essere cablato con fuori retrattilità.  Tornerà il mese prossimo per finire in entrambi i casi.','es' => 'El problema con el carrete de cable - buscando un reemplazo, y si eso falla, podría ser cableado sin retractabilidad.  Volveré el mes que viene para terminar de cualquier manera.'),
  array('id_ords' => 'restart_18887','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Vax','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-06-19','problem' => 'On Off switch has stopped working.Found spring caught in retractor.Power set at minimum.Power switch OK.Removed spring, and now works fine.','googletrans' => 'On Off switch has stopped working . Found spring caught in retractor . Power set at minimum . Power switch OK . Removed spring, and now works fine.','language' => 'en','fault_type_id' => '0','en' => 'On Off switch has stopped working.Found spring caught in retractor.Power set at minimum.Power switch OK.Removed spring, and now works fine.','de' => 'Der Ein-Aus-Schalter funktioniert nicht mehr, die Feder hat sich in der Aufrollvorrichtung verfangen, die Leistung ist auf Minimum eingestellt, der Schalter ist in Ordnung, die Feder wurde entfernt, und jetzt funktioniert es wieder.','nl' => 'Aan/uit-schakelaar werkt niet meer. Veer zit vast in oprolmechanisme. Vermogen op minimum gezet. Vermogenschakelaar OK. Veer verwijderd, en nu werkt het prima.','fr' => 'L\'interrupteur marche-arrêt a cessé de fonctionner. Le ressort s\'est coincé dans l\'enrouleur. La puissance est réglée au minimum. L\'interrupteur marche-arrêt est en bon état de marche.','it' => 'L\'interruttore On Off ha smesso di funzionare, ho trovato la molla incastrata nel riavvolgitore, la potenza è al minimo, l\'interruttore è OK, ho rimosso la molla e ora funziona bene.','es' => 'El interruptor de encendido y apagado ha dejado de funcionar.Encontré un muelle atrapado en el retractor.La potencia está al mínimo.El interruptor está bien.Quité el muelle y ahora funciona bien.'),
  array('id_ords' => 'restart_18890','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Dyson','year_of_manufacture' => '','product_age' => '','repair_status' => 'End of life','event_date' => '2021-06-19','problem' => 'Works fine for a few minutes and then ball sticks.Investigated and suspect that bearings are worn. Doesn\'t appear to be part that can be replaced.','googletrans' => 'Works fine for a few minutes and then ball sticks . Investigated and suspect that bearings are worn. Doesn\'t appear to be part that can be replaced.','language' => 'en','fault_type_id' => '0','en' => 'Works fine for a few minutes and then ball sticks.Investigated and suspect that bearings are worn. Doesn\'t appear to be part that can be replaced.','de' => 'Funktioniert für ein paar Minuten gut, dann bleibt der Ball stecken, ich habe ihn untersucht und vermute, dass die Lager abgenutzt sind. Scheint kein Teil zu sein, das ersetzt werden kann.','nl' => 'Werkt prima voor een paar minuten en dan blijft de kogel hangen.Onderzocht en vermoed dat de lagers versleten zijn. Lijkt geen onderdeel te zijn dat vervangen kan worden.','fr' => 'Fonctionne bien pendant quelques minutes, puis la bille se bloque... J\'ai enquêté et je soupçonne que les roulements sont usés. Il ne semble pas que ce soit une pièce qui puisse être remplacée.','it' => 'Funziona bene per qualche minuto e poi la palla si blocca. Non sembra essere una parte che può essere sostituita.','es' => 'Funciona bien durante unos minutos y luego la bola se atasca.Investigó y sospecha que los rodamientos están desgastados. No parece ser una parte que pueda ser reemplazada.'),
  array('id_ords' => 'restart_18894','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Dyson','year_of_manufacture' => '2014','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-06-29','problem' => 'Had 2 DC34s that weren\'t working, switched the batteries to make them work.','googletrans' => 'Had 2 DC34s that weren\'t working, switched the batteries to make them work.','language' => 'en','fault_type_id' => '0','en' => 'Had 2 DC34s that weren\'t working, switched the batteries to make them work.','de' => 'Ich hatte 2 DC34, die nicht funktionierten, und habe die Batterien ausgetauscht, damit sie wieder funktionieren.','nl' => 'Ik had 2 DC34s die niet werkten, heb de batterijen verwisseld om ze te laten werken.','fr' => 'J\'avais 2 DC34 qui ne fonctionnaient pas, j\'ai changé les piles pour les faire fonctionner.','it' => 'Avevo 2 DC34 che non funzionavano, ho cambiato le batterie per farli funzionare.','es' => 'Tenía 2 DC34 que no funcionaban, cambié las baterías para que funcionaran.'),
  array('id_ords' => 'restart_18907','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Dyson','year_of_manufacture' => '2011','product_age' => '','repair_status' => 'Repairable','event_date' => '2021-07-24','problem' => 'Motor dead','googletrans' => 'Motor dead','language' => 'en','fault_type_id' => '0','en' => 'Motor dead','de' => 'Motor tot','nl' => 'Motor dood','fr' => 'Moteur mort','it' => 'Motore morto','es' => 'Motor muerto'),
  array('id_ords' => 'restart_1892','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Henry','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2015-11-21','problem' => 'Dies after starting','googletrans' => 'Dies after starting','language' => 'en','fault_type_id' => '0','en' => 'Dies after starting','de' => 'Stirbt nach dem Start','nl' => 'Stopt na het starten','fr' => 'Dies après le démarrage','it' => 'Muore dopo l\'avvio','es' => 'Se apaga tras el arranque'),
  array('id_ords' => 'restart_18937','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Miele','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-07-24','problem' => 'Suction pipe not connecting properly with bag so dust goes straight into drum.  The bracket that holds the bag in place had been recently replaced with a new one. We inspected the setup for "fit" (bag to nozzle, etc) and all seemed okay. We determined the problem had been caused by the lid not fully latching, or possible coming unlatched in operation (which we could not reproduce). Suggested minimal lubrication of nozzle piece inside canister where it enters the gasket to the bag with a little rapeseed oil (or comparable). Client considered the problem solved.','googletrans' => 'Suction pipe not connecting properly with bag so dust goes straight into drum.  The bracket that holds the bag in place had been recently replaced with a new one. We inspected the setup for "fit" (bag to nozzle, etc) and all seemed okay. We determined the problem had been caused by the lid not fully latching, or possible coming unlatched in operation (which we could not reproduce). Suggested minimal lubrication of nozzle piece inside canister where it enters the gasket to the bag with a little rapeseed oil (or comparable). Client considered the problem solved.','language' => 'en','fault_type_id' => '0','en' => 'Suction pipe not connecting properly with bag so dust goes straight into drum.  The bracket that holds the bag in place had been recently replaced with a new one. We inspected the setup for "fit" (bag to nozzle, etc) and all seemed okay. We determined the problem had been caused by the lid not fully latching, or possible coming unlatched in operation (which we could not reproduce). Suggested minimal lubrication of nozzle piece inside canister where it enters the gasket to the bag with a little rapeseed oil (or comparable). Client considered the problem solved.','de' => 'Das Ansaugrohr ist nicht richtig mit dem Beutel verbunden, so dass der Staub direkt in die Trommel gelangt.  Die Halterung, die den Beutel an seinem Platz hält, wurde kürzlich durch eine neue ersetzt. Wir überprüften den Sitz des Geräts (Beutel zu Düse usw.) und alles schien in Ordnung zu sein. Wir stellten fest, dass das Problem dadurch verursacht wurde, dass der Deckel nicht vollständig einrastete oder sich möglicherweise während des Betriebs löste (was wir nicht reproduzieren konnten). Wir schlugen vor, das Düsenteil im Inneren des Behälters an der Stelle, an der es in die Dichtung zum Beutel eintritt, mit etwas Rapsöl (oder einem vergleichbaren Öl) zu schmieren. Der Kunde betrachtete das Problem als gelöst.','nl' => 'Zuigbuis sluit niet goed aan op zak waardoor stof rechtstreeks in trommel gaat.  De beugel die de zak op zijn plaats houdt, was onlangs vervangen door een nieuwe. We controleerden de installatie op "pasvorm" (zak aan mondstuk, enz.) en alles leek in orde. We stelden vast dat het probleem werd veroorzaakt door het niet volledig vergrendelen van het deksel, of mogelijk ontgrendelen tijdens het gebruik (wat we niet konden reproduceren). We stelden voor het mondstuk in de houder, waar het de pakking van de zak ingaat, minimaal in te smeren met een beetje koolzaadolie (of vergelijkbaar). De klant beschouwde het probleem als opgelost.','fr' => 'Le tuyau d\'aspiration ne se raccorde pas correctement au sac, ce qui fait que la poussière va directement dans le tambour.  Le support qui maintient le sac en place avait été récemment remplacé par un nouveau. Nous avons vérifié l\'ajustement de l\'installation (sac et buse, etc.) et tout semblait correct. Nous avons déterminé que le problème était dû au fait que le couvercle ne se verrouillait pas complètement ou qu\'il se déverrouillait en cours de fonctionnement (ce que nous n\'avons pas pu reproduire). Nous avons suggéré une lubrification minimale de la pièce de la buse à l\'intérieur de la boîte, à l\'endroit où elle entre dans le joint du sac, avec un peu d\'huile de colza (ou comparable). Le client a considéré que le problème était résolu.','it' => 'Il tubo di aspirazione non si collega correttamente con il sacchetto e la polvere finisce direttamente nel tamburo.  La staffa che tiene il sacchetto in posizione era stata recentemente sostituita con una nuova. Abbiamo ispezionato l\'installazione per "l\'adattamento" (sacchetto all\'ugello, ecc.) e tutto sembrava a posto. Abbiamo determinato che il problema era stato causato dal coperchio che non si chiudeva completamente, o forse si sbloccava durante il funzionamento (cosa che non abbiamo potuto riprodurre). Abbiamo suggerito una lubrificazione minima del pezzo dell\'ugello all\'interno del contenitore dove entra nella guarnizione del sacchetto con un po\' di olio di colza (o simile). Il cliente ha considerato il problema risolto.','es' => 'El tubo de aspiración no conecta correctamente con la bolsa, por lo que el polvo va directamente al tambor.  El soporte que mantiene la bolsa en su lugar había sido sustituido recientemente por uno nuevo. Inspeccionamos la configuración para ver si se ajustaba (bolsa a boquilla, etc.) y todo parecía estar bien. Determinamos que el problema había sido causado por la tapa que no se enganchaba completamente, o que posiblemente se desenganchaba en funcionamiento (lo que no pudimos reproducir). Sugerimos lubricar mínimamente la pieza de la boquilla en el interior del bote donde entra la junta a la bolsa con un poco de aceite de colza (o similar). El cliente consideró resuelto el problema.'),
  array('id_ords' => 'restart_18939','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Black & Decker','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2021-07-24','problem' => 'It is not charging, it feels like the hole the charger goes into has dropped internally.  Helped  unscrew the casing and get to the broken power socket.  Plastic stopping solid charger connection.   Once inside recommended asking Black & Decker if they have spare part, or trying Sugru to repair broken part and super glue.','googletrans' => 'It is not charging, it feels like the hole the charger goes into has dropped internally.  Helped  unscrew the casing and get to the broken power socket.  Plastic stopping solid charger connection.   Once inside recommended asking Black & Decker if they have spare part, or trying Sugru to repair broken part and super glue.','language' => 'en','fault_type_id' => '0','en' => 'It is not charging, it feels like the hole the charger goes into has dropped internally.  Helped  unscrew the casing and get to the broken power socket.  Plastic stopping solid charger connection.   Once inside recommended asking Black & Decker if they have spare part, or trying Sugru to repair broken part and super glue.','de' => 'Es lädt nicht, es fühlt sich an, als ob das Loch, in das das Ladegerät geht, intern gefallen ist.  Geholfen, das Gehäuse abzuschrauben und die gebrochene Steckdose zu erreichen.  Plastik verhindert einen festen Anschluss des Ladegeräts.   Einmal im Inneren empfohlen fragen Black & Decker, ob sie Ersatzteil haben, oder versuchen Sugru gebrochenen Teil und Sekundenkleber zu reparieren.','nl' => 'Hij laadt niet op, het voelt alsof het gat waar de lader in gaat intern is gezakt.  Heb de behuizing losgeschroefd en bij het kapotte stopcontact gekomen.  Plastic dat stevige laderverbinding tegenhoudt.   Eenmaal binnen aanbevolen om Black & Decker te vragen of ze een reserveonderdeel hebben, of Sugru te proberen om het kapotte onderdeel te repareren en superlijm.','fr' => 'Il ne se charge pas, on dirait que le trou dans lequel le chargeur est inséré est tombé à l\'intérieur.  J\'ai aidé à dévisser le boîtier et à atteindre la prise électrique cassée.  Le plastique empêche la connexion solide du chargeur.   Une fois à l\'intérieur, j\'ai recommandé de demander à Black & Decker s\'ils avaient une pièce de rechange, ou d\'essayer de réparer la partie cassée avec du Sugru et de la super glue.','it' => 'Non si sta caricando, sembra che il foro in cui va il caricatore sia caduto internamente.  Ho aiutato a svitare l\'involucro e ad arrivare alla presa di corrente rotta.  Plastica che ferma la connessione solida del caricabatterie.   Una volta dentro raccomandato chiedendo Black & Decker se hanno parte di ricambio, o provare Sugru per riparare la parte rotta e super colla.','es' => 'No carga, parece que el agujero en el que va el cargador se ha caído internamente.  Ayudé a desenroscar la carcasa y llegar a la toma de corriente rota.  El plástico impide la conexión sólida del cargador.   Una vez dentro recomendó preguntar a Black & Decker si tienen recambio, o probar con Sugru para reparar la parte rota y con super pegamento.'),
  array('id_ords' => 'restart_18947','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Henry','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2021-07-24','problem' => 'Needed disassembly but had no tools.  Advised to bring to a live event.','googletrans' => 'Needed disassembly but had no tools.  Advised to bring to a live event.','language' => 'en','fault_type_id' => '0','en' => 'Needed disassembly but had no tools.  Advised to bring to a live event.','de' => 'Musste demontiert werden, hatte aber kein Werkzeug.  Empfohlen, zu einer Live-Veranstaltung mitzubringen.','nl' => 'Moest gedemonteerd worden, maar had geen gereedschap.  Ik adviseerde om mee te nemen naar een live evenement.','fr' => 'Il fallait le démonter mais je n\'avais pas d\'outils.  Conseillé d\'apporter à un événement en direct.','it' => 'Aveva bisogno di essere smontato ma non aveva strumenti.  Consigliato di portare ad un evento dal vivo.','es' => 'Había que desmontarlo pero no tenía herramientas.  Se aconseja llevar a un evento en vivo.'),
  array('id_ords' => 'restart_18986','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Morphy Richards','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2021-07-17','problem' => 'Works intermittentlyLooks to be a battery issue.  Suggested swapping battery - source replacement from manufacturer.','googletrans' => 'Works intermittentlyLooks to be a battery issue.  Suggested swapping battery - source replacement from manufacturer.','language' => 'en','fault_type_id' => '0','en' => 'Works intermittentlyLooks to be a battery issue.  Suggested swapping battery - source replacement from manufacturer.','de' => 'Funktioniert mit UnterbrechungenSieht aus wie ein Batterieproblem.  Es wird empfohlen, die Batterie auszutauschen - Ersatz vom Hersteller zu beziehen.','nl' => 'Werkt met tussenpozen. Lijkt een probleem met de batterij te zijn.  Ik stel voor om de batterij te vervangen, via de fabrikant.','fr' => 'Fonctionne par intermittenceSemble être un problème de batterie.  Il est suggéré d\'échanger la batterie - de la remplacer par une autre du fabricant.','it' => 'Funziona a intermittenzaSembra essere un problema di batteria.  Suggerito lo scambio di batteria - fonte di sostituzione dal produttore.','es' => 'Funciona intermitentementeParece ser un problema de la batería.  Sugiere cambiar la batería - fuente de reemplazo del fabricante.'),
