  array('id_ords' => 'restart_19077','data_provider' => 'The Restart Project','country' => 'BEL','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Miele','year_of_manufacture' => '2017','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-08-10','problem' => 'Rupture câble électrique enrouleur','googletrans' => 'Rupture electric cable winder','language' => 'fr','fault_type_id' => '0','en' => 'Breakage of the electric cable reel','de' => 'Bruch des Kabels der elektrischen Aufrollvorrichtung','nl' => 'Elektrische kabelbreuk op haspel','fr' => 'Rupture câble électrique enrouleur','it' => 'Rottura del cavo elettrico sulla bobina','es' => 'Rotura de cable eléctrico en bobina'),
  array('id_ords' => 'restart_19092','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Vytronix','year_of_manufacture' => '2021','product_age' => '','repair_status' => 'End of life','event_date' => '2021-10-30','problem' => 'Burning smell and motor slow."Landlord" quality device.  Found motor windings blackened and and partly burnt.  Thermal cutout detached because zip-tie mountings melted.  Brushes OK. Sparks seen coming from rotor coil.  Suspect faulty insulation in coil.  Motor would need re-wind or replacement.','googletrans' => 'Burning smell and motor slow."Landlord" quality device.  Found motor windings blackened and and partly burnt.  Thermal cutout detached because zip-tie mountings melted.  Brushes OK. Sparks seen coming from rotor coil.  Suspect faulty insulation in coil.  Motor would need re-wind or replacement.','language' => 'en','fault_type_id' => '0','en' => 'Burning smell and motor slow."Landlord" quality device.  Found motor windings blackened and and partly burnt.  Thermal cutout detached because zip-tie mountings melted.  Brushes OK. Sparks seen coming from rotor coil.  Suspect faulty insulation in coil.  Motor would need re-wind or replacement.','de' => 'Verbrennungsgeruch und langsamer Motor. Gerät in "Vermieter"-Qualität.  Die Motorwicklungen waren geschwärzt und teilweise verbrannt.  Wärmeschutzschalter hat sich gelöst, weil Kabelbinderhalterungen geschmolzen sind.  Bürsten in Ordnung. Funken aus der Rotorspule gesehen.  Verdacht auf fehlerhafte Isolierung in der Spule.  Der Motor müsste neu gewickelt oder ausgetauscht werden.','nl' => 'Brandlucht en trage motor. Apparaat van "Landlord" kwaliteit.  Motorwikkelingen zwartgeblakerd en deels verbrand aangetroffen.  Thermische beveiliging losgeraakt omdat kabelbinders gesmolten waren.  Borstels OK. Vonken gezien vanaf rotorspoel.  Vermoedelijk defecte isolatie in spoel.  Motor moet opnieuw gewikkeld of vervangen worden.','fr' => 'Odeur de brûlé et moteur lent. Appareil de qualité "Landlord".  J\'ai trouvé les enroulements du moteur noircis et partiellement brûlés.  Le coupe-circuit thermique s\'est détaché car les fixations de la fermeture éclair ont fondu.  Brosses OK. Étincelles provenant de la bobine du rotor.  Soupçon d\'isolation défectueuse dans la bobine.  Le moteur doit être rebobiné ou remplacé.','it' => 'Odore di bruciato e motore lento. Dispositivo di qualità "Landlord".  Ho trovato gli avvolgimenti del motore anneriti e parzialmente bruciati.  Il taglio termico si è staccato perché le fascette si sono sciolte.  Spazzole OK. Si sono viste scintille provenienti dalla bobina del rotore.  Sospetto isolamento difettoso nella bobina.  Il motore avrebbe bisogno di essere riavvolto o sostituito.','es' => 'Olor a quemado y motor lento. Aparato de calidad "casera".  Encontré los bobinados del motor ennegrecidos y parcialmente quemados.  El corte térmico se ha desprendido porque las fijaciones de las cremalleras se han fundido.  Las escobillas están bien. Se han visto chispas procedentes de la bobina del rotor.  Se sospecha que el aislamiento de la bobina es defectuoso.  El motor necesitaría ser rebobinado o reemplazado.'),
