  array('id_ords' => 'restart_19601','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Dibea','year_of_manufacture' => '2018','product_age' => '','repair_status' => 'Fixed','event_date' => '2021-10-10','problem' => 'The vacuum cleaner did not suck. It was disassembled and cleaned, which solved the suction issue as it was clogged. The brush head, which comes with an inbuilt motor, had the motor burnt out. However, the vacuum functions without this feature.','googletrans' => 'The vacuum cleaner did not suck. It was disassembled and cleaned, which solved the suction issue as it was clogged. The brush head, which comes with an inbuilt motor, had the motor burnt out. However, the vacuum functions without this feature.','language' => 'en','fault_type_id' => '0','en' => 'The vacuum cleaner did not suck. It was disassembled and cleaned, which solved the suction issue as it was clogged. The brush head, which comes with an inbuilt motor, had the motor burnt out. However, the vacuum functions without this feature.','de' => 'Der Staubsauger saugte nicht. Er wurde zerlegt und gereinigt, wodurch das Saugproblem gelöst wurde, da er verstopft war. Beim Bürstenkopf, der mit einem eingebauten Motor ausgestattet ist, war der Motor durchgebrannt. Der Staubsauger funktioniert jedoch auch ohne diese Funktion.','nl' => 'De stofzuiger zoog niet. Hij werd gedemonteerd en schoongemaakt, wat het zuigprobleem oploste, want hij was verstopt. Bij de borstelkop, die met een ingebouwde motor wordt geleverd, was de motor doorgebrand. De stofzuiger werkt echter ook zonder deze functie.','fr' => 'L\'aspirateur n\'aspirait pas. Il a été démonté et nettoyé, ce qui a résolu le problème d\'aspiration car il était bouché. Le moteur de la tête de brosse, qui est équipé d\'un moteur intégré, était grillé. Cependant, l\'aspirateur fonctionne sans cette fonction.','it' => 'L\'aspirapolvere non aspirava. È stato smontat