  array('id_ords' => 'restart_7371','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Unknown','year_of_manufacture' => '','product_age' => '','repair_status' => 'End of life','event_date' => '2018-03-03','problem' => 'Small battery-powered carpet cleaner attached to a long handle, brand/model forgotten. The handle had snapped off from the hinge, as a clip had snapped off. The hinge also seemed to be stuck in one position. After freeing the hinge and offering to glue the handle onto it with epoxy resin, the user decided that the two positions/angles the handle was now moving between were not practical, and decided against the repair.','googletrans' => 'Small battery-powered carpet cleaner attached to a long handle, brand / model forgotten. The handle had snapped off from the hinge, as a clip had snapped off. The hinge also seemed to be stuck in one position. After freeing the hinge and offering to glue the handle onto it with epoxy resin, the user decided that the two positions / angles the handle was now moving between were not practical, and decided against the repair.','language' => 'en','fault_type_id' => '0','en' => 'Small battery-powered carpet cleaner attached to a long handle, brand/model forgotten. The handle had snapped off from the hinge, as a clip had snapped off. The hinge also seemed to be stuck in one position. After freeing the hinge and offering to glue the handle onto it with epoxy resin, the user decided that the two positions/angles the handle was now moving between were not practical, and decided against the repair.','de' => 'Kleiner batteriebetriebener Teppichreiniger, der an einem langen Stiel befestigt ist, Marke/Modell vergessen. Der Griff war vom Scharnier abgeknickt, da ein Clip abgebrochen war. Das Scharnier schien auch in einer Position festzustecken. Nachdem er das Scharnier gelöst und angeboten hatte, den Griff mit Epoxidharz zu verkleben, entschied der Benutzer, dass die beiden Positionen/Winkel, zwischen denen sich der Griff nun bewegte, nicht praktikabel waren, und entschied sich gegen die Reparatur.','nl' => 'Kleine tapijtreiniger op batterijen, bevestigd aan een lange steel, merk/model vergeten. De steel was losgeraakt van het scharnier, doordat een clip was afgebroken. Het scharnier leek ook vast te zitten in één positie. Na het scharnier te hebben losgemaakt en te hebben aangeboden de handgreep met epoxyhars vast te lijmen, besloot de gebruiker dat de twee standen/hoeken waartussen de handgreep nu bewoog niet praktisch waren, en zag hij af van de reparatie.','fr' => 'Petit nettoyeur de tapis à piles attaché à un long manche, marque/modèle oublié. Le manche s\'est détaché de la charnière, comme si un clip s\'était cassé. La charnière semblait également être bloquée dans une position. Après avoir libéré la charnière et proposé de coller le manche sur celle-ci avec de la résine époxy, l\'utilisateur a décidé que les deux positions/angles entre lesquels le manche se déplaçait maintenant n\'étaient pas pratiques, et a décidé de ne pas effectuer la réparation.','it' => 'Piccolo pulitore di tappeti a batteria attaccato a un lungo manico, marca/modello dimenticato. Il manico si era staccato dalla cerniera, poiché una clip si era staccata. La cerniera sembrava anche essere bloccata in una posizione. Dopo aver liberato la cerniera e offerto di incollare il manico con resina epossidica, l\'utente ha deciso che le due posizioni/angoli in cui si muoveva il manico non erano pratiche e ha deciso di non ripararlo.','es' => 'Pequeño limpiador de alfombras a pilas unido a un mango largo, marca/modelo olvidado. El mango se había desprendido de la bisagra, ya que se había roto un clip. La bisagra también parecía estar atascada en una posición. Después de liberar la bisagra y ofrecer pegar el mango con resina epoxi, el usuario decidió que las dos posiciones/ángulos entre los que se movía ahora el mango no eran prácticos, y decidió no hacer la reparación.'),
  array('id_ords' => 'restart_7606','data_provider' => 'The Restart Project','country' => 'USA','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Bissell','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-03-24','problem' => 'not sucking took apart and cleaned all','googletrans' => 'not sucking took apart and cleaned all','language' => 'en','fault_type_id' => '0','en' => 'not sucking took apart and cleaned all','de' => 'nicht saugen nahm auseinander und reinigte alles','nl' => 'niet zuigen uit elkaar gehaald en alles schoongemaakt','fr' => 'qui ne suce pas a démonté et nettoyé tout','it' => 'non succhiare ha smontato e pulito tutto','es' => 'no chupar desmontó y limpió todo'),
  array('id_ords' => 'restart_7674','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Panasonic','year_of_manufacture' => '','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-04-07','problem' => 'Power was cutting out when cord flexed at input.We opened the vacuum casing by removing all screws behind the bagless bucket cylinder, then un-clamped and un-crimped the power cable from the internal circuits, cut off about 6 inches of cable and fed it in further, stripped the cable down to wire ends, re-crimped it back to connect to the circuit, clamped the cable back down, and re-assembled the vacuum.We also un-clogged the hose where some muck was held back by a chip of wood.','googletrans' => 'Power was cutting out when cord flexed at input . We opened the vacuum casing by removing all screws behind the bagless bucket cylinder, then un-clamped and un-crimped the power cable from the internal circuits, cut off about 6 inches of cable and fed it in further, stripped the cable down to wire ends, re-crimped it back to connect to the circuit, clamped the cable back down, and re-assembled the vacuum . We also un-clogged the hose where some muck was held back by a chip of wood.','language' => 'en','fault_type_id' => '0','en' => 'Power was cutting out when cord flexed at input.We opened the vacuum casing by removing all screws behind the bagless bucket cylinder, then un-clamped and un-crimped the power cable from the internal circuits, cut off about 6 inches of cable and fed it in further, stripped the cable down to wire ends, re-crimped it back to connect to the circuit, clamped the cable back down, and re-assembled the vacuum.We also un-clogged the hose where some muck was held back by a chip of wood.','de' => 'Wir haben das Vakuumgehäuse geöffnet, indem wir alle Schrauben hinter dem beutellosen Eimerzylinder entfernt haben, dann das Stromkabel von den internen Schaltkreisen gelöst und abgeklemmt, etwa 15 cm des Kabels abgeschnitten und weiter eingeführt, das Kabel bis auf die Drahtenden abisoliert, es wieder an den Schaltkreis angeschlossen, das Kabel wieder festgeklemmt und das Vakuum wieder zusammengebaut.','nl' => 'We hebben de zuigbehuizing geopend door alle schroeven achter de zakloze emmercilinder te verwijderen, vervolgens de stroomkabel losgeklemd en losgeklemd van de interne circuits, ongeveer 15 cm kabel afgesneden en verder naar binnen geleid, de kabel gestript tot op de draaduiteinden, opnieuw geklemd om hem op het circuit aan te sluiten, de kabel weer vastgeklemd en de stofzuiger weer in elkaar gezet. We hebben ook de slang ontstopt waar wat vuil werd tegengehouden door een stuk hout.','fr' => 'Nous avons ouvert le boîtier de l\'aspirateur en retirant toutes les vis derrière le cylindre du seau sans sac, puis nous avons débloqué et déconnecté le câble d\'alimentation des circuits internes, nous avons coupé environ 15 cm de câble et l\'avons introduit plus loin, nous avons dénudé le câble jusqu\'aux extrémités des fils, nous l\'avons reconnecté au circuit, nous avons reconnecté le câble et nous avons réassemblé l\'aspirateur.','it' => 'Abbiamo aperto l\'involucro dell\'aspirapolvere rimuovendo tutte le viti dietro il cilindro del secchio senza sacco, poi abbiamo tolto i morsetti e staccato il cavo di alimentazione dai circuiti interni, abbiamo tagliato circa 15 cm di cavo e l\'abbiamo fatto entrare ulteriormente, abbiamo spogliato il cavo fino alle estremità dei fili, l\'abbiamo riattaccato per collegarlo al circuito, abbiamo rimesso i morsetti e abbiamo rimontato l\'aspirapolvere, abbiamo anche staccato il tubo dove un pezzo di legno tratteneva del letame.','es' => 'Abrimos la carcasa de la aspiradora quitando todos los tornillos detrás del cilindro de la cubeta sin bolsa, luego desenganchamos el cable de alimentación de los circuitos internos, cortamos unos 15 centímetros de cable y lo introdujimos más, pelamos el cable hasta los extremos, lo volvimos a enganchar para conectarlo al circuito, volvimos a enganchar el cable y volvimos a montar la aspiradora.'),
  array('id_ords' => 'restart_7675','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Vax','year_of_manufacture' => '2017','product_age' => '','repair_status' => 'Repairable','event_date' => '2018-04-07','problem' => 'The vacuum was still under warranty and had lost suction, but the owner wanted to see if a quick fix or fault-find was possible.We un-clogged the hose, but that did not fix the problem.Our best hypothesis was that a seal in part of the bagless cylinder had been damaged at some point when emptying it, and that a replacement part would be needed. The owner decided to try and seek replacement parts under warranty to self-fix, or return it.','googletrans' => 'The vacuum was still under warranty and had lost suction, but the owner wanted to see if a quick fix or fault-find was possible . We un-clogged the hose, but that did not fix the problem . Our best hypothesis was that a seal in part of the bagless cylinder had been damaged at some point when emptying it, and that a replacement part would be needed. The owner decided to try and seek replacement parts under warranty to self-fix, or return it.','language' => 'en','fault_type_id' => '0','en' => 'The vacuum was still under warranty and had lost suction, but the owner wanted to see if a quick fix or fault-find was possible.We un-clogged the hose, but that did not fix the problem.Our best hypothesis was that a seal in part of the bagless cylinder had been damaged at some point when emptying it, and that a replacement part would be needed. The owner decided to try and seek replacement parts under warranty to self-fix, or return it.','de' => 'Der Staubsauger war noch unter Garantie und hatte an Saugkraft verloren, aber der Besitzer wollte sehen, ob eine schnelle Reparatur oder Fehlersuche möglich war.Wir lösten den Schlauch, aber das Problem war damit nicht behoben.Unsere beste Hypothese war, dass eine Dichtung in einem Teil des beutellosen Zylinders irgendwann beim Entleeren beschädigt worden war und dass ein Ersatzteil benötigt würde. Der Besitzer beschloss, sich um Ersatzteile zu bemühen, um das Problem selbst zu beheben, oder das Gerät zurückzugeben.','nl' => 'De stofzuiger viel nog onder de garantie en had geen zuigkracht meer, maar de eigenaar wilde zien of een snelle oplossing of foutopsporing mogelijk was. We hebben de slang ontstopt, maar dat loste het probleem niet op. Onze beste hypothese was dat een afdichting in een deel van de zakloze cilinder was beschadigd op een bepaald punt bij het legen, en dat een vervangend onderdeel nodig zou zijn. De eigenaar besloot om onder de garantie op zoek te gaan naar vervangende onderdelen om het probleem zelf op te lossen, of om het apparaat terug te sturen.','fr' => 'L\'aspirateur était encore sous garantie et avait perdu de l\'aspiration, mais le propriétaire voulait voir si une réparation rapide ou une recherche de panne était possible.Nous avons débouché le tuyau, mais cela n\'a pas résolu le problème.Notre meilleure hypothèse était qu\'un joint dans une partie du cylindre sans sac avait été endommagé à un moment donné lors de la vidange, et qu\'une pièce de rechange serait nécessaire. Le propriétaire a décidé d\'essayer de trouver des pièces de rechange sous garantie pour réparer lui-même l\'appareil, ou de le retourner.','it' => 'L\'aspirapolvere era ancora in garanzia e aveva perso l\'aspirazione, ma il proprietario voleva vedere se era possibile una soluzione rapida o una ricerca del guasto. Abbiamo sturato il tubo, ma questo non ha risolto il problema. Il proprietario ha deciso di provare a cercare pezzi di ricambio in garanzia per auto-ripararsi, o di restituirlo.','es' => 'La aspiradora estaba todavía en garantía y había perdido succión, pero el propietario quería ver si era posible una solución rápida o una localización de averías.Destapamos la manguera, pero eso no solucionó el problema.Nuestra mejor hipótesis era que una junta en parte del cilindro sin bolsa se había dañado en algún momento al vaciarlo, y que se necesitaría una pieza de repuesto. El propietario decidió intentar buscar las piezas de repuesto en garantía para auto-arreglarlo, o devolverlo.'),
