  array('id_ords' => 'restart_8980','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Vacuum','product_category' => 'Vacuum','brand' => 'Hoover','year_of_manufacture' => '1978','product_age' => '','repair_status' => 'Fixed','event_date' => '2018-09-01','problem' => 'Dust leakage','googletrans' => 'Dust leakage','language' => 'en','fault_type_id' => '0','en' => 'Dust leakage','de' => 'Austritt von Staub','nl' => 'Stoflekkage','fr' => 'Fuite de poussières','it' => 'Perdita di polvere','es' => 'Fuga de polvo'),
  array('id_ords' => 'restart_8992','data_provider' => 'The Restart Project','country' => 'GBR','partner_product_category' => 'Misc ~ Steam cleaner','product_category' => 'Vacuum','brand' => 'Polti','year_of_manufacture' => '','product_age' => '','repair_status' => 'Repairable','event_date' => '2018-09-01','problem' => 'The steam cleaner was tripping the user\'s RCD at home. The machine was dismantled, signs of leakage and corrosion were observed on a parting line between a bolted-flange boiler, the item was given a fail by a portable appliance tester, and further testing found it to be short-circuiting to earth somewhere. By methodically disconnecting and testing for leakage, the problem was isolated to the heating element, which was found to be corroding. As the heaing element was soldered into the boiler and not replaceable, the entire boiler would have to be replaced at a significant part cost, and the great majority of the appliance\'s embodied energy. Whether to choose part replacement was left up to the user.','googletrans' => 'The steam cleaner was tripping the user\'s RCD at home. The machine was dismantled, signs of leakage and corrosion were observed on a parting line between a bolted-flange boiler, the item was given a fail by a portable appliance tester, and further testing found it to be short-circuiting to earth somewhere. By methodically disconnecting and testing for leakage, the problem was isolated to the heating element, which was found to be corroding. As the heaing element was soldered into the boiler and not replaceable, the entire boiler would have to be replaced at a significant part cost, and the great majority of the appliance\'s embodied energy. Whether to choose part replacement was left up to the user.','language' => 'en','fault_type_id' => '0','en' => 'The steam cleaner was tripping the user\'s RCD at home. The machine was dismantled, signs of leakage and corrosion were observed on a parting line between a bolted-flange boiler, the item was given a fail by a portable appliance tester, and further testing found it to be short-circuiting to earth somewhere. By methodically disconnecting and testing for leakage, the problem was isolated to the heating element, which was found to be corroding. As the heaing element was soldered into the boiler and not replaceable, the entire boiler would have to be replaced at a significant part cost, and the great majority of the appliance\'s embodied energy. Whether to choose part replacement was left up to the user.','de' => 'Der Dampfreiniger löste den FI-Schutzschalter des Benutzers zu Hause aus. Das Gerät wurde demontiert, an einer Trennlinie zwischen einem Kessel mit Schraubflansch wurden Anzeichen von Leckagen und Korrosion festgestellt, das Gerät wurde von einem tragbaren Gerätetester als nicht funktionstüchtig eingestuft, und weitere Tests ergaben, dass irgendwo ein Kurzschluss mit der Erde vorliegt. Durch systematisches Abklemmen und Prüfen auf Leckagen konnte das Problem auf das Heizelement beschränkt werden, das korrodiert war. Da das Heizelement in den Heizkessel eingelötet und nicht austauschbar war, musste der gesamte Heizkessel ersetzt werden, was mit erheblichen Kosten verbunden war und den größten Teil der Energie des Geräts verschlang. Ob man sich für den Austausch von Teilen entschied, blieb dem Benutzer überlassen.','nl' => 'De stoomreiniger deed de aardlekschakelaar van de gebruiker thuis afgaan. Het apparaat werd gedemonteerd, er werden tekenen van lekkage en corrosie waargenomen op een scheidingslijn tussen een ketel met geboute flens, het onderdeel kreeg een foutmelding van een draagbare apparatentester, en verdere tests wezen uit dat het apparaat ergens kortsluiting maakte met de aarde. Door methodisch loskoppelen en testen op lekkage werd het probleem geïsoleerd tot het verwarmingselement, dat bleek te zijn gecorrodeerd. Aangezien het verwarmingselement in de ketel was gesoldeerd en niet kon worden vervangen, zou de hele ketel moeten worden vervangen, wat aanzienlijke kosten met zich meebracht voor de onderdelen en het grootste deel van de opgenomen energie van het toestel. De keuze voor vervanging van onderdelen werd aan de gebruiker overgelaten.','fr' => 'Le nettoyeur vapeur déclenchait le disjoncteur différentiel de l\'utilisateur à son domicile. La machine a été démontée, des signes de fuite et de corrosion ont été observés sur un plan de joint entre une chaudière à bride boulonnée, l\'élément a été mis en défaut par un testeur d\'appareil portable, et des tests supplémentaires ont révélé qu\'il y avait un court-circuit à la terre quelque part. En débranchant et en testant méthodiquement les fuites, le problème a été isolé à l\'élément chauffant, qui s\'est avéré corrodé. L\'élément chauffant étant soudé à la chaudière et non remplaçable, la chaudière entière devait être remplacée, ce qui représentait un coût important et la plus grande partie de l\'énergie intrinsèque de l\'appareil. Le choix du remplacement des pièces était laissé à l\'appréciation de l\'utilisateur.','it' => 'Il pulitore a vapore faceva scattare l\'RCD dell\'utente a casa. La macchina è stata smontata, sono stati osservati segni di perdita e corrosione su una linea di separazione tra una caldaia a flangia imbullonata, l\'elemento è stato dato in errore da un tester portatile per apparecchi, e ulteriori test hanno scoperto che era in cortocircuito a terra da qualche parte. Scollegando metodicamente e testando le perdite, il problema è stato isolato all\'elemento riscaldante, che si è scoperto essere corroso. Poiché l\'elemento riscaldante era saldato nella caldaia e non sostituibile, l\'intera caldaia avrebbe dovuto essere sostituita con un costo significativo del pezzo e la maggior parte dell\'energia incorporata dell\'apparecchio. La scelta di una sostituzione parziale era lasciata all\'utente.','es' => 'El limpiador de vapor estaba disparando el RCD del usuario en su casa. Se desmontó la máquina, se observaron signos de fuga y corrosión en una línea de separación entre una caldera de brida atornillada, el elemento recibió un fallo por parte de un probador de aparatos portátil, y las pruebas posteriores descubrieron que había un cortocircuito a tierra en alguna parte. Al desconectar y comprobar metódicamente las fugas, el problema se aisló en el elemento calefactor, que estaba corroído. Como el elemento calefactor estaba soldado a la caldera y no era sustituible, había que cambiar toda la caldera, lo que suponía un coste importante de la pieza y la mayor parte de la energía incorporada del aparato. La decisión de optar por la sustitución de la pieza se dejó en manos del usuario.'),
